INSERT INTO `content` VALUES('8', '8', '0', '0', '', 't1__subheadline@@Full Service Werbeagentur Konzept fünf\r\nAllgemeine Geschäftsbedingungen - AGB##t5__umbruch@@umbruch##t1__fliesstext_fett@@1. Gegenstand des Vertrages##t1__fliesstext@@1.1. Die nachstehenden allgemeinen Geschäftsbedingungen gelten für alle Rechtsgeschäfte von KONZEPT FÜNF mit ihren Vertragspartnern, nachstehend in Kurzform \"Kunde\" genannt. Von diesen Geschäftsbedingungen abweichende Bedingungen des Kunden werden von KONZEPT FÜNF nur nach gesonderter und schriftlicher Anerkennung akzeptiert.\r\n\r\n1.2. Alle Vereinbarungen, die zwischen KONZEPT FÜNF und dem Kunde zwecks Ausführung eines Auftrages getroffen werden, sind in schriftlicher Form zu vereinbaren. Änderungen, Ergänzungen und Nebenabreden bedürfen zu ihrer Wirksamkeit der Schriftform.\r\n\r\n1.3. Diese Geschäftsbedingungen gelten auch für alle künftigen Geschäftsbeziehungen mit dem Kunden, auch wenn sie nicht nochmals ausdrücklich vereinbart werden.\r\n\r\n1.4. KONZEPT FÜNF erbringt Dienstleistungen aus den Bereichen: Beratung, Konzeption, Planung, Gestaltung, Produktion, Werbeschaltungen jeglicher Werbe-, Design und Kommunikationsmaßnahmen, sowie sonstige Leistungen nach Absprache. Die detaillierten Beschreibungen der zu erbringenden Dienstleistungen ergeben sich aus den Briefings, oder Ausschreibungsunterlagen, Projektverträgen, sowie deren Anlagen und Leistungsbeschreibungen von KONZEPT FÜNF.##t5__umbruch@@umbruch##t1__fliesstext_fett@@2. Vertragsbestandteile und Änderungen des Vertrags##t1__fliesstext@@2.1. Grundlage für die Arbeit von KONZEPT FÜNF und Vertragsbestandteil ist neben dem Projektvertrag und seinen Anlagen das vom Kunden auszuhändigende Briefing. Wird das Briefing vom Kunden von KONZEPT FÜNF mündlich oder fernmündlich mitgeteilt, so erstellt  KONZEPT FÜNF über den Inhalt ein verbindliche Angebot. Darüber hinaus gehende Mehrleistungen werden mit dem Kunden vor Leistungserbringung besprochen und gesondert in Rechnung gestellt.\r\n\r\n2.2. Jede Änderung und/oder Ergänzung des Vertrages und/oder seiner Bestandteile bedarf der Schriftform. Dadurch entstehende Mehrkosten hat der Kunde zu tragen.\r\n\r\n2.3. Ereignisse höherer Gewalt berechtigen KONZEPT FÜNF, das vom Kunden beauftragte Projekt um die Dauer der Behinderung und einer angemessenen Anlaufzeit hinauszuschieben. Ein Schadensersatzanspruch vom Kunden gegen KONZEPT FÜNF resultiert daraus nicht. Dies gilt auch dann, wenn dadurch für den Kunden wichtige Termine und/oder Ereignisse nicht eingehalten werden können und/oder nicht eintreten.##t5__umbruch@@umbruch##t1__fliesstext_fett@@3. Urheber- und Nutzungsrechte##t1__fliesstext@@3.1. Der Kunde erwirbt mit der vollständigen Zahlung des vereinbarten Honorars für die vertraglich vereinbarte Dauer und im vertraglich vereinbarten Umfang die Nutzungsrechte an allen von KONZEPT FÜNF im Rahmen dieses Auftrages gefertigten Arbeiten. Diese Übertragung der Nutzungsrechte gelten, soweit eine Übertragung nach deutschem Recht möglich ist und gelten für die vereinbarte Nutzung im Gebiet der Bundesrepublik Deutschland. Nutzungen die über dieses Gebiet hinausgehen, bedürfen einer schriftlichen Vereinbarung im Rahmen des Auftrages oder einer gesonderten schriftlichen Nebenabrede. Nutzungsrechte an Arbeiten, die bei Beendigung des Vertrages noch nicht bezahlt sind, verbleiben vorbehaltlich bei KONZEPT FÜNF.\r\n\r\n3.2. Die im Rahmen des Auftrages erarbeiteten Leistungen sind als persönliche, geistige Schöpfungen durch das Urheberrechtsgesetz geschützt. Diese Regelung gilt auch dann als vereinbart, wenn die nach dem Urheberrechtgesetz erforderliche Schöpfungshöhe nicht erreicht ist.\r\n\r\n3.3. KONZEPT FÜNF darf die von ihr entwickelten Werbemittel angemessen und branchenüblich signieren und den erteilten Auftrag für Eigenwerbung publizieren. Diese Signierung und werbliche Verwendung kann durch eine entsprechende gesonderte Vereinbarung zwischen KONZEPT FÜNF und Kunde ausgeschlossen werden.\r\n\r\n3.4. Die Arbeiten von KONZEPT FÜNF dürfen vom Kunden oder vom Kunden beauftragte Dritte weder im Original noch bei der Reproduktion geändert werden. Jede Nachahmung, auch die von Teilen des Werkes, ist unzulässig. Bei Zuwiderhandlung steht KONZEPT FÜNF vom Kunden ein zusätzliches Honorar von mindestens der 2,5 fachen Höhe des ursprünglich vereinbarten Honorars zu. \r\n\r\n3.5. Die Übertragung eingeräumter Nutzungsrechte an Dritte und/oder Mehrfachnutzungen sind, soweit nicht im Erstauftrag geregelt, honorarpflichtig und bedürfen der Einwilligung von KONZEPT FÜNF.\r\n\r\n3.6. Über den Umfang der Nutzung steht KONZEPT FÜNF ein Auskunftsanspruch zu.##t5__umbruch@@umbruch##t1__fliesstext_fett@@4. Vergütung##t1__fliesstext@@4.1. Es gilt die im Vertrag vereinbarte Vergütung. Zahlungen sind, wenn nicht anders vertraglich geregelt, innerhalb von 7 Tagen nach Rechnungsstellung ohne jeden Abzug fällig. Bei Überschreitung der Zahlungstermine steht KONZEPT FÜNF ohne weitere Mahnung ein Anspruch auf Verzugszinsen in Höhe von 10% über dem Basiszinssatz nach §1 des Diskontsatzüberleitungsgesetzes zu. Das Recht zur Geltendmachung eines darüber hinausgehenden Schadens bleibt von dieser Regelung unberührt. Mahnkosten und die Kosten - auch außergerichtlicher - anwaltlicher Investitionen gehen zu Lasten des Kunden.\r\n\r\n4.2. Erstreckt sich die Erarbeitung der vereinbarten Leistungen über einen längeren Zeitraum oder umfasst mehrere Einheiten so kann KONZEPT FÜNF dem Kunden Abschlagszahlungen über die bereits erbrachten Teilleistungen in Rechnung stellen. Diese Teilleistungen müssen nicht in einer für den Kunden nutzbaren Form vorliegen und können auch als reine Arbeitsgrundlage auf Seiten KONZEPT FÜNF verfügbar sein.\r\n\r\n4.3. Bei Änderungen oder Abbruch von Aufträgen, Arbeiten und dergleichen durch den Kunden und/oder wenn sich die Voraussetzungen für die Leistungserstellung ändert, werden KONZEPT FÜNF alle dadurch anfallenden Kosten ersetzt und KONZEPT FÜNF von jeglichen Verbindlichkeiten gegenüber Dritten freigestellt.\r\n\r\n4.4. Bei einem Rücktritt des Kunden von einem Auftrag vor Beginn des Projektes, berechnet  KONZEPT FÜNF dem Kunden folgende Prozentsätze vom ursprünglich vertraglich geregelten Honorar als Stornogebühr: bis sechs Monate vor Beginn des Auftrages 10%, ab sechs Monate bis drei Monate vor Beginn des Auftrages 25%, ab drei Monate bis vier Wochen vor Beginn des Auftrages 50%, ab vier Wochen bis zwei Wochen vor Beginn des Auftrages 80%, ab zwei Wochen vor Beginn des Auftrags 100%.\r\n\r\n4.5. Alle in Angeboten und Aufträgen genannten Preise und die daraus resultierend zu zahlende Beträge verstehen sich zuzüglich der gesetzlich gültigen Umsatzsteuer in der jeweils geltenden Höhe. Künstlersozialabgabe, Zölle, oder auch sonstige nachträglich entstandenen Abgaben werden an den Kunden weiterberechnet. \r\n\r\n4.6. Einwendungen gegen Entgeltabrechnungen seitens KONZEPT FÜNF sind sofort nach Rechnungserhalt, aber spätestens 1 Woche nach Abrechnungs- oder Rechnungsdatum, ohne das hierdurch jedoch die Fälligkeit berührt wird, zu erheben. Die Unterlassung rechtzeitiger Einwendungen gilt als Genehmigung.##t5__umbruch@@umbruch##t1__fliesstext_fett@@5. Eigentumsvorbehalt##t1__fliesstext@@5.1 KONZEPT FÜNF behält sich das Eigentum an den Liefergegenständen bis zur vollständigen Zahlung vor.\r\n\r\n5.2. An Entwürfen und Werkzeichnungen werden nur Nutzrechte eingeräumt, nicht jedoch Eigentumsrechte übertragen.\r\n\r\n5.3. Die Originale sind daher in angemessener Frist unbeschädigt zurückzugeben sofern keine andere Vereinbarung getroffen wurde.\r\n\r\n5.4. Die Zusendung und etwaige Rücksendungen der Arbeiten gehen auf Gefahr und Rechnung des Kunden.\r\n\r\n5.5. KONZEPT FÜNF ist nicht verpflichtet Dateien, Quelldateien oder Layouts, die im Computer erstellt wurden, an den Kunden herauszugeben. Wünscht der Kunde die Herausgabe der Computerdaten oder Quelldaten, so ist dies gesondert zu vereinbaren und zu vergüten. Hat KONZEPT FÜNF dem Kunden Computerdateien zur Verfügung gestellt, dürfen diese nur mit vorheriger Zustimmung von KONZEPT FÜNF geändert werden.##t5__umbruch@@umbruch##t1__fliesstext_fett@@6. Sonderleistungen, Neben- und Reisekosten##t1__fliesstext@@6.1. Sonderleistungen wie z.B. Korrekturlesen von Texten, Umarbeiten, Änderungen von Reinzeichnungen, vorbereitende Notwendigkeiten zur Auftragsabwicklung, Drucküberwachung etc. werden dem Zeitaufwand entsprechend gesondert berechnet.\r\n\r\n6.2. Werden mehr Konzeptionen bzw. Entwürfe von Werbemitteln auf Wunsch des Kunden angefertigt, so werden diese gesondert in Rechnung gestellt. Die Anzahl der Entwürfe wird im Angebot festgehalten und bedarf eines ausführlichen Briefings des Kunden. \r\n\r\n6.3. Auslagen für technische Nebenkosten, insbesondere speziellen Materials, Anfertigungen von Modellen, Fotos, Zwischenaufnahmen, Reproduktionen, Fotosatz, Druck etc. sind vom Kunden zu erstatten.\r\n\r\n6.4. Kosten für Reisen, die im Zusammenhang mit dem Auftrag zu unternehmen sind, werden nur in Rechnung gestellt, wenn diese mit dem Kunden vereinbart worden sind.##t5__umbruch@@umbruch##t1__fliesstext_fett@@7. Zusatzleistungen##t1__fliesstext@@7.1. Unvorhersehbarer Mehraufwand bedarf der gegenseitigen Absprache und gegebenenfalls der Nachhonorierung.\r\n\r\n7.2. Die Produktionsüberwachung durch KONZEPT FÜNF erfolgt nur Aufgrund besonderer Vereinbarungen. Bei der Übernahme der Produktionsüberwachung ist KONZEPT FÜNF berechtigt, nach eigenem Ermessen - unter Berücksichtigung der Vorstellungen und Vorgaben des Kunden - die notwendigen Entscheidungen zu treffen und entsprechende Anweisungen zu erteilen. Für diesen Aufwand berechnet die KONZEPT FÜNF eine Handlingspauschale.\r\n\r\n7.3. Vor der Ausführung und Vervielfältigung werden dem Kunden von KONZEPT FÜNF Korrekturmuster vorgelegt. Von allen vervielfältigten Arbeiten werden KONZEPT FÜNF 4 einwandfreie ungefaltete Belege (bei wertvollen Stücken eine Angemessene Zahl) unentgeltlich überlassen. KONZEPT FÜNF ist berechtigt diese Stücke zum Zweck der Eigenwerbung zu verwenden.##t5__umbruch@@umbruch##t1__fliesstext_fett@@8. Kennzeichnung##t1__fliesstext@@8.1 KONZEPT FÜNF ist berechtigt, auf allen Werbemitteln und bei allen Werbemaßnahmen auf den Urheber hinzuweisen, ohne das dem Kunden dadurch ein Entgeltanspruch zusteht.\r\n\r\n8.2 KONZEPT FÜNF ist berechtigt auf ihren Internet-Webseiten mit Namen und Firmenlogo auf die Geschäftsbeziehung hinzuweisen.##t5__umbruch@@umbruch##t1__fliesstext_fett@@9. Lieferfristen##t1__fliesstext@@9.1 Die Lieferverpflichtungen von KONZEPT FÜNF sind erfüllt, sobald die Arbeiten und Leistungen von KONZEPT FÜNF zur Versendung gebracht worden sind. Das Risiko der Übermittlung (z.B. Beschädigung, Verlust oder Verzögerung), gleich mit welchen Medium übermittelt wird, trägt der Kunde.\r\n\r\n9.2. Lieferfristen und Liefertermine sind nur verbindlich, wenn der Kunde etwaige Mitwirkungspflicht (z.B. Beschaffung von Unterlagen, Freigaben, Bereitstellung von Informationen, Erstellung von Leistungskatalogen / Pflichtheften) ordnungsgemäß erfüllt hat und die Termine von KONZEPT FÜNF schriftlich bestätigt worden sind.\r\n\r\n9.3 Durch Verzögerung auf Kundenseite kann eine fristgerechte Terminhaltung nicht mehr gewährleistet werden.\r\n\r\n9.4. Von KONZEPT FÜNF zur Verfügung gestellte Vorlagen und Entwürfe sind nach Farb-, Bild-, Strich und Tongestaltung erst dann verbindlich, wenn ihre entsprechende Realisierungsmöglichkeit schriftlich von KONZEPT FÜNF bestätigt worden ist.\r\n\r\n9.5. Gerät KONZEPT FÜNF mit ihren Leistungen in Verzug, so ist ihr zunächst eine angemessene Nachfrist zu gewähren. Nach fruchtlosem Ablauf der Nachfrist kann der Kunde vom Vertrag zurücktreten. Ersatz des Verzugsschadens kann nur bis zur Höhe des Auftragwertes (Eigenleistung ausschließlich Vorleistung und Material) verlangt werden.##t5__umbruch@@umbruch##t1__fliesstext_fett@@10. Geheimhaltungspflicht##t1__fliesstext@@10.1. KONZEPT FÜNF verpflichtet sich, sämtliche ihr im Zusammenhang mit dem Vertragsabschluss zugänglichen Informationen und Unterlagen, die als vertraulich bezeichnet werden, oder nach sonstigen Umständen eindeutig als Geschäfts- oder Betriebsgeheimnisse des Kunden erkennbar sind, geheim zu halten und sie - soweit nicht zur Erreichung des Vertragszweckes geboten - weder aufzuzeichnen noch weiterzugeben.\r\n\r\n10.2. KONZEPT FÜNF hat durch geeignete vertragliche Abreden mit den für sie tätigen Arbeitnehmern und Arbeitnehmerinnen und / oder Beauftragten sichergestellt, das auch diese jede eigene Verwertung, Weitergabe oder unbefugte Aufzeichnung solcher Geschäfts- und Betriebsgeheimnisse unterlassen.\r\n\r\n10.3 Entsprechende Verpflichtungen treffen den Kunden in Bezug auf Geschäfts- und Betriebsgeheimnisse von KONZEPT FÜNF, dies gilt insbesondere auch für die während der Entwicklungsphase / Zusammenarbeit zur Kenntnis gebrachten Ideen und Konzepte.\r\n\r\n10.4. Der Kunde ist damit einverstanden, dass persönliche Daten (Bestandsdaten) und andere Informationen, die sein Nutzungsverhalten betreffen (Verbindungsdaten), wie z. B. der Zeitpunkt, die Anzahl und Dauer der Verbindungen, Zugangswörter, Up- und Downloads, von KONZEPT FÜNF während der Dauer des Vertrages gespeichert werden, soweit dies zur Erfüllung des Vertragszweckes erforderlich ist. Mit der Erhebung und Speicherung erklärt der Kunde sein Einverständnis. Die erhobenen Bestandsdaten verarbeitet und nutzt KONZEPT FÜNF auch zur Beratung seiner Kunden, zur Eigenwerbung und zur Marktforschung für eigene Zwecke und zur bedarfsgerechten Gestaltung seiner Leistung. Der Kunde kann einer solchen Nutzung widersprechen. KONZEPT FÜNF wird diese Daten ohne dessen Einverständnis nicht an Dritte weiterleiten. Dies gilt nur insoweit nicht, als die Daten ohnehin öffentlich zugänglich sind oder KONZEPT FÜNF gesetzlich verpflichtet ist, Dritte insbesondere Strafverfolgungsbehörden, solche Daten zu offenbaren oder soweit international anerkannte technische Normen dies vorsehen und der Kunde nicht widerspricht.##t5__umbruch@@umbruch##t1__fliesstext_fett@@11. Pflichten des Kunden##t1__fliesstext@@11.1. Der Kunde stellt KONZEPT FÜNF alle für die Durchführung des Projekts benötigten Daten und Unterlagen unentgeltlich zur Verfügung. Alle Arbeitsunterlagen werden von KONZEPT FÜNF sorgsam behandelt, vor dem Zugriff Dritter geschützt und nur zur Erarbeitung des jeweiligen Auftrages genutzt.\r\n\r\n11.2. Der Kunde wird im Zusammenhang mit einem beauftragten Projekt Auftragsvergaben an andere Agenturen oder Dienstleister nur nach Rücksprache und im Einvernehmen mit KONZEPT FÜNF erteilen.##t5__umbruch@@umbruch##t1__fliesstext_fett@@12. Gewährleistung und Haftung##t1__fliesstext@@12.1. Von KONZEPT FÜNF gelieferte Arbeiten und Leistungen hat der Kunde unverzüglich nach Erhalt, jedenfalls jedoch binnen drei Werktagen und in jedem Falle aber vor einer Weitergabe, zu prüfen und Mängel unverzüglich nach Entdeckung zu rügen. Unterbleibt die unverzügliche Überprüfung oder Mängelanzeige, bestehen keine Ansprüche des Kunden.\r\n\r\n12.2. Bei gerechtfertiger Mängelrüge werden die Mängel in angemessener Frist behoben.\r\n\r\n12.3. Das Risiko der rechtlichen Zulässigkeit der durch KONZEPT FÜNF erarbeiteten und durchgeführten Maßnahmen wird vom Kunden getragen. Das gilt insbesondere für den Fall, das die Aktionen und Maßnahmen gegen Vorschriften des Wettbewerbsrechts, des Urheberrechts und der speziellen Werberechtsgesetze verstoßen. KONZEPT FÜNF ist jedoch verpflichtet, auf rechtliche Risiken hinzuweisen, sofern ihr diese bei ihrer Tätigkeit bekannt werden. Der Kunde stellt KONZEPT FÜNF von Ansprüchen Dritter frei, wenn KONZEPT FÜNF auf ausdrücklichen Wunsch des Kunden gehandelt hat, obwohl sie dem Kunden Bedenken im Hinblick auf die Zulässigkeit der Maßnahmen mitgeteilt hat. Die Anmeldung solcher Bedenken durch KONZEPT FÜNF beim Kunden hat unverzüglich nach bekanntwerden in schriftlicher Form zu erfolgen. Erachtet KONZEPT FÜNF für eine durchzuführende Maßnahme eine wettbewerbsrechtliche Prüfung durch eine besonders sachkundige Person oder Institution für erforderlich, so trägt nach Absprache mit KONZEPT FÜNF die Kosten hierfür der Kunde.\r\n\r\n12.4. Mit der Genehmigung von Entwürfen, Reinzeichnungen oder Werkzeichnungen durch den Kunden übernimmt dieser die Verantwortung für die Richtigkeit für Bild und Text.\r\n\r\n12.5. Für die von Kunden freigegebene Entwürfe, Reinzeichnungen oder Werkzeichnungen entfällt jede Haftung von KONZEPT FÜNF.\r\n\r\n12.6. Für die wettbewerbs- oder warenzeichenrechtliche Zulässigkeit und Eintragsfähigkeit der Entwürfe haftet KONZEPT FÜNF nicht.\r\n\r\n12.7. KONZEPT FÜNF übernimmt keine Haftung für die von Kunden gestellten Bilder, Daten und Schriften.\r\n\r\n12.8. KONZEPT FÜNF haftet in keinem Fall wegen der in den Werbemaßnahmen enthaltenen Sachaussagen über Produkte und Leistungen des Kunden. KONZEPT FÜNF haftet auch nicht für die patent-, urheber- und markenrechtliche Schutz- oder Eintragungsfähigkeit der im Rahmen des Auftrages gelieferten Ideen, Anregungen, Vorschläge, Konzeptionen und Entwürfe. \r\n\r\n12.9. KONZEPT FÜNF haftet nur für Schäden, die sie oder ihre Erfüllungsgehilfen vorsätzlich oder grob fahrlässig herbeigeführt haben. Die Haftung von KONZEPT FÜNF wird in der Höhe beschränkt auf den einmaligen Ertrag von KONZEPT FÜNF, der sich aus dem jeweiligen Auftrag ergibt. Die Haftung von KONZEPT FÜNF für Mangelfolgeschäden aus dem Rechtsgrund der positiven Vertragsverletzung ist ausgeschlossen, wenn und in dem Maße, wie sich die Haftung von KONZEPT FÜNF nicht aus einer Verletzung der für die Erfüllung des Vertragszweckes wesentlichen Pflichten ergibt.\r\n\r\n12.10. Soweit KONZEPT FÜNF notwendige Fremdleistungen in Auftrag gibt, sind die jeweiligen Auftragnehmer/Vertragspartner keine Erfüllungsgehilfen von KONZEPT FÜNF. Eine Haftung für die Leistungen und Arbeitsergebnisse solcher Auftragnehmer/ Vertragspartner wird ausgeschlossen, soweit den gesetzlichen Vorschriften nichts entgegensteht.##t5__umbruch@@umbruch##t1__fliesstext_fett@@13. Verwertungsgesellschaften##t1__fliesstext@@13.1. Der Kunde verpflichtet sich, eventuell anfallende Gebühren an Verwertungsgesellschaften wie beispielsweise an die Gema abzuführen. Werden diese Gebühren von KONZEPT FÜNF verauslagt, so verpflichtet sich der Kunde, diese KONZEPT FÜNF gegen Nachweis sofort zu erstatten.\r\n\r\n13.2. Der Kunde ist darüber informiert, das bei der Auftragsvergabe im künstlerischen, konzeptionellen und werbeberaterischen Bereich an eine nicht-juristische Person eine Künstlersozialabgabe an die Künstlersozialkasse zu leisten ist. Diese Abgabe darf vom Kunden nicht von der Agenturrechnung in Abzug gebracht werden. Für die Einhaltung der Anmelde- und Abgabepflicht ist der Kunde zuständig und selbst verantwortlich.##t5__umbruch@@umbruch##t1__fliesstext_fett@@14. Leistungen Dritter##t1__fliesstext@@14.1. Von KONZEPT FÜNF eingeschaltete Freie Mitarbeiter oder Dritte sind Erfüllungsgehilfen- oder Verrichtungsgehilfen von KONZEPT FÜNF. Der Kunde verpflichtet sich, diese, im Rahmen der Auftragsdurchführung von KONZEPT FÜNF eingesetzten Mitarbeiter, im Laufe der auf den Abschluss des Auftrages folgenden 12 Monate ohne Mitwirkung von KONZEPT FÜNF weder unmittelbar noch mittelbar mit Projekten zu beauftragen.##t5__umbruch@@umbruch##t1__fliesstext_fett@@15. Arbeitsunterlagen und elektronische Daten##t1__fliesstext@@15.1. Alle Arbeitsunterlagen, elektronische Daten und Aufzeichnungen, die im Rahmen der Auftragserarbeitung auf Seiten von KONZEPT FÜNF angefertigt werden, verbleiben bei KONZEPT FÜNF. Die Herausgabe dieser Unterlagen und Daten kann vom Kunden nicht gefordert werden. KONZEPT FÜNF schuldet mit der Bezahlung des vereinbarten Honorars die vereinbarte Leistung, nicht jedoch die zu diesem Ergebnis führenden Zwischenschritte in Form von Skizzen, Entwürfen, Produktionsdaten etc.##t5__umbruch@@umbruch##t1__fliesstext_fett@@16. Media-Planung und Media-Durchführung##t1__fliesstext@@16.1. Beauftragte Projekte im Bereich Media-Planung besorgt KONZEPT FÜNF nach bestem Wissen und Gewissen auf Basis der ihr zugänglichen Unterlagen der Medien und der allgemein zugänglichen Marktforschungsdaten. Ein bestimmter werblicher Erfolg schuldet KONZEPT FÜNF dem Kunden durch diese Leistungen nicht. \r\n\r\n16.2. Bei umfangreichen Media-Leistungen ist KONZEPT FÜNF nach Absprache berechtigt, einen bestimmten Anteil der Fremdkosten dem Kunden in Rechnung zu stellen und die Einbuchung bei den entsprechenden Medien erst nach Zahlungseingang vorzunehmen. Hierfür wird eine Handlingspauschale in Rechnung gestellt. Für eine eventuelle Nichteinhaltung eines Schalttermins durch einen verspäteten Zahlungseingang haftet KONZEPT FÜNF nicht. Ein Schadensersatzanspruch vom Kunden gegen KONZEPT FÜNF entsteht dadurch nicht.##t5__umbruch@@umbruch##t1__fliesstext_fett@@17. Vertragsdauer, Kündigungsfristen##t1__fliesstext@@17.1. Der Vertrag tritt mit seiner Unterzeichnung in Kraft. Er wird für die im Vertrag genannte Vertragslaufzeit bzw. für ein bestimmtes Projekt abgeschlossen. Ist der Vertrag auf unbestimmte Zeit geschlossen, kann dieser mit einer Frist von drei Monaten von beiden Seiten zum Monatsende gekündigt werden. Das Recht zur fristlosen Kündigung aus wichtigem Grund bleibt von dieser Regelung unberührt. Eine Kündigung bedarf der Schriftform.##t5__umbruch@@umbruch##t1__fliesstext_fett@@18. Streitigkeiten##t1__fliesstext@@18.1. Kommt es im Laufe oder nach Beendigung eines Auftrages zu einem Streitfall bezüglich des beauftragten Projektes, so ist vor der Einleitung eines gerichtlichen Verfahrens ein außergerichtliches Mediationsverfahren zu durchlaufen. Bei Streitigkeiten in Fragen der Qualitätsbeurteilung oder bei der Höhe der Honorierung werden externe Gutachten erstellt um möglichst eine außergerichtliche Einigung zu erzielen. Die Kosten hierfür werden von Kunden und KONZEPT FÜNF geteilt.##t5__umbruch@@umbruch##t1__fliesstext_fett@@19. Schlussbestimmungen##t1__fliesstext@@19.1. Der Kunde ist nicht dazu berechtigt, Ansprüche aus dem Vertrag abzutreten.\r\n\r\n19.2. Die Allgemeinen Geschäftsbedingungen des Kunden werden nicht Vertragsbestandteil.\r\n\r\n19.3. Eine Aufrechnung oder die Geltendmachung eines Zurückbehaltungsrechts durch den Kunden ist nur mit anerkannten oder rechtskräftig festgestellten Gegenansprüchen zulässig.\r\n\r\n19.4. Es gilt das Recht der Bundesrepublik Deutschland. Erfüllungsort und Gerichtsstand ist Offenbach am Main.\r\n\r\n19.5. Sollte eine Bestimmung dieser Allgemeinen Geschäftsbedingungen ganz oder teilweise unwirksam sein oder ihre Rechtswirksamkeit zu einem späteren Zeitpunkt verlieren, so wird hierdurch die Gültigkeit der übrigen Bestimmungen nicht berührt. Anstelle der unwirksamen Bestimmung soll im Wege der Vertragsanpassung eine andere angemessene Regelung gelten, welche wirtschaftlich dem am Nächsten kommt, was die Vertragsparteien gewollt hätten, wenn ihnen die Unwirksamkeit der Regelung bekannt gewesen wäre.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '1', '', '', '', '', '0', '0', '', '0');
