INSERT INTO `content` VALUES('34', '15', '0', '0', '', 't3__headline@@Werbeagentur für Anzeigen-Gestaltung und Anzeigen-Schaltung##t3__fliesstext@@Als Werbeagentur bieten wir Ihnen das volle Leistungsspektrum für die Konzeption, der Umsetzung der Idee bis zur Vorlagenerstellung für Print- und Onlinemedien nach Verlagsvorgaben. \r\nSprechen Sie uns an für die Neugestaltung oder Weiterentwicklung von Anzeigen und Anzeigen-Serien und deren zuverlässige und termingerechte Veröffentlichung nach Mediaplan.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
