INSERT INTO `content` VALUES('37', '16', '0', '0', '', 't3__headline@@Fahrzeugbeschriftung, Autobeschriftung, Flottenbeschriftung##t3__subheadline@@Unterwegs, Tag und Nacht werben. Mit Personenwagen, Transportern, LKW´s und Nutzfahrzeugen.##t3__fliesstext@@Wenige Werbemittel sind so präsent und effektiv wie die Autobeschriftung, doch unvorteilhafte Beispiele für Fahrzeugbeschriftungen gibt es auf den Straßen zuhauf. Profitieren Sie von unserer langjährigen Erfahrung als Werbeagentur und nutzen Sie unser breites Leistungspektrum von der kreativen Gestaltung über die qualitativ hochwertige Produktion und Montage. \r\n\r\nOb Smart oder eine komplette Flottenbeschriftung, wir schneidern Ihre individuelle, mobile Werbung nach Maß.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('38', '16', '0', '0', '', 't2__bild@@710##t2__subheadline@@Autobeschriftung für Personenfahrzeug wie Elektroautos oder Kleinfahrzeuge##t2__fliesstext@@Autobeschriftungen für Kleinfahrzeuge wie Personenwagen, so groß sie auch sein mögen, können sowohl vollflächig als auch in Teilen (Folienplott) erfolgen. Gerade Kleinfahrzeuge wie der Smart sind als Lieferfahrzeug  im Foodbereich oder Servicefahrzeug in der mobilen Pflege sehr beliebt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
