INSERT INTO `content` VALUES('46', '19', '0', '0', '', 't3__headline@@Website - Internetseite##t3__subheadline@@Konzeption, Gestaltung, Texterstellung, Übersetzung, Bilderstellung, Programmierung, Betreuung, SEO##t3__fliesstext@@Als Webagentur liefert Konzept fünf für Ihr Web-Projekt die passenden Lösungen. Wir stellen Ihre Botschaft und Inhalte in den Mittelpunkt. Vom Firmenauftritt bis zu Projektseiten gemeinnütziger Organisationen bieten wir Lösungen und die praktische Umsetzung. \r\nMit der richtigen Webseite vermitteln Sie Ihre Leistung und Kompetenz auf vielfache Weise. Als Agentur erstellen wir erfolgreiche Online-Strategien, ansprechende Gestaltungen, durchdachte Benutzerführungen, technisch ausgereifte Programmierungen und liefern eine verlässliche Pflege und kontinuierliche Suchmaschinenoptimierung.\r\nMit unserem erfahrenen Team von Webentwicklern, Grafikern, Textern und Fotografen garantieren wir erfolgreiche Ergebnisse für das Web. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('47', '19', '0', '0', '', 't1__bild@@213##t1__interner_link_@@130|Website - Gestaltung##t1__subheadline@@Website - Gestaltung##t1__fliesstext@@Die Gestaltung einer Website ist stark davon geprägt, ob sie verkaufen oder informieren soll, ob sie an Endkonsumenten oder ein Fachpublikum gerichtet ist und welche Funktionen die Website erfüllen soll. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
