INSERT INTO `content` VALUES('49', '20', '0', '0', '', 't3__headline@@SEO - Suchmaschinenoptimierung##t3__subheadline@@SEO bzw. Suchmaschinenoptimierung wäre echt toll, wenn man mit einem Klick alles lösen könnte. Das Gegenteil ist leider der Fall. Die On-Page und Off-Page-Optimierung.##t3__fliesstext@@Wer Ihnen heute in kürzester Zeit und für relativ wenig Geld einen Top 10 Platz bei Google verspricht, ist schlicht und ergreifend unseriös. Hier wird viel versprochen, aber sehr wenig gehalten. Schnell sind ein paar tausend schmerzliche Euro in den Sand gesetzt.\r\nSEO ist ein Prozess, der Wissen, selbständiges Engagement, Zeit und einiges an Handarbeit benötigt. On-Page und / oder  Off-Page.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2422', '20', '0', '0', '', 't1__subheadline@@Content-Management-System - Was Sie noch wissen sollten##t1__fliesstext@@Social Media ist in einigen Brachen keine Alternative, sondern gehört schlichtweg dazu. Das bedeutet aber nicht unweigerlich, dass sie eine eigene Seite bei facebook benötigen.\r\n\r\nAls SEO-Agentur betrachten wir die Suchmaschinenoptimierung (SEO) als ganzheitlichen und vor allem andauernden Prozess. Einfach nur Linkaufbau zu betreiben und die nötigen Metas platzieren reicht schlicht nicht aus. Die Zeiten sind vorbei und wir sind auch nicht traurig darüber.\r\n\r\nGarantien sind unseriös. Wir lassen nachweisbare Erfolge für uns sprechen. Analysieren und dokumentieren den Fortschritt und berichten Ihnen unaufgefordert davon.\r\n\r\nWir freuen uns natürlich darüber, dass wir eine recht große Nachfrage für die Suchmaschinenoptimierung haben. Bitte haben sie daher Verständnis, dass wir manchmal nicht alle Anfragen annehmen können. Fragen Sie uns einfach erst einmal an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '13', '', '', '', '', '0', '0', '', '0');
