INSERT INTO `content` VALUES('2425', '61', '0', '0', '', 't1__bild@@1670##t2__subheadline@@Konzeptarbeit und Entwurfsvisualisierungen##t2__fliesstext@@Als Werbeagentur im Bereich der Ausbildung und Weiterbildung sind wir gerne Ansprechpartner für die Konzeptarbeit und Visualisierungen von Projekten, wenn die inhaltliche Ausrichtung schon definiert ist. Sie suchen eine Agentur, die Text- und Fotoerstellung, Illustration und die Gestaltung von Präsentationen für Aus- und Weiterbildung liefert? Fragen Sie uns an. Wir liefern Ihnen inhaltliche und visuelle Umsetzungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
