INSERT INTO `content` VALUES('59', '23', '0', '0', '', 't3__headline@@Corporate Design##t3__subheadline@@Konzept fünf als Corporate Design Agentur##t3__fliesstext@@Der erste Eindruck zählt und bleibt in Erinnerung. Damit Sie bei Ihrem Kunden in guter Erinnerung bleiben, entwickeln wir als Corporate Design Agentur für Sie eine individuelle Strategie und setzten sie mit einer kreativen, attraktiven und konsequenten Gestaltung um. Ein positiver Wiedererkennungseffekt ist garantiert.\r\n\r\nNeben der Neuentwicklung sind wir auch Ansprechpartner für die Modernisierung (Relaunch) Ihres bestehenden CD`s. Und ob neu oder face-lifting: wir dokumentieren Ihr zukünftiges Corporate Design in Form von Handbüchern bzw. Style-Guides oder Manuals und unterstützen Sie aktiv bei der Einführung in Ihr Unternehmen oder in den Markt.\r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
