INSERT INTO `content` VALUES('62', '24', '0', '0', '', 't3__headline@@Displays für den POS - Gestaltung und Produktion##t3__subheadline@@Als Werbeagentur setzen wie ihr Produkt am POS in Szene.##t3__fliesstext@@Konzept fünf platziert als Full Service Agentur auch Ihre Werbung am POS, direkt am Kunden. Displays sind eine der Anforderungen an unsere Werbeagentur, die wir nicht nur gestalterisch, sondern auch technisch annehmen. Neben der Gestaltung kümmern wir uns um den entsprechenden Produzenten, realisieren eine erfolgreiche Kundenansprache und eine hohe Werbewirkungsamkeit.\r\nDisplays aus Voll- oder Wellpappe aus Metall oder Kunststoff, ausgeführt als Hängedisplay oder Standdisplay. Wir bieten Ihnen individuelle Gestaltungslösungen und professionelle Produktion. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('63', '24', '0', '0', '', 't1__bild@@133##t1__interner_link_@@125|Stand-Display Metall##t1__subheadline@@Stand-Display aus Metall##t2__fliesstext@@Thekendisplays und freistehende Displays, die stetig neu befüllt bzw. mit neuen Sortimenten ausgestattet werden, sind meist aus Metall oder Kunststoff. Als Full Service Werbeagentur kümmern wir uns nicht nur um die formale Ausgestaltung, sondern auch um die technische Umsetzung bzw. Produktion.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('64', '25', '0', '0', '', 't4__bild@@55##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('65', '25', '0', '0', '', 't3__headline@@Events und Veranstaltungen##t3__subheadline@@Ihre Bühne, unser Beitrag##t3__fliesstext@@Ob Vortragsreihen oder Produktvorstellungen, Informations- oder Jubiläumsveranstaltungen, Mitarbeiterfest, Ausstellung. Ein gelungener Event begeistert alle. Wir begleiten Sie auf den Weg dorthin.\r\nAls Full Service Werbeagentur sind wir keine spezialisierte Eventagentur, aber genau deswegen sind unsere Veranstaltungskonzepte auch meist etwas anders. \r\nWir erstellen Ihr Veranstaltungkonzept, gestalten die notwendige Ausstattung (Ankündigungs- und Werbemittel wie Plakate, Flyer und Mailings) und platzieren die entsprechende Werbung. Viele unserer Auftraggeber schätzen dieses Angebot, weil sie wissen, dass auch diese Aufgabe in guten Händen liegt.  \r\nLocation, Catering, Möbel, Personal, alles, was dazugehört. Bühne auf!##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('66', '25', '0', '0', '', 't1__bild@@918##t1__subheadline@@Musikveranstaltungen##t1__fliesstext@@Musikveranstaltungen sind keine Veranstaltungen, sondern ein Event. Hier braucht man keine Notizblöcke und Kugelschreiber. Hier ist es wichtig, sein Zielpublikum zu kennen und richtig anzusprechen, auch visuell. Als Werbeagentur beschäftigen wir uns mit der Musikrichtung und dem Profil des Künstlers und realisieren entsprechende Vermarktungs- und Positionierungskonzepte.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('67', '26', '0', '0', '', 't4__bild@@139##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('68', '26', '0', '0', '', 't3__headline@@Flyer##t3__subheadline@@Flyer fliegen lassen##t3__fliesstext@@Der Informationsgehalt hoch und die Produktion günstig. Der Flyer, ursprünglich das Flugblatt, ist aus der Werbung nicht wegzudenken. Aus gutem Grund und ein guter Grund für uns, Ihnen als Werbeagentur alles für die Erstellung eines Flyers anzubieten: Konzept, Grafik, Layout, Text, Bildrecherche und -einkauf, Fotoerstellung, Illustration, technische Darstellungen und Diagramme, Produktion und Versand. \r\n\r\nMit Konzept fünf erreicht das älteste Werbemittel im zeitgemäßen Design sicher Ihre Zielgruppe.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('69', '26', '0', '0', '', 't1__bild@@299##t1__interner_link_@@142|Flyer Schule Zecken Zeckenkarte##t1__subheadline@@Zeckenkarte und Flyer##t1__fliesstext@@Als Werbeagentur haben wir nicht selten die Aufgabe, einen Zusatznutzen dem Flyer beizufügen. Ob Karten, Samenmuster oder wie in diesem Fall eine Kunststoffkarte, mit dem man Zecken aus der Haut ziehen kann. Immer ist es eine Aufgabe der Konfektionierung bzw. Zusammenführung von Flyer und Produkt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('70', '27', '0', '0', '', '', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('71', '27', '0', '0', '', 't3__headline@@Kalender##t3__subheadline@@Ein Werbemittel, das genutzt wird##t3__fliesstext@@Kalender sind als Werbegeschenke beliebt und binden, wenn sie gut gemacht sind, Ihre Kunden über Monate an Ihr Produkt oder Unternehmen. Gut gemacht, von der Konkurrenz abhebend, nicht für die Schublade, das ist unsere Aufgabe.\r\n\r\nKonzept fünf ist Ihr Ansprechpartner, wenn es um aussergewöhnliche Formate, kreative Illustrationen oder die Umsetzung von Fotos für Ihren Kalender geht. Vom Kleinformat bis zum Großformat, vom Standard bis zum Unikat.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
