INSERT INTO `content` VALUES('83', '31', '0', '0', '', 't3__headline@@Online-Banner##t3__subheadline@@Gestaltung, Programmierung, Schaltung und Betreuung##t3__fliesstext@@Bannerwerbung, als Instrument für die Marktpräsenz und Markenbildung, ist die am meisten genutzte und erfolgreichste Werbeform im Internet. \r\n\r\nKreative Webbanner für Ihre Zielgruppe zu gestalten ist eine Leistung, die wir als Webagentur zieloptimiert umsetzen. Als Full Service Webagentur liefern wir auch Programmierung, Flash oder Java - Animation, herkömmliche GIF-Animation und Optimierung.\r\n\r\nIhr Vorteil: ein Ansprechpartner für die komplette Umsetzung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
