INSERT INTO `content` VALUES('86', '32', '0', '0', '', 't3__headline@@Online Mailing##t3__subheadline@@Flexibel, schnell und kostengünstig. Das ist Online Mailing.##t3__fliesstext@@Der Versand von Online Mailings ist ein ausgezeichnetes Werbeinstrument, um mit Ihren Interessenten und Kunden in einen direkten digitalen Dialog zu treten. Gerade zur Kundengewinnung und Kundenbindung sind E-Mail-Kampagnen im Vergleich zu klassischen Werbeformen flexibler, schneller und kostengünstig einsetzbar.\r\n\r\nWir beraten Sie gerne und liefern Ihnen Gestaltung, Text, Foto, Redaktion, Programmierung und Versand.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
