INSERT INTO `content` VALUES('90', '33', '0', '0', '', 't1__bild@@69##t1__headline@@Mappe mit DVD##t1__subheadline@@Datenträger in Mappen##t1__fliesstext@@DVD`s können einfach mit Klemmpunkten aus Hartkunststoff oder Schaumstoff befestigt werden. Wer sicher gehen will, nutzt eine selbstklebende Klarsichthülle.##t1__interner_link_@@bitte ziel wählen|##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
