INSERT INTO `content` VALUES('92', '34', '0', '0', '', 't3__headline@@Marken-Agentur - Markenentwickung und Markengestaltung##t3__subheadline@@Als Marken-Agentur entwickeln und gestalten wir Marken##t3__fliesstext@@Als unabhängige Werbe- und Markenagentur sind wir auf ganzheitliche Strategien und Konzepte für die Markenentwicklung, Markendesign (Brand Design) und Markenkommunikation ausgerichtet. \r\nUnsere Werbe- und Markenagentur bietet für Kleinunternehmen, dem Mittelstand und Großunternehmen abgestimmte Konzepte für die Erstellung von geeigneten Markennamen (Naming), Claimentwicklung, Beratung, Analyse, Konzepte, Umsetzung, Gestaltungslösungen und und die entsprechende einheitliche Markenkommunikation.##t3__fliesstext@@Die Markenentwicklung, Markenbildung und -gestaltung ist immer die Grundlage für eine strategischen Einführung. Ziel ist nicht nur, dass die Zielgruppe die Marke erkennt, sondern auch das Markenimage wahrnimmt  und entsprechend mit Produkt und Unternehmen in Verbindung bringt.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
