INSERT INTO `content` VALUES('95', '35', '0', '0', '', 't3__headline@@Online Newsletter##t3__subheadline@@##t3__fliesstext@@Online Newsletter sind perfekt geeignet für die Kommunikation mit Kunden, Interessenten und Mitarbeitern. Ihr Einsatz sollte gut geplant und durchdacht sein, da dieses Kommunikationsinstrument bei übermäßigem und ungezieltem Einsatz schnell an Stärke und Wirkung verliert.\r\n\r\nVertrauen Sie auf unsere Erfahrung. Wir erstellen für Sie individuelle Newsletter-Strategien und bieten Full-Service, von der Gestaltung bis zum Versand. Auch für die Analyse und Optimierung bestehender Newsletter-Kampagnen sind wir Ihr Ansprechpartner.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
