INSERT INTO `content` VALUES('107', '39', '0', '0', '', 't3__headline@@Newsletter von unserer Werbeagentur##t3__subheadline@@Full-Service für die Gestaltung und Umsetzung von Newsletter-Publikationen##t3__fliesstext@@Als Werbeagentur erstellen wir alles, was Sie für die Erstellung von Print- oder Online-Newsletter benötigen. Mit einer eigenen Redaktion können Sie die Realisierung und Betreuung komplett vergeben und Teilleistungen durch unsere Agentur umsetzen lassen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
