INSERT INTO `content` VALUES('125', '45', '0', '0', '', 't3__headline@@Besondere Visitenkarten - Die ausgefallene Art der Selbstdarstellung##t3__subheadline@@Visitenkarten mit ausgefallenen Faltungen und ungewöhnlichen Materialien wie Aluminium, Edelstahl, Holz, edlen Papieren und Sonder-Druckverfahren.##t3__fliesstext@@Visitenkarte ist nicht gleich Visitenkarte. Sie suchen kreative Lösungen und Ideen für die Gestaltung und Produktion von einzigartigen, individuellen Visitenkarten als \"Türöffner\"? Klassisch auf edlen Papieren, neuen Faltungen und Stanzungen oder besonderen Materialien?\r\nMöglich ist nahezu alles, es ist nur eine Frage der Kreativität, der \"Forschungsarbeit\" und des Preises.\r\nKonzept fünf bietet als Werbeagentur besondere Materialien wie z.B. Aluminium, Edelstahl, Holz oder edle Papiere an. Die Ergebnisse sind mit Standardvisitenkarten über Online-Shops nicht vergleichbar.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('126', '45', '0', '0', '', 't1__bild@@368##t1__subheadline@@Visitenkarten aus Edelstahl - Edelstahlvisitenkarten##t1__fliesstext@@Wenn Gold und Silber dann doch etwas überzogen ist, sind Visitenkarten aus Edelstahl die wohl wertigste Umsetzungsform von besonderen Visitenkarten. Sie werden im Einzelverfahren geätzt und sind ab 100 Stück erhältlich.##t1__interner_link_@@148|Visitenkarten aus Edelstahl - Edelstahlvisitenkarten##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
