INSERT INTO `content` VALUES('131', '47', '0', '0', '', 't3__headline@@Zeitschriften - Zeitungen##t3__subheadline@@Ihre Zeitschrift, unsere Kompetenz##t3__fliesstext@@Bei der Gestaltung und Produktion von Zeitschriften oder Zeitungen ist es für unsere Kunden von Vorteil, dass wir diese Projekte kontinuierlich begleiten. Wir kennen die Zielgruppen, das jeweilige Corporate Design und alle Feinheiten im Ablauf.\r\nSie suchen einen verläßlichen Partner für Ihre regelmäßigen Veröffentlichungen? Wir sind Ihr Ansprechpartner. Vom Gestaltungskonzept und dessen kreative Umsetzung über einzelne Bestandteile, wie Texterstellung, Satz bzw. Satzarbeiten, Illustration oder Fotokonzepte. Natürlich kümmern wir uns auch um die Redaktion, Reinzeichnung, Produktion, Archivierung und den Vertrieb.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
