INSERT INTO `content` VALUES('134', '48', '0', '0', '', 't3__headline@@Multimedia##t3__subheadline@@Als Full Service Werbeagentur wird man zwangsläufig auch zu Multi-Media-Agentur##t3__fliesstext@@Konzept fünf ist keine spezialisierte Multi-Media-Agentur sondern eine Full Service Werbe- und Webagentur die alle Kommunikations- und Werbekanäle nutzt und bedient. Im Bereich Multimedia bieten wir die Planung, Organisation, Realisierung und Kontrolle sämtlicher Kommunikations- und Werbemaßnahmen, die durch das Zusammenspiel von Text-, Graphik, Ton-, Bild- und Filmelementen für unterschiedliche Medienkanäle entstehen. \r\n\r\nWir bieten Konzepte und Realisierungen für professionelle Audioproduktionen für Radio oder Hörfunk inklusive Tonstudio, Sprechern und Jingle oder Videoproduktionen wie Firmenpräsentationen, Dokumentationen und Spots, die wir, je nach Anforderung, mit unsern professionellen Fachleuten und Partnern zusammen erstellen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('135', '48', '0', '0', '', 't1__bild@@266##t1__interner_link_@@137|Multimedia-DVD-Produktion##t1__subheadline@@DVD-Produktion##t1__fliesstext@@Frankfurt am Strand - Eine DVD-Produktion für ein kommunales Sportprojekt mit Einbindung von Film, Text und Bilddatenbank mit eigener eigener Menüführung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
