INSERT INTO `content` VALUES('137', '49', '0', '0', '', 't3__headline@@3D Visualisierung und Rendering##t3__subheadline@@Renderings als Verständnishilfe oder für optimierte Darstellungen##t3__fliesstext@@3D Visualisierungen oder Renderings sind hervorragende Vermarktungshilfen, wenn z.B. Immobilien oder Produkte noch nicht vorhanden sind. 3D Visualisierungen ermöglichen, vorhandene Produkte in ein besseres Licht zu rücken, wenn dem Fotografen die Mittel ausgehen oder helfen, komplexe Abläufe oder Zusammenhänge verständlich zu visualisieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('138', '49', '0', '0', '', 't1__bild@@76##t1__subheadline@@3D Visualisierung von\r\nAnlagen oder Maschinen##t1__interner_link_@@116|3D Visualisierung von Investitionsgütern, Anlagen, Maschinen und Bauteilen##t1__fliesstext@@Groß dimensionierte Maschinen und Anlagen in Fertigungshallen oder schon ausgelieferte Sonderanfertigungen stellen Fotografen vor Grenzen. 3D-Visualisierungen sind hier die Lösung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
