INSERT INTO `content` VALUES('161', '57', '0', '0', '', 't3__headline@@Video / Film##t3__subheadline@@Video- und Filmproduktionen für Unternehmen, Internet und Fernsehen##t3__fliesstext@@Im Rahmen unserer Kundenbetreuung realisiert Konzept fünf Video und Filmproduktionen für Internet, Fernsehen und anderen Veröffentlichungszwecken.\r\nWir bieten Ihnen professionelle, budgetangepasste Video- und Audioproduktionen.\r\nOb Grosskonzern, Klein- und Mittelständische Unternehmen oder Start-up, unsere Dienstleistungen sind individuell auf den Kunden abgestimmt und auf die jeweiligen Medien und das Zielpublikum ausgerichtet.\r\nVon der ersten Film-Idee bis zum fertigen Produkt, konzipieren, gestalten, betreuen, produzieren und animieren wir Filme für Werbung, Internetanwendungen und Unternehmenspräsentation am POS oder für Messen.\r\n\r\nAls Agentur bieten wir ein großes, Netzwerk an Filmschaffenden und professionelle Teams, die den Dreh in allen Belangen begleiten, organisieren und letztendlich möglich machen.\r\n\r\nOb Inhouse- oder \"on location\", partnerschaftlich und kreativ sind wir für Ihr Filmprojekt da.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('163', '58', '0', '0', '', 't4__bild@@21##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('164', '58', '0', '0', '', 't3__headline@@Werbeagentur für Arbeitsvermittlung, Personalvermittlung, Jobvermittlung##t3__subheadline@@Die Vermittlung von Arbeit ist Thema unserer Werbeagentur##t3__fliesstext@@Arbeitsvermittlung ist ohne Frage eines der Schwerpunktthemen unserer Werbeagentur. \r\nJobvermittlung, Zeitarbeit, Integrationsmaßnahmen, Headhunting, Outplacement, alles Themen, mit denen wir uns intensiv befassen und Kommunikationskonzepte oder Kampagnen für Unternehmen, öffentliche Einrichtungen und Ministerien erstellen.\r\nDazu gehören Unternehmen, die sich auf die Personalvermittlung in spezifische Branchen ausgerichtet haben, öffentliche Einrichtungen, die sich für die Integration und die Arbeitsvermittlung von Menschen mit Behinderung engagieren oder Bundesministerien, für die wir als Werbeagentur z.B. Kampagnen wie Chance 50 plus umgesetzt haben.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('165', '58', '0', '0', '', 't1__bild@@241##t1__interner_link_@@131|Spezialisierte Personalvermittlung##t1__subheadline@@Spezialisierte Personalvermittlung##t1__fliesstext@@In der Personalvermittlung gibt es einige spezialisierte Unternehmen. Sie vermitteln Spezialisten für klar abgegrenzte Bereiche. In diesem Fall für Personal für den Bereich Erneuerbare Energien. Neben des Marketings bzw. der Werbung und Kommunikation bieten wir Ihnen auch Programmierungen für Akquisition und Datenverwaltung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
