INSERT INTO `content` VALUES('173', '61', '0', '0', '', 't3__headline@@Unsere Werbeagentur und die Themen Ausbildung und Weiterbildung##t3__subheadline@@Weiter- und Ausbildung. Ein zentrales Thema unserer Gesellschaft##t3__fliesstext@@Ob im Handwerk, dem öffentlichen Dienst oder bei Großunternehmen, qualifiziertes Personal bekommt man konstruktiv durch Ausbildung und kontinuierlicher Weiterbildung. Inzwischen ist es vielen auch klar geworden. Warum? Weil eben dieses Personal in Deutschland und auch dem europäischen Ausland knapp wird. Entsprechend intensiviert sich der Wettbewerb und die Anfragen an unserer Werbeagentur steigen. Gute Konzepte sind gefragt, gute Angebote auch. Wir beraten Sie nicht nur in der externen Kommunikation sondern helfen Ihnen auch, sich inhaltlich klar zu positionieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('174', '61', '0', '0', '', 't1__bild@@176##t1__subheadline@@Ausbildung im Handwerk##t1__fliesstext@@Recycling-Fachkraft ist einer von vielen Ausbildungsberufen. Auch in diesem Bereich, wie im gesamten Handwerk sucht man nach fähigen Berufseinsteigern. Die Zeiten sind vorbei, wo Schulabgänger \"unbegrenzt\" zur Verfügung stehen und für eine Ausbildung bereitstehen. Aktive Öffentlichkeitsarbeit über Print- und Online-Medien wird zunehmend immer wichtiger.##t1__interner_link_@@119|Ausbildung Recycling ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('175', '62', '0', '0', '', 't4__bild@@50##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('176', '62', '0', '0', '', 't3__headline@@Soziale Einrichtungen tun Gutes ##t3__subheadline@@und wir reden gerne darüber.##t3__fliesstext@@In sozialen Einrichtungen wird tagtäglich hervorragende Arbeit geleistet. Darüber gesprochen wird deutlich seltener.\r\nWir wissen: mit falsche Versprechungen riskieren unsere Kunden die eigene Glaubwürdigkeit als seriöser sozialer Träger. Auch \"Hochglanz\" wird häufig skeptisch beäugt. Nicht nur deshalb ist Fingerspitzengefühl gefragt. Und natürlich viel Leistung für ein häufig knappes Budget.\r\nKommunikation zu sozialen Themen und für soziale Einrichtungen zu gestalten und umzusetzen, ist uns eine Herzensangelegenheit und eine der zentrale Aufgabe unserer Werbeagentur.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('177', '62', '0', '0', '', 't1__bild@@338##t1__subheadline@@Stadtführer für Menschen mit Behinderung##t1__fliesstext@@Als Werbeagentur entwickeln, gestalten und produzieren wir Stadtführer für unterscheidliche Zielgruppen. Zum Beispiel Stadtführer zu Themen wie Freizeit, Kunst und Touristik. In diesem Beispiel ein städtisches Projekt zur Unterstützung von Menschen mit Behinderungen und Sozialen Einrichtungen.##t1__interner_link_@@144|Stadtführer für Menschen mit Behinderung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
