INSERT INTO `content` VALUES('205', '72', '0', '0', '', 't4__bild@@44##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('206', '72', '0', '0', '', 't3__headline@@Unsere Werbeagentur in Sachen Jugend##t3__subheadline@@Zielgruppengerechte Ansprache und Gestaltung für Jugendliche##t3__fliesstext@@Neben Werbekampagnen, Jugendmarketing und Jugendkommuniktion erstellen wir als Werbeagentur vor allem auch Aufklärungskampagnen oder Informationskampagnen für kommunale Einrichtungen und Ministerien.\r\nFür die Kommunikation in diesen Bereich ist es nötig, am Puls der Zeit zu sein. Wir verfügen über eine Fachredaktion, die vor allem auf die Aufbereitung und Vermittlung von pädagogischen Inhalten und zeitrelevante Fragen spezialisiert ist. Einige dieser Medien haben wir Ihnen auf diesen Seite zusammengestellt. Wir gestalten, illustrieren, erstellen Konzepte und Texte und sorgen für eine professionelle Beratung und Betreuung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1094', '72', '0', '0', '', 't1__bild@@1133##t2__subheadline@@Jugend, Schule und Beruf##t2__interner_link_@@239|Jugend Schule Beruf##t2__fliesstext@@Von unserer Werbeagentur können Sie erwarten, dass wir Vorgaben optimal umsetzen. Hier: Eine Broschüre für die hessische Landesregierung nach Corporate-Design Vorgaben. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('208', '73', '0', '0', '', 't4__bild@@43##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('209', '73', '0', '0', '', 't3__headline@@Kindergerechte Kommunikation, Kindermarketing, Kinderkommunikation##t3__subheadline@@Wir mögen Kinder##t3__fliesstext@@Wir setzen Informationskampagnen und Aufklärungskampagnen für Kinder und Eltern professionell und zielgruppengerecht um. Mit unserem Team von Grafikern sind unsere momentanen Fachthemen: Sport, Schule, Freizeit, Spiele, Gesundheit, Ratgebern, Integration, Migration, Erziehung, Kindergarten, Kinderrechte und Informationen zu Lesen, Schreiben und Rechnen. \r\n\r\nBei der Kommunikation und Werbung für diesen Bereich ist es nötig, am Puls der Zeit zu sein. Neben den klassischen Themen für Kinder verfügen wir über eine Fachredaktion, die vor allem auf die Vermittlung von pädagogischen Inhalten spezialisiert ist. Als Werbeagentur liefern wir Ihnen die redaktionelle wie gestalterische Umsetzung an.\r\nUnserer Agentur liefert seit über 15 Jahren Lösungen für didaktische, kindergerechte Kommunikation.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('210', '73', '0', '0', '', 't1__bild@@191##t1__subheadline@@Schüler-Kalender##t1__fliesstext@@Kinder werden Schüler und spätestens ab da wird lesen und rechnen ein zentrales Thema. \r\nWas hat ein Schülerkalender denn damit zu tun? \r\nRecht einfach: Der Kalender enthält und vermittelt nicht nur Monate und Jahreszeiten, sondern eine ganze Menge mehr an Zusatzinformationen, die für Kinder interessant sind. Cool und kindergerecht gestaltet sollte der Kalender natürlich schon sein.##t1__interner_link_@@127|Schüler-Kalender##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
