INSERT INTO `content` VALUES('215', '75', '0', '0', '', 't3__headline@@Kunst und Kultur##t3__subheadline@@##t3__fliesstext@@Kultur und Kunst = Leidenschaft und Kreativität = Konzept fünf.\r\n\r\nProjekte in den Bereichen Kultur und Kunst liegen uns besonders am Herzen. Auf der breiten Basis unserer Leistungen entwickeln wir hier maßgeschneiderte Kommunikationsinstrumente, natürlich immer unter Berücksichtigung der individuellen Situation des Kunden und seiner finanziellen Möglichkeiten. \r\nDurch den gezielten Einsatz werden auch gängige Werbemaßnahmen besonders für Kultur- und Kunstanbieter zu überzeugenden Trägern ihrer Botschaft.\r\n\r\nWir freuen uns, unsere Kompetenzen zielsicher einzusetzen, um viele Menschen von dem Genuss und Wert von Kultur und Kunst zu überzeugen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('216', '75', '0', '0', '', 't1__bild@@898##t1__subheadline@@Kunst / Kultur - Ballett, Theater, Oper##t1__fliesstext@@Kunst / Kultur - Werbung für darstellende Künste wie Ballett, Theater oder Oper benötigt nicht nur eine kontinuierliche Kommunikation mit dem angestammten Publikum mit Einladungen, Programmhinweisen oder Künstlerdarstellungen. Es geht vor allem auch darum, ein neues Publikum über Print- und Online-Medien anzusprechen. Als Werbeagentur bieten wir nicht nur individuelle und kreative Gestaltung an, sondern haben auch professionelle Fotografen, die sich mit dem Metier auskennen und liefern Ihnen neben der Produktion auch entsprechende Vermarktungskonzepte.    ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
