INSERT INTO `content` VALUES('221', '77', '0', '0', '', 't3__headline@@Unsere Werbeagentur für Maschinenbau, Anlagenbau und Metallbau##t3__subheadline@@Maschinenbau, Anlagenbau, Metallbau: Von 3D-Visualisierungen, technischen Datenblättern, über Werbung bis zur Begleitung von Unternehmesgründungen sind wir als Werbeagentur für Sie da.##t3__fliesstext@@Wenn Sie eine Werbeagentur suchen, die Sie im Bereich Maschinenbau, Anlagenbau oder Metallbau nationale und internationale Erfahrung hat, Sie berät und für Sie die entsprechende btob-Kommunikation oder -Werbung realisiert, sind Sie bei uns richtig. Unser Inhaber ist, unter anderem, gelernter Maschinenbauer, Sie müssen ihm also nicht erklären, wofür Ihr Produkt gut ist. Er kennt den Markt und seine Besonderheiten und berät Sie persönlich.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('222', '77', '0', '0', '', 't1__bild@@574##t1__subheadline@@Maschinenbau - Hydraulik, Aggregate und Anlagen##t1__fliesstext@@Als Full Service Werbeagentur betreuen wir Unternehmen, die Aggregate und Anlagen herstellen. Wir liefern ihnen neben der spezifischen BtoB - Werbung einiges mehr, als eine klassische Werbeagentur bieten kann. Technisches Verständnis für Produkte und Märkte, praxisbezogene Umsetzungen von 3D-Visualisierungen, Verfahrensdarstellungen, Diagrammen oder benutzerfreundlichen Tabellen. \r\nGerade mittelständische Unternehmen benötigen einen Partner, der auch Fahrzeugbeschriftungen, Schilder oder die Fassadengestalltung realisiert und im Rahmen des Corporate Designs pflegt und ernst nimmt. Beratend, unkompliziert, bezahlbar.##t1__interner_link_@@176|Maschinenbau - Aggregate und Anlagen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
