INSERT INTO `content` VALUES('227', '79', '0', '0', '', 't3__headline@@Werbeagentur Outdoor / Freizeit##t3__subheadline@@Wer beschäftigt sich nicht gerne Outdoor mit der Freizeit?##t3__fliesstext@@Mit dem notwendigen Branchenwissen bieten wir Konzeption, Design und Produktion im Bereich Sport, Camping und Freizeit an. Von Profiequipment bis Accessories konzeptionieren und gestalten wir zielgruppenoptimierte Werbe- und Kommunikationsmaßnahmen, entwickeln Namen und Marken, gestalten das Corporate Design, inklusive unterschiedlicher Verpackung in verschiedenen Verpackungsarten.\r\n\r\nOutdoor ist ein relativ junger Begriff im deutschen Sprachgebrauch. Dahinter steht das höchste Gut, die Freizeit und deren Ausgestaltung vor allem im Freien zu verbringen. In kürzester Zeit ist daraus ein boomender Markt geworden. Wir sind dabei und unterstützen Sie in der Vermarktung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('228', '79', '0', '0', '', 't1__bild@@273##t1__subheadline@@Outdoor-Sport für Kinder##t1__fliesstext@@Beach-Soccer ist weniger bekannt als Beach-Volleyball, aber ein optimaler Sport für Kinder. Viel Bewegung, geringe Verletzungsgefahr und viel Spaß. Als Werbeagentur unterstützen wir hier ein Projekt zur Erstellung von Beach-Soccer-Plätzen im städtischen Umfeld. ##t1__interner_link_@@139|Freizeit - Beach-Soccer##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
