INSERT INTO `content` VALUES('230', '80', '0', '0', '', 't3__headline@@Pharma Gesundheit##t3__subheadline@@Eine Frage des Vertrauens.##t3__fliesstext@@Werbung in diesem Bereich hat ihre eigenen Gesetze. Vertrauen Sie auf unsere Erfahrung.\r\nWir bieten die Entwicklung von Marken und Werbekonzepten genauso an, wie die die Gestaltung und Reinzeichnung von Verpackungen, Thekendisplays oder Schaufensterausstattungen. Pharmaspezifische Anforderungen und pharmagerechte Texte realisieren wir ebenso, wie den Relaunch von Verpackungen oder Werbekampagnen.\r\nMit unseren Leistungen und Know-how sind Sie an diesem hart umkämpften Markt perfekt aufgestellt. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('231', '80', '0', '0', '', 't1__bild@@293##t1__interner_link_@@141|Gesundheit Erste Hilfe##t1__subheadline@@Gesundheit: Ratgeber Erste Hilfe##t1__fliesstext@@Ein praktischer Ratgeber zum Thema Erste Hilfe für Kinder als Registerbroschüre. Eines von vielen kleinen und großen Ratgeber, die unsere Werbeagentur zum Thema Gesundheit erstellt hat.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
