INSERT INTO `content` VALUES('239', '83', '0', '0', '', 't3__headline@@Unsere Umwelt ist unsere Welt.##t3__subheadline@@Wir können mehr als blauer Engel.##t3__fliesstext@@Wir denken bei Umwelt nicht nur an Recyclingpapier oder die Farbe grün. Als Full-Service-Werbeagentur haben wir erfolgreich Umweltkampagnen zu den Themen Energieberatung, Klimawandel, \"grünes Bauen\", erneuerbare Energien und Elektromobilität umgesetzt.\r\nIn diesem Bereich betreuen wir Unternehmen und Städte / Kommunen (Umweltämter, Planungsverbände, Energiereferate). Von der Personalvermittlung von Fachkräften für diesen Bereich, innovative Lösungen für das Elektrorecycling oder dem Einsatz von Technologien unter dem Begriff erneuerbare Energien sind wir als Agentur für Werbung und als Grafikagentur Ihr fachkompetenter Ansprechpartner.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('240', '83', '0', '0', '', 't1__bild@@988##t1__subheadline@@Umwelt: Green City - Green Commune##t1__fliesstext@@Projekte zum Thema Umwelt und Energie werden immer wichtiger. Für Großstädte stellt sich (nicht nur für New York) die Frage, wie machen wir unsere Städte lebenswert und attraktiv?\r\nGreen City und Green Commune werden in den nächsten Jahren immer mehr zum zentralen Thema werden. Als Werbeagentur liefern wir Ihnen mit viel Sachverstand und Know-how  Kommunikation und Werbung für Ihre Projekte.##t1__interner_link_@@223|Umwelt Klima Energie Beratung Green City - Green Commune##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('241', '84', '0', '0', '', 't4__bild@@61##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('242', '84', '0', '0', '', 't3__headline@@Unsere Agentur und Verlage##t3__subheadline@@Konzeption, Gestaltung und PrePress für Verlagspublikationen##t3__fliesstext@@Für Verlage erstellen wir vor allem Konzepte für neue Publikationen und gestalten bestehende Verlagspublikationen. Hier sind eher unsere Leistungen als Grafikagentur gefragt. Zu unseren professionellen Leistungen gehören: Gestaltung, Illustration, Bildbearbeitung, Satz, Fremdsprachensatz und Reinzeichnung für Print- und Onlinemedien. Darüber hinaus sind wir als Team zuverlässig für Terminarbeiten verfügbar und übernehmen organisatorische und administrative Tätigkeiten. Für soziale Bereiche, Kinder, Jugend und Reisen bieten wir Redaktionstätigkeiten und Texterstellung. Fragen Sie uns einfach an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('243', '84', '0', '0', '', 't1__bild@@523##t1__subheadline@@Verlag - Gestaltung von Periodika##t1__fliesstext@@Sie suchen nach einem Grafiker oder einer Grafikerin, die Ihre Periodika gestaltet und für Ihre Produktion fachgerecht nach Ihren Vorgaben aufbereitet?  Sprechen Sie uns an. Als Team bieten wir auch die notwendige Zuverlässigkeit und eine Vielzahl von gestalterischen Umsetzungsmöglichkeiten. Bezahlbar und kreativ.##t1__interner_link_@@168|Verlag Gerstaltung Periodika Grafiker Grafikerin##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
