INSERT INTO `content` VALUES('248', '86', '0', '0', '', 't3__headline@@XXL-Banner Großbanner Außenwerbung##t3__subheadline@@Konzept, Grafikdesign, Druck, Produktion und Montage für Großbanner##t3__fliesstext@@Großformatbanner sind ein Blickfang. Mit der Fernwirkung erzielen sie eine hohe Aufmerksamkeit. Diese exklusive und aufwendige Werbemaßnahme erfordert Planung, ein fundiertes Grafikdesign, Erfahrung und Professionalität bei der Realisation. \r\n\r\nWir bieten wir Ihnen alles, was Sie im Rhein-Main-Gebiet für Ihre XXL-Banner benötigen, inkl. Baugenehmigungen oder Straßensperrungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('249', '86', '0', '0', '', 't1__bild@@1559##t1__subheadline@@XXL-Banner Großbanner Außenwerbung##t1__interner_link_@@299|XXL-Banner Großbanner Aussenwerbung##t1__fliesstext@@Wir erstellen Ihnen gerne ein Angebot für die Gestaltung, Produktion und Montage. Dafür ist es wichtig für uns zu wissen:##t1__aufzaehlung_dots@@Sind druckfähige Dateien, z.B. ein Logo, vorhanden?\r\nWie groß soll das Großbanner werden?\r\nWie sind die Gegebenheiten vor Ort?\r\nWie lange soll das Großbanner plaziert sein?\r\nWie sind Zugangsmöglichkeiten für die Montage?\r\nGibt es eine Baugenehmigung?##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('250', '87', '0', '0', '', 't4__bild@@59##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('251', '87', '0', '0', '', 't3__headline@@Prospekte - Kataloge##t3__subheadline@@Wirkungsvolles Design führt zum Ziel##t3__fliesstext@@Ob Produktprospekt, Produktkatalog oder Imageprospekt: diese Medien sollen Ihre Zielgruppen visuell und inhaltlich für Ihr Unternehmen, Ihre Marke und Ihre Produkte interessieren und begeistern. \r\n\r\nWir gestalten für Sie Einzelkataloge oder periodische Veröffentlichungen, Imageprospekte, Versand-, Produkt- oder Reise - Kataloge. Übersichtlich und ästhetisch. Dazu liefern wir Ihnen einzelne Bestandteile wie Texterstellung, Satzarbeiten, Illustration, Fotokonzept, Redaktion, Reinzeichnung und realisieren die Produktion. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('252', '87', '0', '0', '', 't1__bild@@71##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '2', '3', '', '', '', '', '0', '0', '', '0');
