INSERT INTO `content` VALUES('254', '88', '0', '0', '', 't3__headline@@Philosophie, Leitlinien, Werte .... hat jeder!##t3__fliesstext@@Wir auch!\r\n\r\nKundenzufriedenheit ist das A und O. Der Weg dahin ist unsere Philosophie.\r\nWir arbeiten kreativ, um ein Ergebnis zu entwickeln, dass eine Botschaft erfolgreich verbreitet. Das spornt uns an und ist für uns das Salz in der Suppe.\r\n\r\nDie Identifizierung mit der Aufgabe und den Zielen des Kunden, die Beratung und Konzeption der Projekte erzeugt die Spannung, die wir bei unserer Arbeit brauchen. Wenn wir dann zielsicher treffen und überzeugen, ist das die Bestätigung, dass wir unser Handwerk beherrschen.\r\nHinter Konzept fünf stehen Menschen, die ihr Engagement nicht von der Höhe der Werbebudgets abhängig machen.\r\nGute Werbung läßt sich am Markterfolg messen. Gute Arbeit an der Kundenzufriedenheit.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
