INSERT INTO `content` VALUES('257', '89', '0', '0', '', 't3__headline@@Konzept fünf - Unser Standort##t3__subheadline@@Historisch, ungewöhnlich, inspirierend.##t3__fliesstext@@Offenbach hat eine der besten Hochschulen für Gestaltung in Europa. \r\nPassend dazu ist der Standort von Konzept fünf, in dem historischen und denkmalgeschützten Gebäude der ehemaligen Oehler-Werke im Mathildenviertel Offenbachs.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
