INSERT INTO `content` VALUES('272', '94', '0', '0', '', 't3__headline@@Kreativagentur##t3__subheadline@@Konzept-fünf als Kreativagentur: Kreativität um jeden Preis oder \r\nproduktives Denken und Handeln gegen die Regeln?##t3__fliesstext@@Wir sind eine Full Service Werbeagentur und nennen uns auch so. Darunter fallen typische Leistungen für die Umsetzung von einer Kreativagentur oder eben auch von einer Webagentur oder Grafikagentur. Die wenigsten unserer Ansprechpartner unterscheiden die Begrifflichkeiten. Aber ... Konzept-fünf ist seit jeher eine Kreativagentur.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('273', '94', '0', '0', '', 't1__subheadline@@Konzept-fünf als Kreativagentur##t1__fliesstext@@Unsere Werbeagentur ist seit jeher eine Kreativagentur. Stammt doch der größte Teil der langjährigen Mitarbeiter aus Design- und Marketing - Universitäten und besteht nicht aus Praktikanten. Kreativität kann man bei uns selektiv ordern. Für innovative, neue Produktvisualisierungen oder als Basis für die Kommunikations- und Werbestrategie. Komplett unabhängig von Ihrer Leitagentur oder wenn Sie als Marketingabteilung hier Unterstützung braucht. Allerdings verstehen wir unserer Aufgabe eher darin, diese Kreativität nicht nur zu entwickeln, sondern in ganzheitliche Werbestrukturen einzubinden und zu realisieren. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
