INSERT INTO `content` VALUES('275', '95', '0', '0', '', 't3__headline@@Designagentur##t3__subheadline@@Der Look, die Grundlage aus der alles entsteht - entwickelt durch eine Designagentur\r\n##t3__fliesstext@@Mit unserer Erfahrung und unserem Leistungsportfolio sind wir eine Full Service Werbeagentur, die unter dieser Definition auch als Designagentur Ihr Ansprechpartner ist. Wir freuen uns, neue Unternehmen zu begleiten und Marken zu entwickeln, mit dem Know-how einer Full Service Agentur in Kombination mit studierten Designer und Werbefachleuten, mit viel Marketing-Erfahrung. Wenn man uns als Designagentur anspricht, erwartet man in der Regel die Entwicklung von Corporate Design, die Markenentwicklung (Branding), Verpackungsdesign (Packaging) und Kommunikationsdesign.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('914', '95', '0', '0', '', 't1__subheadline@@Die Designagentur steht am Anfang einer unternehmerischen Tätigkeit##t1__fliesstext@@Man erwartet von einer Werbeagentur in der Regel die strategische Planung und Entwicklung der Basis. Dafür ist eigentlich eine Designagentur zuständig. Werbliche Botschaften werden dann darauf aufgebaut. \r\nDarüber hinaus: Sie wollen ein Produkt gestalten und suchen einen Ansprechpartner . Auch hierfür können Sie uns ansprechen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('913', '95', '0', '0', '', 't1__subheadline@@Konzept fünf als Designagentur##t1__fliesstext@@Unsere Kunden, die zu ca. 55 % aus mittelständischen Unternehmen und 30 % öffentlichen Einrichtungen bestehen, benötigen eine Designagentur, um Kommunikationsmaßnahmen zu entwickeln und Innovationen zu vermarkten. Hier sind kreative Ideen zu Produkten und zur Kommunikation gefragt, aber auch deren professionelle Umsetzung und zuverlässige und zeitnahe Betreuung.\r\n\r\nDas sind wir.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('276', '95', '0', '0', '', 't1__subheadline@@Was können Sie von uns als Designagentur erwarten:##t1__fliesstext@@Sie können von uns erwarten, dass wir relevante Unternehmenskonstanten wie Farben, Typografie, Marken, Text- und Bildsprache für alle Medien entwickeln, beherrschen und pflegen. Dies ist eigentlich eine Spezialisierung, die wir aber, ohne uns zu verbiegen, als Werbeagentur In-House anbieten können.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
