INSERT INTO `content` VALUES('286', '98', '0', '0', '', 't3__headline@@Kunde und Service gehören zusammen.##t3__fliesstext@@Konzept fünf bietet Full - Service, weil wir wissen, dass die umfassende Beratung und Begleitung\r\nunserer Kunden das Ergebnis unserer Arbeit und die Qualität unserer Leistung sichert.\r\n\r\nUnsere flankierenden Leistungen, wie z.B. Werbetext, Fotografie, Grafikdesign bieten wir an, \r\num unsere Kunden professionell zu unterstützen und Projekte aus einer Hand umzusetzen.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
