INSERT INTO `content` VALUES('295', '101', '0', '0', '', 't3__headline@@Administration##t3__subheadline@@Den Überblick Konzeption, Gestaltung und Produktion behalten wir.##t3__fliesstext@@Als Full Service Werbeagentur unterstützen wir Sie in der Administration, Koordination und Abwicklung Ihrer Werbeprojekte.\r\n\r\nDass wir unsere eigenen Leistungen koordinieren, ist klar. Darüber hinaus administrieren wir für Sie externe Agentur weitere, unterschiedliche Gewerke bzw. Zulieferer mit viel Know-how, damit die Fäden nicht auseinanderlaufen oder die Kosten explodieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
