INSERT INTO `content` VALUES('304', '104', '0', '0', '', 't3__headline@@Konfektionierung und Versendung##t3__subheadline@@Kreativität ist wichtig. Eine professionelle Administration auch.##t3__fliesstext@@Zu unserem Service gehört auch das Konfektionieren und Adressieren von Mailings und das Versenden Ihrer Drucksachen.\r\n\r\nWir koordinieren und überwachen dabei die unterschiedlichen Gewerke und gewährleisten eine zuverlässige, termingerechte Umsetzung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('305', '104', '0', '0', '', 't1__fliesstext@@Wir bieten:\r\n\r\n<b>Konfektionieren / Manuelle Verarbeitung von Druckerzeugnissen</b>\r\nOrdnerbestückung oder unterschiedliche Verklebetechniken, Einlegearbeiten oder manuelle Sortierung - auch in hohen Auflagen.\r\n\r\n<b>Verpacken</b>\r\nNeben der manuellen und maschinellen Kuvertierung bieten wir auch das Verpacken oder Umverpacken von Drucksachen und Produkten an.\r\n\r\n<b>Versenden</b>\r\nZum Versenden bieten wir eine umfassende Vorbereitung. Das beinhaltet: Adressdateien aufbereiten, Daten für den Druck konvertieren, Adresskorrektur, Dublettenabgleich und Portoptimierung.\r\n\r\nAngeboten wird der Paket- oder Palettenversand in das In- und Ausland (inkl. Abwicklung von Zollangelegenheiten). Die Versendung erfolgt nach Terminvorgaben oder täglich nach Versandliste.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('306', '105', '0', '0', '', 't4__bild@@1671##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('307', '105', '0', '0', '', 't3__headline@@Webdesign##t3__subheadline@@Individuelles Webdesign ist kein Zauberwerk. Es ist unser Handwerk.##t3__fliesstext@@Unser Webdesign umfasst die individuelle Gestaltung und Struktur Ihrer Webseite. Wir bieten Ihnen eine Internetpräsenz mit Ästhetik, Substanz und mit einer durchdachten Navigation. Keine Kopien oder gekaufte Templates, die andere nutzen.\r\nWir beraten und betreuen Sie von der Strukturierung der Inhalte über das Design bis hin zur technischen Umsetzung. Natürlich stehen wir Ihnen auch mit Rat und Tat zur Seite, wenn Ihre Internetseiten ein neues Gesicht erhalten sollen oder Sie Sonderprogrammierungen benötigen. \r\nNutzen Sie unsere Erfahrung und wir realisieren Ihren branchen- oder zielgruppenoptimierten Webauftritt mit allem, was dazu gehört.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('308', '105', '0', '0', '', 't2__fliesstext_zitat@@\"Design ist auch das, was man nicht sieht.\" - Walter de\'Silva -\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('309', '106', '0', '0', '', 't4__bild@@1672##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('310', '106', '0', '0', '', 't3__headline@@Markenanmeldung##t3__subheadline@@Mit Konzept fünf auf der sicheren Seite##t3__fliesstext@@Um Ihre Waren und/oder Dienstleistungen gegen Nachahmungen zu schützen und von denjenigen anderer Unternehmen  unterscheidbar zu machen, bietet sich die nachweisbare Markenanmeldung an. \r\n\r\nWir organisieren den Prozeß einer Markenanmeldung, erledigen für Sie das notwendige Procedere mit einem Markenanwalt und kümmern uns um die geforderten, professionellen Vorlagen für die Einreichung der Anmeldung.\r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2524', '106', '0', '0', '', 't1__headline@@Markenanmeldung direkt über unsere Werbeagentur!\r\n##t1__subheadline@@Markenanmeldungen in Deutschland und International##t1__fliesstext@@Über unsere Werbeagentur können Sie Logos oder Marken entwickeln und gestalten lassen und auch Ihre Markenanmeldung professionell durchführen. Wir kümmern uns fach- und sachgerecht um den gesamten Prozess und als Werbeagentur um die geforderten, professionellen Vorlagen für die Einreichung. Wir geben Ihnen die Sicherheit, dass ein Markenanwalt kein Megaprojekt aus Ihrer Anmeldung macht!##t2__umbruch@@umbruch##t1__fliesstext_fett@@Allgemeine Informationen zur Markenanmeldung##t1__fliesstext@@Wenn ein Name, Firmenname, Begriff, Logo, Bildzeichen und auch Kombinationen dieser möglichen Zeichenarten, mit denen Unternehmen ihre Waren und/oder Dienstleistungen bezeichnen, um ihre Waren und Dienstleistungen von denjenigen anderer Unternehmen zu unterscheiden, gegen Nachahmungen geschützt werden soll, bietet sich die nachweisbare Markenanmeldung an. Eine Marke vermittelt Informationen über die Herkunft, mit der im Verkehr beispielsweise bestimmte Qualitätsvorstellungen verbunden werden. Die häufig benutzte Bezeichnung \"Markenware\" veranschaulicht die Bedeutung einer Marke für die Ware des Herstellers.\r\n\r\nEine eingetragene Marke ist gesetzlich geschützt. Benutzte aber nicht eingetragene Marken sind nur dann gesetzlich geschützt, wenn sie Verkehrsgeltung aufweisen. Das ist eine schwierige und selten erreichte Eigenschaft, weshalb der Eintragung der Marke der Vorzug gegeben werden sollte.\r\n\r\nEs untersagt, ohne Zustimmung des Markeninhabers im geschäftlichen Verkehr ein identisches Zeichen für Waren oder Dienstleistungen zu benutzen, die mit denjenigen identisch sind, für die sie Markenschutz genießen. Der Markenschutz geht aber noch über identische Übereinstimmungen hinaus. Der Markenschutz ist nämlich auch gegenüber ähnlichen Marken bei identischen oder auch nur ähnlichen Waren/Dienstleistungen wirksam, wenn für das Publikum die Gefahr von Verwechslungen zwischen den sich gegenüberstehenden Marken besteht. Im Markenverletzungsfall können Schadensersatzansprüche geltend gemacht werden und die Unterlassung der Verletzungshandlung verlangt werden.##t2__umbruch@@umbruch##t2__fliesstext_fett@@Markenanmeldung in Deutschland##t2__fliesstext@@Marken können mit nationaler Wirkung z.B. beim Deutschen Patent- und Markenamt angemeldet werden und gelten nach Eintragung in das amtliche Register für das Territorium der Bundesrepublik Deutschland. Das Deutsche Patent- und Markenamt prüft im Anmeldungsverfahren, ob der Eintragung bestimmte absolute Schutzhindernisse entgegenstehen und ob die eingereichte Liste der Waren und Dienstleistungen, für welche die Marke gelten soll, zugelassen werden kann. Nach Veröffentlichung der Markeneintragung können innerhalb einer dreimonatigen Frist Dritte Widerspruch gegen die Anmeldung erheben. Das amtliche Prüfungs- und Eintragungsverfahren sowie ein eventuelles Widerspruchsverfahren kann mit einigen Schwierigkeiten verbunden sein, weshalb es empfehlenswert ist, die Markenanmeldung mit fachkundiger Hilfe durchzuführen. Wir beispielsweise beauftragen mit der Durchführung von Markenanmeldungen unsere erfahrenen Patent- und Markenanwälte.##t2__umbruch@@umbruch##t2__fliesstext_fett@@Markenanmeldungen europäischen Marken##t2__fliesstext@@Neben einer deutschen Markenanmeldung kann auch eine Gemeinschaftsmarke in der EU eingetragen werden. Diese ist dann in der gesamten EU gültig und wird bei dem entsprechenden Amt für die Eintragung von Marken und Geschmacksmustern (HABM) gemäss den Bestimmungen der Gemeinschaftsmarkenverordnung eingetragen. Die Gemeinschaftsmarke gewährt ihrem Inhaber mit nur einer Anmeldung ein ausschließliches Recht in den zur Zeit 28 Mitgliedsstaaten und automatisch in allen neu hinzutretenden Mitgliedsstaaten.##t2__umbruch@@umbruch##t2__fliesstext_fett@@Internationalen Markenanmeldung##t2__fliesstext@@Schließlich ist auch noch die Möglichkeit einer internationalen Markenanmeldung zu erwähnen, welche, ausgehend von einer deutschen Heimateintragung, über die EU hinausgehend mit nur einer Anmeldung einen Markenschutz in vielen Staaten verschaffen kann. Auch die EU kann zu den ausgewählten Ländern/Regionen gehören.##t2__umbruch@@umbruch##t2__fliesstext_fett@@Schutzdauer##t2__fliesstext@@Alle Marken werden zunächst für eine Schutzdauer von 10 Jahren ab Markenanmeldung eingetragen und können beliebig oft für weitere 10 Jahre verlängert werden. Während die technischen Schutzrechte, nämlich Patente und Gebrauchsmuster, maximal nur 20 Jahre bzw. 10 Jahre gelten, sind Marken zeitlich unbegrenzt und stellen daher sehr wertvolle Schutzrechte dar.\r\nFalls Markenschutz erworben wurde, ist es im geschäftlichen Verkehr üblich und zulässig, zusammen mit der Marke das Symbol ® als Hinweis auf eine registrierte Marke zu verwenden und entsprechend grafisch und konsequent darzustellen.\r\n ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
