INSERT INTO `content` VALUES('313', '107', '0', '0', '', 't3__headline@@Grafikdesign##t3__subheadline@@Grafikdesign##t3__fliesstext@@Sie suchen einen kreativen Grafik-Designer? Für Einzelprojekte oder für eine längerfristige Betreuung? Dann sind wir mit Sicherheit der richtige Ansprechpartner.\r\n\r\nWir arbeiten im Bereich Grafik nicht nur auf Etatbasis, sondern auch projektbezogen und bieten professionelle Layout-Erstellung, Illustrationen, Grafiken, Satz / Fremdsprachensatz, Reinzeichnung nach den jeweiligen Auftraggeber- und Herstellervorgaben und eine sachkundige Betreuung und Organisation der Produktion an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2492', '105', '0', '0', '', 't1__bild@@1673##t1__subheadline@@Webdesign für technisch orientierte Unternehmen##t1__fliesstext@@Das das Webdesign eines technischen Unternehmens, dass vorwiegend im BtoB-Bereich aktiv ist, anders aussieht als zum Beispiel einer Website für Mode oder Jugend ist eigentlich klar. Dennoch gibt es viele Beispiele, die komplett am Ziel vorbeigehen. Profitieren Sie von unserer Erfahrung als Webagentur und lassen sich beraten. Es ist keine Frage der Programmierungs- und Gestaltungsart, es ist eine Frage der Branchenkenntnisse.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
