INSERT INTO `content` VALUES('1776', '248', '0', '0', '', 't3__headline@@Ausstattung für den Bereich: Camping und Wandern##t3__subheadline@@Ein kleines Corporate-Design: Marke, Kataloge, Verpackungen##t3__fliesstext@@Als Markteinstieg wurde hier ein kleines Corporate-Design bestehend aus Unternehmensmarke, Katalogen und Verpackungen entwickelt, gestaltet und produziert. Sämtliche Medien sind zweisprachig umgesetzt, um die Produkte auf unterschiedlichen Märkten zu platzieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
