INSERT INTO `content` VALUES('1784', '79', '0', '0', '', 't1__bild@@639##t1__subheadline@@Freizeit - Utilities - Ausstattungsartikel für den Outdoor-Bereich##t1__fliesstext@@Ausstattungsartikel für den Outdoor- und Freizeitbereich sind sehr beliebt. Neben den begehrten Markenartikeln sind Produkte, die die Zugehörigkeit zu einer Sport- oder Freizeitgestaltung zeigen die meist verkauften Artikel. Vom Schlüsselanhänger, spezieller Kleidung bis zum Autoaufkleber.##t1__interner_link_@@183|Freizeit - Utilities##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
