INSERT INTO `content` VALUES('316', '108', '0', '0', '', 't3__headline@@Werbetext##t3__subheadline@@Schreiben kann jeder. Wir können auch Texten.##t3__fliesstext@@Texten ist geplantes Schreiben. Bei Konzept fünf arbeitet sich der Werbetexter in fremde Inhalte ein und erarbeitet ein authentisches Ergebnis, mit einer hohen Werbewirksamkeit.\r\n\r\nBei dem Erstellen von Werbetexten ist vieles zu berücksichtigen. \r\nEin Vorgeschmack auf unsere Leistung:##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
