INSERT INTO `content` VALUES('2471', '109', '0', '0', '', 't1__subheadline@@Individuelle Programmierung und App-Entwicklung##t2__fliesstext@@Individuelle Programmierungen und App-Entwicklungen sind so unterschiedlich, wie das Meer Wellen hat. SAP-Anbindungen, Shop-Systeme mit Konfiguratoren, Online-Datenbanken mit spezifischen Ausrichtungen und, und, und. Nicht alle Wünsche sind möglich, aber viele. Manche Programmierungen sind leichter lösbar, manche echte Forschungsarbeit. Den meisten Dingen haben wir uns gestellt und Lösungen gefunden. Sprechen Sie uns an, vielleicht finden wir eine gute Lösung für Ihre App oder anderen Anforderungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
