INSERT INTO `content` VALUES('319', '109', '0', '0', '', 't3__headline@@Internet-Programmierung / Web-Programmierung / App-Enwicklung##t3__subheadline@@Individuelle Lösungen benötigen individuelle Programmierung##t3__fliesstext@@Auch wenn alle von CMS reden und viele glauben, dann den Olymp damit erreicht zu haben, der Zeitpunkt für individuelle Webprogrammierungen kommt schneller als man denkt. Java-Scribt-Framework, JQuery, AngularJS, EaselJS, Bootstrap, Foundation, Backbone.js, Ember.js sind nur ein kleiner Teil der Möglichkeiten, bestimmte Ziele zu erreichen. Als Webagentur waren wir schon vor dem Internet mit digitalen Medien beschäftigt. Haben sie später Online gebracht und sind seit vielen Jahren Begleiter der immer wieder neuen Medien. Von den alten Programmen gibt es heute kaum mehr als Rudimente. Die professionelle Programmierung von Fachleuten ist geblieben. Und die liefern wir Ihnen, weil wir uns nicht nur damit beschäftigen. Sie sind ein Teil unserer Arbeit. Heute für individuelle Lösungen und App-Entwicklungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
