INSERT INTO `content` VALUES('331', '113', '0', '0', '', 't3__headline@@Mietstudio##t3__subheadline@@Ein besonderer Ort für den besonderen Anlaß##t3__fliesstext@@An unserem Standort befindet sich ein außergewöhnliches Mietstudio, dass für Fotosessions, Filmdrehs, Foto- und Film-Castings, Produktpräsentationen, Filmvorführungen, Seminare und Veranstaltungen gemietet werden kann.\r\n\r\nSprechen Sie uns an!##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('332', '113', '0', '0', '', 't1__fliesstext_fett@@Das Mietstudio im Detail:##t1__aufzaehlung_dots@@120 qm, Raumhöhe 4,20 m\r\nmit Kinoverdunkelung vollständig abdunkelbar\r\n5 m breite feingespachtelte Fotowand weiss\r\nGarderoben- und Schminkbereich \r\nLoungebereich und 20 qm Balkon mit Blick ins Grüne\r\nStarkstromanschluß\r\nWLAN/Internet\r\nausreichend Parkplätze und Equipment für Fotografen vorhanden\r\nStandort: Offenbach bei Frankfurt##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
