INSERT INTO `content` VALUES('391', '116', '0', '0', '', 't5__bild@@75##t5__subheadline@@3D-Visualisierung für Investitionsgüter - Stellen Sie komplexe Ideen einfach dar.##t5__fliesstext@@Mit 3D Bildern und Filmen sind komplexe Ideen einfach darzustellen. Die weiteren Projektschritte sind besser planbar und dienen letztendlich als \"Verstärker\" für Ihre Verkaufsargumente auf Messen und Präsentationen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('368', '49', '0', '0', '', 't2__bild@@105##t2__interner_link_@@bitte ziel wählen|##t2__subheadline@@3D Visualisierung für Architektur und Immobilien##t2__fliesstext_fett@@Architekturvisualisierungen als Lösung für die Planung und Vermarktung.##t2__fliesstext@@Die Immobilienvermarktung von Neuprojekten steht und fällt mit der Vorstellungskraft der jeweiligen Ansprechpartner. 3D-Darstellungen von den Objekten, dem geplanten oder vorhanden Umfeld und Ideen für die Innenausstattung beschleunigen Verständnis und Verkauf.##t2__interner_link_@@117|3D Visualisierung Architektur Immobilien##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('369', '49', '0', '0', '', 't5__bild@@93##t5__subheadline@@3D-Visualisierung für Produkte##t1__fliesstext@@Auf Basis von CAD-Daten erstellen wir 3D-Visualisierungen für den Einsatz für Print, Film und Web. Die Qualität der Computermotive steht real fotografierten Bildern in nichts nach. Im Gegenteil, keine Locationsuche und nachträgliche Farb- und Perspektivenänderungen sind kein Problem.\r\n\r\n##t1__interner_link_@@118|3D-Visualisierung für Produkte##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
