INSERT INTO `content` VALUES('344', '7', '0', '0', '', 't2__headline@@IMPRESSUM\r\n##t2__fliesstext@@Wussten Sie, dass das Impressum bei einem großen Teil der Websites zu den meist besuchtesten Seiten gehört? Nun, dann wünschen wir eine spannende und aufschlussreiche \"Lektüre\".\r\n##t2__umbruch@@umbruch##t2__umbruch@@umbruch##t2__fliesstext@@WERBEAGENTUR Konzept fünf - Design und Werbung\r\nFriedhofstraße 59\r\n63065 Offenbach am Main\r\n(Rhein Main / Frankfurt)\r\n\r\nTel.: 069/98 19 455 - 0\r\nFax: 069/98 19 455 - 22\r\n\r\n##t2__interner_link_in_Zeile@@1|Web: Werbeagentur Konzept-fünf##t2__mail_link_in_Zeile@@info@konzept-fuenf.de|E-Mail: info@konzept-fuenf.de##t2__umbruch@@umbruch##t2__fliesstext@@Inhaber: Diplom-Designer Wolfgang Schwengler\r\nSteuernummer 035 86860837\r\nUSt-Id Nr. DE 179459345\r\n\r\n\r\nWir sind gerne verantwortlich für den Inhalt unserer Seiten, aber nicht mehr für die Inhalte externer Links.##t2__umbruch@@umbruch##t2__subheadline@@Schutzrechte##t2__fliesstext@@Alle Rechte vorbehalten. Sämtliche Inhalte dieser WebSite, insbesondere Texte, Bilder, Grafiken, Sounds, Animationen und Videos, sowie deren Anordnung auf diesen WebSites unterliegen dem Schutz des Urheberrechts und anderer Schutzgesetze.\r\nEine Reproduktion oder Wiedergabe des Ganzen oder von Teilen ist ohne schriftliche Genehmigung nicht gestattet.\r\n\r\nFotorechte\r\nEin Teil der Visualisierungen beinhaltet Fotos von folgenden Bildagenturen:##t2__externer_link_in_zeile@@http://www.shutterstock.com/?language=de|Shutterstock##t2__externer_link_in_zeile@@http://de.fotolia.com|Fotolia##t2__externer_link_in_zeile@@http://www.photocase.de|Photocase##t2__umbruch@@umbruch##t2__subheadline@@Datenschutz##t2__fliesstext@@Die Nutzung unserer Webseite ist in der Regel ohne Angabe personenbezogener Daten möglich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder eMail-Adressen) erhoben werden, erfolgt dies, soweit möglich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdrückliche Zustimmung nicht an Dritte weitergegeben.\r\nWir weisen darauf hin, dass die Datenübertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitslücken aufweisen kann. Ein lückenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht möglich.\r\nDer Nutzung von im Rahmen der Impressumspflicht veröffentlichten Kontaktdaten durch Dritte zur Übersendung von nicht ausdrücklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdrücklich widersprochen. Die Betreiber der Seiten behalten sich ausdrücklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.##t2__umbruch@@umbruch##t2__subheadline@@Datenschutzerklärung für die Nutzung von Facebook-Plugins (Like-Button)##t2__fliesstext@@Auf unseren Seiten sind Plugins des sozialen Netzwerks Facebook (Facebook Inc., 1601 Willow Road, Menlo Park, California, 94025, USA) integriert. Die Facebook-Plugins erkennen Sie an dem Facebook-Logo oder dem \"Like-Button\" (\"Gefällt mir\") auf unserer Seite. Eine Übersicht über die Facebook-Plugins finden Sie hier: http://developers.facebook.com/docs/plugins/. INSERT INTO `content` VALUES('372', '117', '0', '0', '', 't3__headline@@3D Visualisierung für Immobilien und Architektur##t3__subheadline@@Die beste Hilfe bei der Immobilienvermarktung und Immobilienplanung.##t3__fliesstext@@<strong>So realistisch wie ein Foto. 3D-Visualisierungen von Alt- und Neubauten, Innenräumen und Umfeldern</strong>\r\n\r\nMit fotorealistischen Renderings setzen Sie Ihre Immobilie oder Ihre Räume ansprechend in Szene. Die Vermittlung von Ideen ist damit ein Kinderspiel und Sie sind nicht auf die Vorstellungskraft des Ansprechpartners angewiesen.\r\nMit 3D-Visualisierungen unterstützen wir Sie dabei, Ihre Immobilienvorhaben und Planungsideen erfolgreich zu präsentieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
