INSERT INTO `content` VALUES('375', '118', '0', '0', '', 't3__headline@@3D-Visualisierung für Produkte##t3__subheadline@@Vom Schlüsselanhänger bis zur Solargroßanlage - Es gibt nichts, was sich nicht in 3D visualisieren läßt##t3__fliesstext@@3D-Visualisierungen für Produkte bieten wir als Agentur in fotorealistischer Qualität an. In der Regel werden 3D-Visualisierungen bei Produkten immer dann benötigt, wenn das Produkt noch nicht produziert ist, oder es wegen der Größe oder des Ortes keine Möglichkeit gibt, es vernünftig zu fotografieren. Produktvisualisierungen über 3D als Rendering machen aber auch in manchen Fällen aus Kostengründen durchaus Sinn. Soll das Produkt öfters in unterschiedlichen Perspektiven, Farben, Oberflächenqualitäten oder mit kleinen Änderungen dargestellt werden, rechnet sich die Fotoerstellung nicht mehr. Einmal erstellt, sind Änderungen recht schnell realisierbar, ohne das Produkt vor Ort zu haben.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
