INSERT INTO `content` VALUES('355', '87', '0', '0', '', 't2__bild@@259##t1__subheadline@@Mappen-Prospekt##t1__fliesstext@@Ein Mappen-Prospekt zeichnet sich vor allem dadurch aus, dass er mit einem festeren Umschlag ausgestattet ist und es eine Unterbringungsmöglichkeit für zusätzliche Informationsblätter oder DVD gibt.##t1__interner_link_@@136|Mappen-Prospekt##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
