INSERT INTO `content` VALUES('357', '116', '0', '0', '', 't3__headline@@3D Visualisierung - Investitionsgüter - Maschinen - Anlagen - Bauteile##t3__subheadline@@Rendering von Investitionsgütern##t3__fliesstext@@Maschinenbauer und Anlagenhersteller kennen das Problem. Oft ist die Maschine oder Anlage groß und steht mitten in der mehr oder minder fotogenen Fertigungshalle oder sie wurde schon ausgeliefert und verbaut. Hier kommen Fotografen an ihre Grenzen. Maschinen und Anlagen kann man eben nicht so einfach in ein Fotostudio transferieren.\r\nVor Ort fehlt es aber meist am nötigen Freiraum und eine vernünftigen Lichtinstallation ist selten möglich. Eine 3D-Visualisierung auf Basis der meist vorhandenen Grundrisse, Schnitte und Ansichten als CAD-Datei (.dwg) ist hier die optimale Lösung. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('359', '116', '0', '0', '', 't2__bild@@74##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('361', '116', '0', '0', '', 't2__bild@@73##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('392', '116', '0', '0', '', 't1__bild@@78##t1__subheadline@@3D-Visualisierungen für Messe, Print, Film und Animation##t1__fliesstext@@3D-Visualisierungen von Maschinen geben Ihrem Kunden anschauliche Informationen in die Hand. 3D-Darstellungen finden Ihren vielfältigen Einsatz in Prospekten, auf Messen, in Filmen oder im Internet. \r\n\r\nEinzelbilder als auch komplexe 3D-Animationen sind ein sinnvolles Mittel um Anlage, Maschinen, deren Technik und auch die Funktion zu erklären.\r\nDurch 3D-Visualisierung ergibt sich die perfekte Möglichkeit, Details, Vorgänge, Abläufe und Reaktionen innerhalb von Anlagen, Maschinen und anderen Investitionsgütern zu erklären.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('365', '116', '0', '0', '', 't1__bild@@77##t1__subheadline@@3D Strichzeichnungen##t1__fliesstext@@Die Unternehmen, die eine eigene Konstruktionsabteilung haben, sind meist auch in der Lage, über bestehende CAD-Programme 3D Strichzeichnungen zu erstellen. Durch farbige Ausstattung der Komponenten oder Baugruppen lassen sich einige Dinge recht gut erklären, aber als Marketinginstrument taugen sie wenig. Warum? Ihr Kunde möchte fertige Produkte sehen. Er sucht danach, weil er sicher sein will, dass Sie in der Lage sind, es auch umzusetzen. Gute 3D-Visualisierungen schaffen Vertrauen. Sehen Sie oben, was aus dieser Strichzeichnung geworden ist.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
