INSERT INTO `content` VALUES('390', '117', '0', '0', '', 't5__fliesstext_fett@@Für die Immobilienvermarktung\r\n##t5__fliesstext@@Angefangen vom ersten Immobilien - Exposé, dem Verkaufsprospekt, Immobilienanzeigen, Werbeflyern, Bauten- oder Bauzaunverkleidungen und natürlich den Bauschildern...für die erfolgreiche Immobilienvermarktung werden meistens 3D Visualisierungen benötigt.##t5__fliesstext_fett@@Für Architekten und Planer##t5__fliesstext@@Zeigen Sie Ihren Ansprechpartnern, welche Ideen Sie haben! Mit 3D-Visualisierungen von Immobilen und Innenräumen können Ihre Kunden schon in der Planungsphase erleben, wie die Zukunft aussehen kann oder wird.\r\n##t5__fliesstext_fett@@Für Bauherren##t5__fliesstext@@Ob Neubau oder für die Kernsanierung eines Altbaus. Vorher zu wissen, wie es später aussehen soll, ob klassisch oder mit ausgefallenen, extravaganten Wünschen und Ideen, 3D-Visualisierungen helfen Ihnen, zielgerichtet Ihre Ziele oder Träume zu erreichen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '3', '', '', '', '', '0', '0', '', '0');
