INSERT INTO `content` VALUES('408', '119', '0', '0', '', 't3__headline@@Unsere Werbeagentur zum Thema Ausbildung und Handwerk##t3__subheadline@@Das Handwerk gehört ebenso zu unseren Kunden wie die Großindustrie##t3__fliesstext@@Ausbildung im Handwerk hat goldenen Boden. Sehr alt aber immer noch wahr. Als Werbeagentur haben wir schon einige Handwerksbetriebe in die Selbstständigkeit begleitet und wissen auch, wie wichtig hier Auszubildende sind. Diese alten \"Zünfte\" haben auch heute nicht nur weiter ihre Berechtigung, wie viele glauben, sondern sind wie der Mittelstand die Basis unserer Gesellschaft. Die handwerkliche Tradition und die Ausbildung in Deutschland sind weltweit einzigartig. Nirgendwo wird ein junger Mensch so gut und gründlich ausgebildet, aber auch gefordert.  ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
