INSERT INTO `content` VALUES('415', '23', '0', '0', '', 't1__bild@@723##t1__subheadline@@Corporate-Design für Elektro-Mobilität##t1__interner_link_@@193|Corporate-Design Elektro-Mobilität##t2__fliesstext@@Als Corporate Design Agentur bieten wir konsequente und dennoch flexible Lösungen für Print- und Online Medien. Ausgangspunkt ist bei einer Unternehmensgründung in der Regel das Logo, danach kommen die Definitionen für Typografie, Bildsprache und Farbwelt. Hier am Beispiel für Elektromobilität und neue Energiekonzepte.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('417', '120', '0', '0', '', 't3__headline@@Corporate Design für Personalvermittlung bzw. -beratung##t3__subheadline@@Qualifiziertes Personal - Als Vermittler eine Frage der Seriosität und des Corporate Designs##t3__fliesstext@@Als Corporate-Design Agentur haben wir in unterschiedlichen Bereichen mit dem Thema \"Arbeit\" zu tun. In der Vermittlung von Personal reicht unser Erfahrungsschatz von der Integration von Langzeitarbeitslosen bis zur Vermittlung von Top-Managern. Corporate Design ist hier ein ständiger Begleiter, der die Glaubwürdigkeit und Seriosität des jeweiligen Unternehmens unterstützt. In diesem Fall handelt es sich um eine spezialisierte Personalvermittlung bzw. Personalberatung für Fachleute in dem Bereich Erneuerbare Energien.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
