INSERT INTO `content` VALUES('448', '122', '0', '0', '', 't3__headline@@Imagebroschüre zur Unternehmensdarstellung##t3__subheadline@@Imagebroschüre - Eine hochwertige Darstellung von Unternehmen, Produkten und Dienstleistungen##t3__fliesstext@@Eine Imagebroschüre soll Kunden und Interessenten einen positiven, ersten Eindruck vom Unternehmen, dessen Qualität und Glaubwürdigkeit vermitteln. Die Imagebroschüre ist das Werkzeug für die Unternehmensleitung, den Vertrieb und dessen Außendienst. Entsprechend hoch sind die Anforderungen an die Werbeagentur, für die definierten Zielbereiche die richtige Struktur, Bildsprache, Gestaltung und Texte zu erstellen und für die entsprechende Produktion zu sorgen. Meist ist eine hochwertige Produktion oder Druckerstellung mit besonderen Papieren oder Sonderdruckverfahren, wie Prägungen oder Stanzungen gewünscht. Für einige Zielgruppen ist ein \"reduzierter\" Produktionsaufwand allerdings eher passend.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
