INSERT INTO `content` VALUES('456', '123', '0', '0', '', 't3__headline@@Immobilien-Broschüre - Exposé zur Immobilienvermarktung##t3__subheadline@@Immobilien-Broschüre, auch Exposé genannt, stellen neben der strategischen, inhaltlichen Darstellung weitere Anforderungen an die Werbeagentur.##t3__fliesstext@@Bei Bestandsimmobilien ist eine professionelle Architekturfotografie und Bildbearbeitung gefragt. Bei Neubauten sind oft 3D-Visualisierungen für das Exposé erforderlich. Daneben sind ansprechende und verständliche Raum- und Stockwerkspläne zu erstellen und die Objekt- und Standortvorteile in der Immobilienbroschüre für Verkauf oder Vermietung überzeugend hervorzuheben. Als Werbeagentur bieten wir Ihnen die komplette Umsetzung inklusive aller Inhalte. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
