INSERT INTO `content` VALUES('460', '22', '0', '0', '', 't1__bild@@238##t1__subheadline@@Immobilien-Broschüre / Exposé##t1__fliesstext@@Wir gestalten einfache oder hochwertige Exposés bzw. Immobilienbroschüren für die Vermarktung von Immobilien. Von der Namensfindung, der Gestaltung von Projektlogos, über die Erstellung von Raumplänen und 3D-Renderings bis zur Produktion sind wir Ansprechpartner für Bauherren, Makler, Architekten oder Banken.\r\nBei Neubauten liefern wir Ihnen realitätsnahe Architektenrenderings. Für Altbestand oder bereits fertiggestellte Immobilien erhalten Sie professionelle Architekturfotografie zur Unterstützung des Verkaufs oder der Vermietung.##t1__interner_link_@@123|Immobilien-Broschüre##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
