INSERT INTO `content` VALUES('465', '124', '0', '0', '', 't3__headline@@Personal-Broschüre - Die Gewinnung von Mitarbeitern##t3__subheadline@@Personal-Broschüre - Als Information für neue Mitarbeiter und deren Gewinnung##t3__fliesstext@@Bisher sind Personal-Broschüren eher in spezialisierten Branchen gefragt, eben weil hochspezialisierte Fachkräfte angesprochen und gewonnen werden sollten.\r\n\r\nIn Zeiten des Personalmangels wird die Personal-Broschüre für deutlich mehr Arbeitgeber ein wichtiger Bestandteil zur Personalgewinnung und Personalsicherung werden. Als Werbeagentur wissen wir, welche Stilmittel, Inhalte, Bildsprache für einen erfolgreichen Einsatz der Broschüre notwendig sind.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
