INSERT INTO `content` VALUES('471', '22', '0', '0', '', 't1__bild@@171##t1__subheadline@@Personal-Broschüren##t1__interner_link_@@124|Personal-Broschüre##t1__fliesstext@@Qualifiziertes Personal ist knapp und um so wichtiger wird es, dass sich Unternehmen auch in dieser Richtung und als Arbeitgeber positiv darstellen. Sei es, um qualifiziertes Personal zu gewinnen oder, als Mittel der Unternehmenskommunikation, bestehendes Personal zu halten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('473', '125', '0', '0', '', 't3__headline@@Displays aus Metall als Thekendisplay oder Standdisplay##t3__subheadline@@Metalldisplays - Die Lösung für Dauerdisplays zur Wiederbefüllung##t3__fliesstext@@Sie haben wechselnde Kollektionen oder Ihre Displays länger am POS und befüllen bzw. beschicken sie regelmäßig? Dann sind Displaysysteme aus Metall die richtige Lösung. Haben Sie auch noch einen Außendienst, sind sie optimal. Neben einigen Vorteilen haben Metalldisplays allerdings zwei Nachteile: Sie sind schwerer als Kartonagen und auch teurer. Zum Wegwerfen also zu schade. Wer aber nach einer dauerhaften Verwendung sucht, den können wir als Werbeagentur nur zu Ausführungen aus Metall raten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
