INSERT INTO `content` VALUES('478', '126', '0', '0', '', 't3__headline@@Immobilienvermarktung und Betreuung für einen Gewerbepark##t3__subheadline@@Unsere Werbeagentur in Sachen Gewerbepark##t3__fliesstext@@Die Aufgaben der Agenturbetreuung können bei einem Gewerbepark recht vielfältig sein. Dazu gehört die Vermarktung von Neubauten oder bestehender Mietflächen, Corporate-Design Entwicklungen inklusive Corporate-Architecture, Beschilderungssysteme, 3D-Visualisierungen, Anzeigenwerbung, Großbanner oder Maßnahmen für die Mieterkommunikation. Im Immobilienbereich stehen wir Ihnen als Full Service Werbeagentur für Ihr Projekt innovativ und zuverlässig zur Verfügung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
