INSERT INTO `content` VALUES('489', '127', '0', '0', '', 't3__headline@@Schüler-Kalender##t3__subheadline@@Kinder und Schüler-Kalender - Weiterhin sehr beliebt##t3__fliesstext@@Schüler-Kalender können in unterschiedlichen Formaten und Ausführungen gestaltet und produziert werden. Entgegen handlicher Kalendern für Erwachsene sind die Kalendarien für Kinder und Schüler didaktisch aufbereitet, übersichtlicher und einfacher gehalten und enthalten die Termine, die für Kinder und Schüler wichtig sind. Darüber hinaus sind viele Schüler-Kalender mit interessanten Themenseiten ausgestattet, die bei entsprechender Aufbereitung, auch als Unterrichtsmaterial dienen können. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
