INSERT INTO `content` VALUES('495', '128', '0', '0', '', 't3__headline@@Newsletter für Gewerbeimmobilien##t3__subheadline@@Newsletter für Gewerbeimmobilien dienen zur internen Kommunikation zwischen Vermietern und Mietern##t3__fliesstext@@Diese Newsletter-Publikation erscheint in unregelmäßigen Abständen und ist an die Mieter des Gewerbeparkes gerichtet. In jeder Newsletter wird ein Mieter und sein Unternehmen vorgestellt, auf neue Gewerbepark-Projekte hingewiesen und Leerstände angeboten. Aktive Kommunikation, die die Leistungen der Verwaltung kommunizieren, dabei Hilft, Mitmieter und Ihre Leistungen besser kennen zu lernen und letztendlich eine höhere Identifikation der Mieter mit dem Gewerbepark ermöglicht.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
