INSERT INTO `content` VALUES('501', '129', '0', '0', '', 't3__headline@@Prospekt - Unternehmensdarstellung##t3__subheadline@@Unsere Werbeagentur in Sachen Unternehmensdarstellungen##t3__fliesstext@@Wenn Flyer oder Faltblätter wegen des Informationsumfangs nicht ausreichen oder die Gesamtanmutung etwas wertiger sein soll, kommen 4- und mehrseitige Prospekte zum Einsatz. In der Regel ist das Endfomat A4. Prospekte können von unserer Agentur aber auch in Sonderformaten oder einer fast beliebigen Außenkontur gestaltet und produziert werden. In diesem Fall handelt es sich um den Klassiker aller Prospekte im Din A4-Hochformat. Klassisch wäre auch ein A4-Querformat, dass ebenso problemlos herstellbar ist.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
