INSERT INTO `content` VALUES('504', '87', '0', '0', '', 't2__bild@@1549##t1__subheadline@@Prospekte - Unternehmensdarstellung##t1__fliesstext@@Prospekte als 4- oder Mehrseiter sind das beliebteste Print-Medium wenn es um die Darstellung von Unternehmen, Produkte oder Dienstleistungen geht. Als Werbeagentur nutzen wir Prospekte vor allem in Bereichen mit hohem Publikumsanteil wie z.B. im Arbeitsmarkt bei Job- bzw. Personalvermittlung.##t2__interner_link_@@129|Prospekt  - Unternehmensdarstellung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
