INSERT INTO `content` VALUES('561', '137', '0', '0', '', 't2__headline@@DVD-Produktion - Beach-Soccer für Kinder##t2__subheadline@@Film, Bild und Text auf einer DVD##t2__fliesstext@@DVD-Produktionen sind immer dann angesagt, wenn man über das Internet hinaus, Informationen an seine Zielgruppe in kompakter Form weitergeben will. Grundsätzlich eignen sich dafür auch andere Datenträger, allerdings ist die DVD nicht nur günstiger, sondern lässt sich durch die 4c-Bedruckung auch besser individualisieren.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
