INSERT INTO `content` VALUES('2445', '48', '0', '0', '', 't1__bild@@175##t1__subheadline@@DVD-Bedruckung##t1__fliesstext@@Zentrales Thema bei dem Vertrieb von Daten über Datenträger ist nicht nur der Kostenaufwand, sondern auch die Individualisierung des Datenträgers. Während sich andere Datenträger nur über Siebdruck oder Tampoprint bedrucken lassen, ist die DVD vollfarbig oder mit den Farben nach Corporate Design Vorgaben bedruckbar.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
