INSERT INTO `content` VALUES('570', '138', '0', '0', '', 't3__headline@@Werbeagentur Kinder - Beach-Soccer##t3__subheadline@@Beach-Soccer - Bewegung nicht nur für Stadtkinder##t3__fliesstext@@Diese Informationsmappe mit DVD wurde zur Gewinnung von Sponsoren für Beach-Soccer Plätze in Frankfurt erstellt. Die Mappe selbst enthält Informationen zum Projekt und eine DVD mit Film-, Foto- und Textdokumentationen. Die DVD für dieses Kinderprojekt ist mit einer eigenen Menüführung ausgestattet und erlaubt einen Einblick in die wirklich wunderbaren Dokumentationen. Diese sprechen für sich. Kinder, für die es das erste Mal ist, dass sie Barfuß auf Sand spielen sollen, lassen erst einmal ihre Socken an. Mädchen spielen mit Jungs und die haben richtig zu kämpfen und Erwachsenen wird schnell klar, wie wichtig körperliche Bewegung für Kinder ist. Und das mit einer sehr geringen Unfallgefahr. \r\nSie haben Interesse an diesem Projekt? Fragen Sie unsere Werbeagentur einfach an!##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
