INSERT INTO `content` VALUES('668', '73', '0', '0', '', 't1__bild@@270##t1__subheadline@@Kinder, Bewegung und Sport: Beach-Soccer##t1__fliesstext@@Als Werbeagentur begleiteten wir das städtische Projekt zum Thema: Beach-Soccer. Ziel ist es, möglichst viele dieser betreuten Plätze mit Hilfe von Spenden innerhalb der Stadt zu realisieren. Mittlerweile gibt es schon 3 Plätze und es macht Spaß, die Kinder auf den Sandplätzen spielen zu sehen.##t1__interner_link_@@138|Werbeagentur Kinder-Beach-Soccer##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
