INSERT INTO `content` VALUES('574', '139', '0', '0', '', 't3__headline@@Freizeit - Beach-Soccer##t3__subheadline@@Beach-Soccer für Kinder##t3__fliesstext@@Diese Informationsmappe mit innenliegender DVD wurde zur Gewinnung von Geldgebern für Beach-Soccer Plätze in Frankfurt am Main erstellt. Die Informationsmappe enthält Informationen zum Projekt und eine multimediale DVD mit Film-, Foto- und Textdokumentationen. Die DVD ist mit einer eigenen Menüführung ausgestattet und gibt einen Einblick in das Projekt. Diese sprechen für sich. Kinder lassen erst einmal ihre Socken an, weil sie barfußlaufen nicht gewöhnt sind. Mädchen spielen mit Jungs und Erwachsenen wird schnell bewußt, wie wichtig körperliche Bewegung für Kinder ist.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
