INSERT INTO `content` VALUES('2337', '142', '0', '0', '', 't2__subheadline@@Zusatzprodukte, Warenproben, Sachet##t2__fliesstext@@Wenn auch kaum einer den Namen kennt, sind sie uns allen bekannt. Sachets sind Warenproben, die kleiner Menge eines Produkte in meist luftdicht versiegelten Verpackungen, vor allem bei Kosmetikartikeln wie zum Beispiel Shampoo oder Duschgel, in Zeitschriften aber auch Flyern zum testen angeboten werden. Für die Einführung oder Neupositionierung eines entsprechenden Produktes nahezu unerlässlich. In diesem Fall überzeugt der konkrete Nutzen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
