INSERT INTO `content` VALUES('632', '145', '0', '0', '', 't3__headline@@Zeitschriften / Zeitungen##t3__subheadline@@Gestaltung und Reinzeichnung für Zeitungen##t3__fliesstext@@Als Werbeagentur bieten wir Unternehmen, Verlagen und Einrichtungen Teilleistungen und Vollservice für die Gestaltung und Umsetzung von Zeitschriften und Zeitungen. Für Unternehmen und Einrichtungen bieten wir die komplette Redaktion, Gestaltung, Produktion und Versendung an. Für Verlage sind wir Ansprechpartner für die kreative Gestaltung der gestellten Vorlagen und deren professionellen Reinzeichnung nach Verlags- oder Herstellervorgaben. Nicht nur für Zeitschriften für Kinder.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
