INSERT INTO `content` VALUES('639', '47', '0', '0', '', 't1__bild@@509##t1__interner_link_@@167|Fachzeitschriften##t1__subheadline@@Fachzeitschriften##t1__fliesstext@@Wir erstellen unter anderem Fachzeitschriften bzw. -publikationen zu Themen wie Arbeit, Gesundheit, Pädagogik, Erziehung, Kinder oder Jugend. Für die Neuerstellung oder Modernisierung von Fachzeitschriften stehen wir Ihnen gerne zur Verfügung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('638', '47', '0', '0', '', 't2__bild@@344##t2__interner_link_@@145|Zeitschriften Zeitungen Ignaz ClubInfo##t2__subheadline@@Zeitschriften - Zeitungen##t2__fliesstext@@Gestaltung von Kinderzeitungen und anderen Publikationen für Kinder. Als Werbeagentur bieten wir Unternehmen, öffentlichen Einrichtungen und Verlagen die Gestaltung und Umsetzung von Medien für Kinder wie z.B. Zeitungen an. Von Teilleistungen wie Layout, Illustration oder Text bis zur kompletten Redaktion.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
