INSERT INTO `content` VALUES('643', '147', '0', '0', '', 't3__headline@@Kinder Zeitungen##t3__subheadline@@Leseförderung und Spaß - Kinder Zeitungen und pädagogische Materialien##t3__fliesstext@@Als Werbeagentur liefern wir alles, was für Kinder-Medien, wie zum Beispiel Zeitungen, benötigt wird. Dazu gehört die Konzeption, aber vor allem die Gestaltung, Texte und Illustrationen, die für Kinder interessant und geeignet sind. \r\nKinder sollen nicht nur verstehen, sondern auch begeistert sein. Hierfür haben wir eine eigene Fachredaktion mit sehr viel Erfahrung mit der Kommunikation für Kinder. \r\nNatürlich liefern wir auch die  Reinzeichnung und Produktion von Kinder- und Jugend-Zeitungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
