INSERT INTO `content` VALUES('650', '73', '0', '0', '', 't2__bild@@361##t2__interner_link_@@147|Kinder Zeitungen##t2__subheadline@@Kinder-Zeitungen##t2__fliesstext@@Kinder-Zeitungen und pädagogische Materialien für Kinder erstellen wir seit über 15 Jahren für unterschiedliche Verlage, Unternehmen und öffentliche Einrichtungen. Unsere Stärke ist die kindergerechte Aufbereitung der Themen über Illustrationen und spannenden Bildern und die kindergerechten Texte durch unsere Fachredaktion. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
