INSERT INTO `content` VALUES('654', '148', '0', '0', '', 't3__headline@@Edelstahlvisitenkarten\r\nVisitenkarten aus Edelstahl ##t3__subheadline@@Visitenkarten aus Edelstahl bzw. Edelstahlvisitenkarten - Exklusiv und unvergänglich.##t3__fliesstext@@Visitenkarten aus Edelstahl sind exklusiv und selten. Edelstahlvisitenkarten bestechen durch ihre Präzision und Materialeigenschaft. Allein das Gewicht transportiert ein Gefühl von Qualität und Wertigkeit.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '6', '', '', '', '', '0', '0', '', '0');
