INSERT INTO `content` VALUES('664', '150', '0', '0', '', 't3__headline@@Kinder und Verkehrserziehung##t3__subheadline@@Kinder - Informationen und Veranstaltungen zum Thema: Verkehrserziehung##t3__fliesstext@@Verkehrserziehung für Kinder ist eines der wichtigsten Themen, wenn Kinder ihr Umfeld erleben. Natürlich gibt es den Kindergarten, die Schule und die Verkehrspolizei, die eine Menge an Angeboten bereitstellen, aber was ist mit den Eltern? Der hier vorgestellte Flyer wirbt hier für Elternseminare für Verkehrssicherheit. \r\nNicht, dass Eltern nicht wüssten, wie der Straßenverkehr funktioniert, aber wie kann man es kindergerecht und interessant vermitteln? Darauf zielt dieses Elternseminar ab und schafft ein Bewusstsein bei allen Verantwortlichen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('665', '150', '0', '0', '', 't1__bild@@378##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
