INSERT INTO `content` VALUES('667', '73', '0', '0', '', 't1__bild@@376##t1__subheadline@@Kinder und Verkehrserziehung##t1__fliesstext@@Jeder weiß, wie wichtig Verkehrserziehung für Kinder ist. Das dies nicht nur die Schulen, Kitas und die Polizei den Kindern vermitteln sollte, sondern auch die Eltern ist eigentlich klar. Aber wer sagt den Eltern, wie sie es am Besten vermitteln?##t1__interner_link_@@150|Kinder Verkehrserziehung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
