INSERT INTO `content` VALUES('674', '148', '0', '0', '', 't5__subheadline@@Visitenkarten aus Edelstahl / Edelstahlvisitenkarten##t5__fliesstext@@Visitenkarten aus Edelstahl unterliegen materialbedingt einigen Einschränkungen.\r\nSoll ein besonderer haptischer Effekt erzielt werden, muss die Oberfläche des Edelstahls geätzt werden. Jede einzelne! Entsprechend ist der Preis und entsprechend ist die Exklusivität.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
