INSERT INTO `content` VALUES('673', '45', '0', '0', '', 't1__subheadline@@Visitenkarten Muster##t1__fliesstext@@Bitte haben Sie Verständnis, dass wir keine Mustervisitenkarten versenden. Die von unserer Agentur ausgeführten Karten sind individuelle Umsetzungen für unsere Kunden, deren Namen und Adressen wir nicht weitergeben.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('671', '45', '0', '0', '', 't1__subheadline@@Besondere Visitenkarten - Auflagen##t1__fliesstext@@Individualisieren kann man fast alle Materialien, auch einen Apfel. Allerdings haben individuelle Entwicklungen in kleinen Stückzahlen ihren Preis. Erst Auflagen ab 500 Stück stehen in einem vernünftigen Preis-Leistungs-Verhältnis.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
