INSERT INTO `content` VALUES('676', '1', '0', '0', '', 't1__bild@@618##t2__headline@@Grafikagentur##t1__subheadline@@Full Service  für Print- und Onlinemedien als Grafikagentur##t1__fliesstext_fett@@##t1__fliesstext@@Profitieren Sie von unserem Know-how und sprechen Sie uns an, wenn Sie reine Grafikprojekte bzw. Gestaltungsaufgaben sensibel und innovativ umsetzen wollen. Wenn Sie einen professionellen Ansprechpartner suchen, der Ihnen neue Grafikkonzepte entwickelt oder Umsetzungen nach Ihren Corporate-Design Vorgaben für Online- oder Printmedien, Verpackungen, Messeständen oder andere Medien gestaltet, dann sind Sie auch hierfür bei uns an der richtigen Adresse. ##t1__interner_link_@@174|Grafikagentur##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1311', '203', '0', '0', '', 't3__headline@@Getränke-Zubehör##t3__subheadline@@Getränke-Zubehör - Verpackungsgestaltung##t3__fliesstext@@Für den Bereich Getränke-Zubehör liefern wir neben Print- und Onlinewerbung kreative Verpackungsgestaltung für unterschiedlichste Verpackungsarten. Dazu gehören Faltschachteln, Blisterverpackungen, Beutelverpackungen, Spenderkarten oder individuell entwickelte Sonderlösungen. In diesem Beispiel\r\nwaren die alten Produktverpackungen ausschließlich für den b to b - Bereich konzipiert worden. Hier wurde nun der Schritt zum b to c gegangen, da immer mehr der Abverkauf in Großmärkten eine Rolle spielt. Die Verpackung ist umweltfreundlich aus Karton und wurde von unserer Agentur vollständig neu für die drei Bereiche: Hygiene, Cocktail und Bottlemaster entwickelt.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
