INSERT INTO `content` VALUES('686', '151', '0', '0', '', 't3__headline@@Grafikagentur##t3__subheadline@@Grafikagentur - Professionelle grafische Dienstleitung\r\n##t3__fliesstext@@Grafikagentur\r\n\r\nEs ist nicht selbstverständlich, dass eine Werbeagentur professionelle grafische Leistungen anbietet. Wir können es. Nicht durch externe Netzwerker, sonder In-House.\r\nKonzept-fünf besteht vor allem aus Strategen und Kreativen, die ihr Handwerk verstehen. Sie brauchen z.B. ein neues Logo oder eine Markengestaltung, ein Verpackungsdesign, Website oder einfach grafische Umsetzungen in Ihrem bestehenden Corporate Design? Sprechen Sie uns an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('687', '3', '0', '0', '', 't3__headline@@Webagentur - Internetagentur##t3__subheadline@@Full Service Webagentur Konzept-fünf - Internetagentur mit Übersicht.##t3__fliesstext@@In einfachster Form will man erst mal eine Website haben. In anspruchsvoller Form braucht man eine Online-Anwendung, die es noch nicht gibt. Der eine ist Unternehmensgründer oder Online-Einsteiger, der andere hat eine sehr spezielles Aufgabe nach jahrelanger Webpräsenz. Als Full Service Webagentur, die national wie international vor allem für mittelständische Unternehmen arbeitet, sind wir in beiden Fällen und natürlich auch \"dazwischen\" Ihr Ansprechpartner. Wir beraten Sie, gestalten, programmieren und pflegen Ihre Online-Projekte.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
