INSERT INTO `content` VALUES('1018', '3', '0', '0', '', 't1__subheadline@@CMS - Der Vorteil einer Full Service Webagentur##t1__fliesstext@@Als Full Service Webagentur bieten wir nicht nur \"EIN\" Content Management System. Warum? Aus Erfahrung! Systeme müssen bezahlbar und vor allem bedienbar sein. Wenn es nicht besonderen Sicherheits-Standarts bedarf, bieten wir Ihnen immer kostenlose Content Management Systeme an. ##t1__fliesstext_fett@@CMS - Und was man wirklich braucht!##t1__fliesstext@@Wir bieten mehrere Content Management Systeme an. Aber! Aus der Praxis, jeder kennt Typo3. Ein umfassendes CMS-Tool, dass wir anbieten. Unsere Erfahrung: Nur wenige Unternehmen brauchen das Spektrum und vor allem, wenige haben das Personal, um es zuverlässig und kontinuierlich zu bedienen und zu pflegen. Joomla (ähnlich), etwas einfacher zu pflegen, aber die Häufigkeit der Sicherheitslücken in den letzen Jahren dazu geführt, dass wir es Unternehmen nicht empfehlen. \r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
