INSERT INTO `content` VALUES('703', '156', '0', '0', '', 't3__headline@@Verpackungslösungen über Verpackungsbeutel, Flachbeutel, Polybeutel##t3__subheadline@@Verpackungsbeutel - Die optimale Lösung für Süßwaren und kleine Produkte##t3__fliesstext@@Wer kennt ihn nicht, den Verpackungsbeutel auch Flach- oder Polybeutel genannt. Die gesamte Süßwarenbranche benutzt unter anderem diese Art der Verpackung. Aber auch für andere Branchen, die kleine Produkte in einem Gebinde verkaufen wollen, benutzt den Polybeutel um ihre Ware konsumentengerecht am POS und in der Anwendung zu vermarkten. \r\nAls Werbeagentur wissen wir nicht nur, wie Polybeutel zu gestalten sind, sondern wissen auch um die produktionstechnischen Anforderungen, die die Fertigung und Bedruckung des Verpackungsbeutels stellt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('702', '155', '0', '0', '', 't3__headline@@Food - Süßwaren##t3__subheadline@@Verpackungen für Süßwaren im Food-Bereich##t3__fliesstext@@Das Objekt der Begierde. Süßwaren gehören zu den Produkten, an denen kaum ein Mensch vollständig verzichten will. Unsere Werbeagentur bringt für den Bereich Süßwaren viel Erfahrung mit. Markenentwicklung, Entwicklung und Gestaltung von Produktverpackungen, Verkaufsdisplays, erste Produktvisualisierungen oder Food-Fotografie bzw. Food-Illustrationen sind ein Teil der Leistungen, die wir anbieten können. Kreativ, professionell und zuverlässig. \r\nIn diesem Beispiel geht es um die Markenentwicklung (Steviabalance) und das Design der Beutelverpackung bzw. Flachverpackung für ein neues Produkt mit dem natürlichen Süßstoff Stevia. Alle Illustrationen sind wegen der besonderen Anforderungen in der Druckerstellung als Vektorgrafiken erstellt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
