INSERT INTO `content` VALUES('716', '157', '0', '0', '', 't3__headline@@Anzeigen für den Food - Bereich##t3__subheadline@@Wenn Saucen, Fonts und Demi-Glasses das Schreiben lernen##t3__fliesstext@@Eine außergewöhnliche Idee, als Gestaltungsmittel die Produkte wie Saucen, Fonts und Demi-Glasses selbst einzusetzen. Und etwa 4 Minuten Zeit für die Gestaltung und Fotografie. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
