INSERT INTO `content` VALUES('718', '158', '0', '0', '', 't3__headline@@Lebensmittel Saucen, Fonds und Demi-Glasses##t3__subheadline@@Als Lebensmittel wie Saucen, Fonds und Demi-Glasses schreiben lernten##t3__fliesstext@@Wer Food-Bereich gestaltet, weiß, dass sehr viel von der brillanten Darstellung des Produktes abhängt. In diesem Fall wurde für ein Imageprojekt für den  BtoB-Bereich   nicht mit dem Bild allein gestaltet, sondern mit den Produkten Soßen, Fond und Demi-Glasses selbst. Während die gesamten Leitmotive der Kampagne aus ganzen geschriebenen Wörtern aus den jeweiligen Produkten bestehen, sind die Plakate der Lebensmittel Ausschnitte aus diesen Schriftzügen. \r\nNatürlich kann man nicht alle Produkte schreibfähig zu machen. Aber dafür gibt es dann andere Ideen. Als Full Service Agentur liefern wir Ihnen Ideen, deren Gestaltung, professionelle Food-Shootings und die Produktion in den gewünschten digitalen oder analogen Medien.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
