INSERT INTO `content` VALUES('728', '159', '0', '0', '', 't3__headline@@Plakate für den Food-Bereich##t3__subheadline@@Food-Plakate - Einmal anders##t3__fliesstext@@Wer Food-Plakate gestaltet, weiß, dass in der Regel sehr viel von der brillanten Darstellung abhängt. In diesem Fall wurde die kleine Plakatserie nicht mit Farbe sondern mit den Produkten Soßen, Fond und Demi-Glasses direkt gestaltet. Während die gesamten Titelmotive der Kampagne aus ganzen geschriebenen Wörtern aus diesen Produkten bestehen, sind die Food-Plakate Ausschnitte aus diesen Schriftzügen. \r\nNatürlich versuchen wir nicht, alle Produkte schreibfähig zu machen. Als Full Service Agentur liefern wir Ihnen Ideen, deren Gestaltung, professionelle Food-Shootings mit allem was dazu gehört und die Produktion in den gewünschten Medien.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
