INSERT INTO `content` VALUES('732', '42', '0', '0', '', 't1__bild@@433##t1__subheadline@@Plakate für BtoB im Food-Bereich##t1__fliesstext@@Auf diese Plakate sind wir besonders stolz. Kann man aber, erst mal, nicht wirklich nachvollziehen. \r\nVerstehen wir! \r\nEs geht um ein rudimentäres Produkt, in diesem Fall Saucen, Fonds und Demi-Glasses eines französischen Herstellers. Die Zielgruppe sind die Businesspartner. Die Postermotive zeigen Ausschnitte aus Bildmotiven, wo mit eben diesen Produkten geschrieben wird. Nicht mit Tinte, nicht mit Kugelschreiber. Mit diesen Produkten.\r\n##t1__interner_link_@@159|Plakate Food##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('733', '160', '0', '0', '', 't3__headline@@Flyer für Soßen, Fonds und Demi-Glaces##t3__subheadline@@Flyer für den BtoB-Bereich##t3__fliesstext@@Für den Außendienst im BtoB-Bereich ist es wichtig, überzeugende Argumente mitzuführen und diese als Handreichung dem jeweiligen Unternehmen zu überlassen. Für den französischen Hersteller war es wichtig, die Qualität der Produkte zu vermitteln. In diesem Fall augenscheinlich ganz einfach, aber auch innovativ. Mit Bezug und Liebe zum Produkt. Als Werbeagentur haben wir das Produkt selbst reden bzw. schreiben lassen. Qualität kann für sich selbst sprechen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
