INSERT INTO `content` VALUES('738', '26', '0', '0', '', 't2__bild@@435##t2__subheadline@@Flyer für Saucen, Fonds und Demi-Glasses##t1__fliesstext@@Schlicht aber edel, innovativ mit Saucen, Fonds und Demi-Glasses geschriebene Schriften. In einem speziellen Querformat und ohne klassischen Werbebotschaften.\r\nAuch das sind Flyer, die aber auf eine spezielle Zielgruppe gestaltet wurden.##t2__interner_link_@@160|Flyer Saucen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('739', '161', '0', '0', '', 't3__headline@@Professionelle, anspruchsvolle  Architekturfotografie##t3__subheadline@@Architekturfotos für die Vermarktung, Dokumentation und Präsentation.##t3__fliesstext@@Architekturfotografie gehört zu den Bereichen der Fotografie, die sehr speziell sind. Neben dem Auge des Fotografen für Architektur benötigt man einiges an Know-how und Technik, um den Widrigkeiten nicht NUR gerecht zu werden.##t3__fliesstext@@Gebäude können nicht weglaufe, dass Umfeld allerdings auch nicht. Durch den zusätzlichen Einsatz professioneller Bildbearbeitung kann die Welt ein bisschen schöner gemacht werden:\r\nRasenflächen simulieren, bevor der Rasen überhaupt verlegt ist, Laternenmäste verschwinden lassen, komplizierte Kontrast- oder Wetterverhältnisse durch Composings aus mehreren Aufnahmen optimieren.\r\n##t3__fliesstext@@Jedes Gebäude und jeder Innenraum stellt für sich eine neue Herausforderung dar. Jeder Auftraggeber hat seine eigenen Zielvorstellungen.\r\n##t3__fliesstext@@Sie sind Architekt, Investor, Makler oder Bauherr und benötigen Architekturfotografie für ansprechende und überzeugende Exposés und Websites für Vermietung, Verkauf bzw. Vermarktung oder Dokumentationen über den Bauverlauf und brauchen Unterstützung?\r\nSprechen Sie uns an.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
