INSERT INTO `content` VALUES('773', '163', '0', '0', '', 't3__headline@@Newsletter für Forschung, Entwicklung und Wissenschaft##t3__subheadline@@Newsletter für Forschung, Entwicklung und Wissenschaft - Ein wichtiger Austausch mit der Fachwelt##t3__fliesstext@@Forschungsinstitute, Enwicklungsunternehmen oder öffentlich Einrichtungen in diesem Bereich haben einen erhöhten Bedarf, Ihre Leistungen zu präsentieren und zu kommunizieren. Hierbei geht es meist um die Darstellung der Leistungsfähigkeit des jeweiligen Unternehmens, der Einrichtungen und Institute. Als internationale Sprache wird hier die englische Sprache verwendet und die meisten Newsletter sind mindestens zweisprachig.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
