INSERT INTO `content` VALUES('807', '165', '0', '0', '', 't3__headline@@Informationsplakat - Informationsposter##t3__subheadline@@Plakate und Poster mit praktischen Nutzen##t3__fliesstext@@Plakate, die mit praktischen Informationen ausgestattet sind oder einfach nur schöne Motive zeigen, sind eigentlich Poster. Sie werden im Indoor-Bereich eingesetzt und haben in der Regel eine höhere Verweildauer als Werbeplakate im Outdoorbereich. Diese Poster eignen sich gut als Dauerimageträgern oder Give away und sind im BtoB-Bereich ein gutes Medium für den Außendienst. Poster in allen Größen und Formate informieren auf dezente Art, ohne das Produkt oder Unternehmen in den Vordergrund zu stellen. Wenn Menschen es unbedingt haben wollen, um es in ihren Räumen als Information oder Dekoration aufzuhängen, dann ist genau das erfolgt, was es bewirken soll.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
