INSERT INTO `content` VALUES('813', '42', '0', '0', '', 't1__bild@@504##t1__subheadline@@Plakat und Poster - Informationen als Zusatznutzen##t1__fliesstext@@Plakate sind aufgrund ihrer Größe definiert. Nicht aufgrund von Inhalten. Sie können auch Abläufe mit Fotos und Illustrationen visualisieren und somit nützliche Informationen enthalten. Wer kennt es nicht aus Plakaten von Fitness-Studios, Vereinen oder Krankenkassen?##t1__interner_link_@@165|Plakat - Rücken-Übungen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '13', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('818', '166', '0', '0', '', 't3__headline@@Gesundheit für Kinder - Rückenübungen##t3__subheadline@@Kinder-Gesundheit - Rückenübungen für Kinder und Erwachsene##t3__fliesstext@@Diese Plakatreihe beschäftigt sich mit der didaktischen Vermittlung von gesundheitsfördernden Übungen für Kinder und deren Eltern bzw. Erwachsenen, die mit Kindern präventive Bewegungsübungen durchführen wollen. Dabei liegt der Schwerpunkt vor allem in der verständlichen illustrativen Darstellung der Übungen und einem begleitenden Text, der die wichtigsten Bestandteile in einer kindergerechten Sprache merkfähig erklärt. Die Plakatserie ist dabei bewusst an Kinder und Erwachsene gerichtet und umgesetzt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
