INSERT INTO `content` VALUES('829', '167', '0', '0', '', 't3__headline@@Fachzeitschriften##t3__subheadline@@Fachzeitschriften für ErzieherInnen in Kindertagesstätten##t3__fliesstext@@Fachzeitschriften gestalten wir zu jedem Thema. Wenn Sie auch die fachgerechte Redaktion suchen, dann bringt unsere Werbeagentur für folgende Themenbereiche intern professionelle Erfahrung mit: Pharma, Gesundheit, Reisen, Arbeit, Kinder und Jugend, Betreuung und Pflege, Kultur und Food. \r\nAnsonsten profitieren Sie von unserem sehr großen Netzwerk an Fachredakteuren, die ein weitaus größeres Themenspektrum ermöglichen. Fragen Sie uns einfach an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
