INSERT INTO `content` VALUES('846', '168', '0', '0', '', 't3__headline@@Verlag: Gestaltung von Periodika##t3__subheadline@@Konzept fünf als kreativer Partner für Verlage##t3__fliesstext@@Sie suchen für Ihren Verlag nach einem Grafiker, der Ihre Periodika, Fachschriften und Verlagspublikationen gestaltet und fachgerecht für Ihre Produktion aufbereitet? Sprechen Sie uns an. Wir liefern Ihnen ein Team von kreativen und professionellen Grafikern, die ihr Metier verstehen und Typografie, Satz, Bildbearbeitung und Reinzeichnung nach Vorgaben umsetzen können.\r\nDieses Beispiel zeigt eine Fachzeitungsreihe für Erzieherinnen und Erzieher.\r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
