INSERT INTO `content` VALUES('859', '169', '0', '0', '', 't3__headline@@Gesundheit - Rückenschule Übungen##t3__subheadline@@Ilustrationen für Pulikationen und Broschüren mit dem Thema Gesundheit ##t3__fliesstext@@Broschüren zum Thema Gesundheit sind zur Veranschaulichung von Therapien, Funktionsweisen oder Übungen meist mit erklärenden Bildern versehen. Dabei eignen sich Fotos nicht in allen Fällen. Illustration sind hier besser geeignet, um etwas verständlich zu veranschaulichen. In diesem Fall geht es um Übungen für den Rücken die Erwachsene und Kinder durchführen können. Über die Broschüre hinaus gibt es die Übungen auch als Plakat. Für Kinder wurden die Übungen illustrativ und textlich kindgerecht aufbereitet. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
