INSERT INTO `content` VALUES('868', '80', '0', '0', '', 't1__bild@@533##t1__interner_link_@@169|Gesundheit Rueckenschule Uebungen##t1__subheadline@@Gesundheit - Rückenschule##t1__fliesstext@@Als Werbeagentur sind wir Ansprechpartner für Publikationen und Broschüren zum Thema Gesundheit. Hier eine Broschüre mit Übungen für den Rücken im Arbeitsumfeld einer Kita für unterschiedliche Unfallkassen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('872', '170', '0', '0', '', 't3__headline@@Prospekte für Sport, Fitness und Gesundheit##t3__subheadline@@##t3__fliesstext@@Die Gestaltung von Prospekten zu Themen wie Sport, Fitness und Gesundheit ist stark von guten Fotos und Illustrationen abhängig. Als Werbeagentur wissen wir aus Erfahrung, dass diese Fotos und Illustrationen nur selten über Bildagenturen zu beschaffen sind. Die Themen der Illustrationen und auch der Illustrationsstil sind oft so speziell, dass sie zwangsläufig individuell erstellt werden müssen. Wir erstellen Illustrationen oder beschaffen die richtigen Illustratoren oder Illustratorinnen für Ihre Prospekte. Für die Erstellung von Fotos organisieren und betreuen wir das Fotoshooting, erstellen Fotokonzepte, liefern eine Modell-, Location und Fotografenauswahl und kümmern uns um alle wichtigen und manchmal nicht so wichtigen Belange.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
