INSERT INTO `content` VALUES('882', '171', '0', '0', '', 't3__headline@@Werbeagentur für Soziale Einrichtungen##t3__subheadline@@Soziale Einrichtungen  - Kindertagesstätte##t3__fliesstext@@Information, Kommunikation und Werbung für soziale Einrichtungen wie z.B. Kindertagesstätten bzw. Kindertageseinrichtungen sind bei unserer Werbeagentur Projekte, die wir sehr ernst nehmen und die jeweilige Einrichtung von unserer Erfahrung profitiert. Soziale Einrichtungen, Landes- und Bundesministerien beraten wir schon seit über 20 Jahren und bieten hierfür nicht nur Konzepte, Gestaltungen und Produktionen an, sondern auch eine Fachredaktion, die viele Aufgaben übernehmen kann, wenn das Personal fehlt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
