INSERT INTO `content` VALUES('890', '62', '0', '0', '', 't1__bild@@548##t1__subheadline@@Soziale Einrichtungen - Kindertagesstätte##t1__fliesstext@@Information und Kommunikation für soziale Einrichtungen wie z.B. Kindertagesstätten bzw. Kindertageseinrichtungen spielen bei Konzept fünf als Werbeagentur eine große Rolle. Öffentliche und soziale Einrichtungen beraten wir schon seit über 20 Jahren und bieten hierfür nicht nur Konzepte, Gestaltungen und Produktionen an, sondern auch eine eigene Fachredaktion ##t1__interner_link_@@171|Soziale Einrichtungen Kindertagesstaette##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('894', '172', '0', '0', '', 't3__headline@@Kinder und Erziehung##t3__subheadline@@Ein Schwerpunktthema unserer Werbeagentur##t3__fliesstext@@Kinder und Erziehung beschäftigt nicht nur Eltern, ErzieherInnen und LehrerInnen. Es ist ein zentrales Thema unserer Gesellschaft, das letztendlich unsere Zukunft gestaltet. Seit mehreren Jahren beschäftigt sich unsere Werbeagentur im Auftrag eines Verlages mit einer Fachzeitung für ErzieherInnen und veröffentlicht wichtige allgemeine oder zeitaktuelle Themen. Themenspezifisch gestaltet.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('903', '73', '0', '0', '', 't1__bild@@556##t1__subheadline@@Kinder und Erziehung##t1__fliesstext@@Für Erzieherinnen und Erzieher sind wir als Werbeagentur schon lange themenübergreifend tätig. Die Themen wie Arbeit, Ausbildung, Weiterbildung und praktische Hilfen für die Kita-Arbeit sind uns bestens bekannt.##t1__interner_link_@@172|Kinder Erziehung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
