INSERT INTO `content` VALUES('904', '1', '0', '0', '', 't2__interner_link_@@44|Verpackungen Packaging##t1__bild@@407##t1__bild@@1086##t2__headline@@Verpackungen Packaging##t2__fliesstext_fett@@##t2__fliesstext@@Kreative Ideen und deren Entwicklung für Transport-, Um-, und Verkaufsverpackungen aus  Papier, Kunststoff, Holz, Metall oder Glas.\r\nOb klassische Faltschachteln oder Tuben, Tüten, Eimer, Flaschen, Kisten, Dosen.\r\n\r\nLeistungen: Konzeptentwicklung, Packaging-Design, Verpackungstext, Übersetzung, Fotografie, Bilderstellung und -bearbeitung, Vektorgrafiken, Code-Erstellung, Fremdsprachensatz, PrePress, Produktionsbetreuung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('909', '94', '0', '0', '', 't1__subheadline@@Für wen ist eine Kreativagentur sinnvoll?##t1__fliesstext@@Das man eine innovative Kreativagentur beauftragt, wenn nichts mehr hilft, ist natürlich übertrieben, aber oft der Fall.\r\n\r\nDie eigentlichen Aufgaben von Konzept-fünf als Kreativagentur sind:##t1__aufzaehlung_dots@@Neue Marken und Unternehmen auf dem Markt zu positionieren \r\nAlte Unternehmen und Marken ein neues Gesicht und Image zu geben\r\nUnbekannte Produkte innovativ und verständlich zu positioniert\r\nVöllig neue Werbestrategie zu entwickeln\r\nBestehende Probleme bei Unternehmen oder Produkten zu bearbeiten\r\n ##t1__fliesstext@@Kurz, überall dort, wo etwas Neues entsteht, man sich deutlich abgrenzen will oder der Markt eingefahren ist, sind wir als Kreativagentur für Sie da. Dabei geht es oft nicht nur um die Art der neuen Vermarktung, sondern auch um die konstruktive Weiterentwicklung.\r\nDabei ist es uns wichtig, zu unterscheiden, ob wir im Rahmen von bestehenden Vorgaben denken sollen oder neue Wege gehen sollen.\r\n\r\n\r\nKreativität ist eine Basis für \"wertvolle Kommunikation\", die mehr kann, als nur kurzfristig die Verkaufszahlen zu steigern. Sie schafft und erhält Marken, die auch in Zukunft etwas wert sind.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('907', '94', '0', '0', '', 't1__subheadline@@Was ist eine Kreativagentur ?##t1__fliesstext@@Während Insider der Werbe- und Kommunikationsbranche die einzelnen Agenturformen oder -spezialisierungen benennen können, fällt es manchen schwer, zu benennen, was eine Kreativagentur macht. Man sucht in der Regel eine kreative Werbeagentur. Aber hat die ausgewählte Werbeagentur auch das Kreativpotential? In der Regel liegt die Verteilung bei einer Großagenturen für Werbung bei 90% Administration und 10% Kreation. Bei Konzept-fünf sind es 30% zu 70%.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('905', '94', '0', '0', '', 't1__subheadline@@Die Aufgaben einer Kreativagentur##t1__fliesstext@@Eigentlich ist es leicht für eine Kreativagentur. Je extremer der Bruch mit den Regeln und Normen, desto höher die Aufmerksamkeit. Diese Art der Werbung und Kommunikation ist bekannt und zumindest für kurze Zeit erfolgreich. Allerdings läuft man Gefahr, das langfristige Ziel einer Markenbildung bzw. -pflege völlig zu verfehlen. Der Beworbene nimmt die Werbung zwar wahr, selten die Botschaft und noch seltener entwickelt er ein Vertrauen zu dem Unternehmen oder Produkt bzw. der Marke.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('911', '151', '0', '0', '', 't5__fliesstext@@noch bearbeiten:\r\n\r\nLeistungen\r\n\r\nTeillösungen wie Illustrationen, Animationen, Grafiken oder Bildbearbeitungen zu Ihrer Werbemaßnahme gehören dazu. Als Full Service Grafik-Agentur sind wir aber auch für Anzeige oder Zeitschrift für Sie da. Kurz: Von der Gestaltung bis zur Produktion gestalten und betreut Konzept-fünf Ihre Projekte über alle Medien. Schwerpunkte dabei sind die Entwicklung und Umsetzung von Corporate Design Konzepten, Broschüren und Prospekte oder das Verpackungsdesign für unterschiedliche Verpackungsmaterialien.\r\nKreative Grafikagentur\r\nAls Agentur war die Spezialisierung auf einzelne Medien, Branchen und Trends noch nie unsere Sache. Spezielle Lösungen für die Anforderungen unserer Kunden zu entwickeln schon.\r\n\r\nWir verkaufen auch keinen agenturtypischen Gestaltungsstil oder Instantkopien einer Website. Je nach Ausrichtung Ihres Projektes gestalten wir Werbekampagnen und Kommunikation sowohl in klassisch reduzierter und typografisch orientierter Form oder werblich plakativ. Als Ansprechpartner für Grafik bündeln wir dabei ein sehr großes Know-How im eigenen Hause und bieten auch ein erfahrenes und erprobtes Netzwerk aus Partnern, vor allem aus Frankfurt, Wiesbaden, Mainz, Darmstadt und dem weiteren Umfeld. Das bedeutet: Erprobte und bewährte Partner, kurze Wege und eine zuverlässige Realisierung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('919', '173', '0', '0', '', 't3__headline@@Kreativagentur##t3__subheadline@@Konzept fünf als Kreativagentur: Kreativität um jeden Preis oder \r\nproduktives Denken und Handeln gegen die Regeln?##t3__fliesstext@@Wir sind eine Full Service Werbeagentur und nennen uns auch so. Darunter fallen typische Leistungen für die Umsetzung von einer Kreativagentur oder eben auch von einer Webagentur oder Grafikagentur. Die wenigsten unserer Ansprechpartner unterscheiden die Begrifflichkeiten. Aber ... Konzept fünf ist seit jeher eine Kreativagentur.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('918', '173', '0', '0', '', 't4__bild@@565##', '1', '1', '', '', '', '', '1', '0', '0', '0', '4', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('920', '173', '0', '0', '', 't1__subheadline@@Konzept fünf als Kreativagentur##t1__fliesstext@@Unsere Werbeagentur ist seit jeher eine Kreativagentur. Stammt doch der größte Teil der langjährigen Mitarbeiter aus Design- und Marketing - Universitäten und besteht nicht aus Praktikanten. Kreativität kann man bei uns selektiv ordern. Für innovative, neue Produktvisualisierungen oder als Basis für die Kommunikations- und Werbestrategie. Komplett unabhängig von Ihrer Leitagentur oder wenn Sie als Marketingabteilung hier Unterstützung braucht. Allerdings verstehen wir unserer Aufgabe eher darin, diese Kreativität nicht nur zu entwickeln, sondern in ganzheitliche Werbestrukturen einzubinden und zu realisieren. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('921', '173', '0', '0', '', 't1__subheadline@@Die Aufgaben##t1__fliesstext@@Eigentlich ist es leicht für eine Kreativagentur. Je extremer der Bruch mit den Regeln und Normen, desto höher die Aufmerksamkeit. Diese Art der Werbung und Kommunikation ist bekannt und zumindest für kurze Zeit erfolgreich. Allerdings läuft man Gefahr, das langfristige Ziel einer Markenbildung bzw. -pflege völlig zu verfehlen. Der Beworbene nimmt die Werbung zwar wahr, selten die Botschaft und noch seltener entwickelt er ein Vertrauen zu dem Unternehmen oder Produkt bzw. der Marke.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('922', '173', '0', '0', '', 't1__subheadline@@Was ist eine Kreativagentur ?##t1__fliesstext@@Während Insider der Werbe- und Kommunikationsbranche die einzelnen Agenturformen oder -spezialisierungen benennen können, fällt es manchen schwer, zu benennen, was eine Kreativagentur macht. Man sucht in der Regel eine kreative Werbeagentur. Aber hat die ausgewählte Werbeagentur auch das Kreativpotential? In der Regel liegt die Verteilung bei einer Großagenturen für Werbung bei 90% Administration und 10% Kreation. Bei Konzept fünf sind es 30% zu 70%.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('923', '173', '0', '0', '', 't1__subheadline@@Für wen ist eine Kreativagentur sinnvoll?##t1__fliesstext@@Das man eine innovative Kreativagentur beauftragt, wenn nichts mehr hilft, ist natürlich übertrieben, aber oft der Fall.\r\n\r\nDie eigentlichen Aufgaben von Konzept-fünf als Kreativagentur sind:##t1__aufzaehlung_dots@@Neue Marken und Unternehmen auf dem Markt zu positionieren \r\nAlte Unternehmen und Marken ein neues Gesicht und Image zu geben\r\nUnbekannte Produkte innovativ und verständlich zu positioniert\r\nVöllig neue Werbestrategie zu entwickeln\r\nBestehende Probleme bei Unternehmen oder Produkten zu bearbeiten\r\n ##t1__fliesstext@@Kurz, überall dort, wo etwas Neues entsteht, man sich deutlich abgrenzen will oder der Markt eingefahren ist, sind wir als Kreativagentur für Sie da. Dabei geht es oft nicht nur um die Art der neuen Vermarktung, sondern auch um die konstruktive Weiterentwicklung.\r\nDabei ist es uns wichtig, zu unterscheiden, ob wir im Rahmen von bestehenden Vorgaben denken sollen oder neue Wege gehen sollen.\r\n\r\n\r\nKreativität ist eine Basis für \"wertvolle Kommunikation\", die mehr kann, als nur kurzfristig die Verkaufszahlen zu steigern. Sie schafft und erhält Marken, die auch in Zukunft etwas wert sind.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('924', '1', '0', '0', '', 't1__bild@@639##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '2', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('930', '174', '0', '0', '', 't1__headline@@Grafik-Agentur - Leistungen INSERT INTO `content` VALUES('928', '174', '0', '0', '', 't3__headline@@Grafik-Agentur für Print- und Online-Medien##t3__subheadline@@Professionelle Gestaltung von unserer Grafik-Agentur##t3__fliesstext@@Es ist nicht selbstverständlich, dass eine Werbeagentur professionelle, grafische Leistungen anbietet. Wir können es. Nicht durch externe Netzwerker, sondern In-House.\r\nKonzept fünf besteht vor allem aus Strategen und Kreativen, die ihr Handwerk verstehen. Sie brauchen z.B. ein neues Logo oder eine Markengestaltung, ein Verpackungsdesign, Website oder einfach grafische Umsetzungen in Ihrem bestehenden Corporate Design? Sprechen Sie uns an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '2', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('931', '174', '0', '0', '', 't1__subheadline@@Unsere Grafikagentur und der Gestaltungsstil##t1__fliesstext@@Wir verkaufen als Grafik-Agentur keinen agenturtypischen Gestaltungsstil oder Instant-Kopien einer Website. Je nach Ausrichtung Ihres Projektes entwickeln wir maßgeschneiderte Medien für Ihre Werbekampagnen oder Produkte. Dadurch kann bei einer Grafikagentur kein homogener Gestaltungsstil präsentiert werden, bei unseren Kunden schon!\r\nNutzen Sie das breite Gestaltungsspektrum unserer Grafik-Agentur. Je nach Zielvorgaben bieten wir Umsetzungen in klassisch reduzierter, typografisch orientierter oder werblich plakativ Form an.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('932', '174', '0', '0', '', 't1__subheadline@@Produktion von Druck- und digitalen Medien##t1__fliesstext@@Sie brauchen eine Grafik-Agentur, die sich professionell um die Produktion Ihrer Medien kümmert? Sie berät, Produktionsvorgaben klärt und die Produktion begleitet? \r\nWir finden für Ihre Medien den passenden Hersteller und sorgen für die nötige Qualität zum vernünftigen Preis. Profitieren Sie von unserer Fachkompetenz.\r\nWir stehen Ihnen gerne mit unserer langjährigen Erfahrung zur Seite. \r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
