INSERT INTO `content` VALUES('945', '175', '0', '0', '', 't3__headline@@Individuelle Websites##t3__subheadline@@Gestaltung als prägnantes Mittel für individuelle Websites##t3__fliesstext@@Individuelle Websiters kann man nicht nur durch Bilder und Texte gestalten. Auch der grafische Aufbau ist ein Stilmittel der Ihr Thema unterstreicht. In diesem Fall eine Unternehmerin die Hunde-Physiotherapie anbietet und über ein entsprechendes Hundeschwimmbad verfügt. Neben der Farbwahl und den Bildelementen ist es hier vor allem der wellenförmig geschwungene Bild- und Textrahmen der zu dieser sehr individuellen Website beiträgt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
