INSERT INTO `content` VALUES('954', '176', '0', '0', '', 't3__headline@@Maschinenbau - Hydraulik##t3__subheadline@@Full Service für alle Medien##t3__fliesstext@@Für Unternehmen im Bereich Maschinenbau bieten wir als Werbeagentur alle Umsetzungen für Print- und Onlinemedien an. Wir sind Ihr Ansprechpartner, wenn Sie für Ihr Maschinenbau-Unternehmen einen frischen Auftritt benötigen. Ob Website, Broschüren, Datenblätter oder Produktvisualisierung, wir liefern Ihnen alles, was Sie benötigen. In diesem Beispiel wurde ein Relaunch des bestehenden Unternehmensauftrittes realisiert. Die Gestaltung bekam ein moderneres Gesicht, Produktdarstellungen über 3D-Visualisierungen optimiert und vereinheitlicht und ein Film als Unternehmensdarstellung auf Messen, bei Präsentationen und für das Internet produziert.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
