INSERT INTO `content` VALUES('963', '177', '0', '0', '', 't3__headline@@Technische Prospekte##t3__subheadline@@Technische Prospekte##t3__fliesstext@@Unternehmen, die technische Produkte herstellen, benötigen technische Prospekte als Informations- und Arbeitsmedium. Zu den besonderen Eigenschaften von technischen Prospekten gehört, dass sie oft Diagramme, technische Zeichnungen und Tabellen enthalten, die verständliche und anwendergerechte Aufbereitung benötigen. Neben Full Service bietet unsere Werbeagentur auch 3D Visualisierungen an, die vor allem dann zum Einsatz kommen, wenn räumliche Darstellungen hilfreich sind. Ist die Maschine oder Anlagen noch nicht fertig oder bereits ausgeliefert und installiert, ist fotografieren nicht möglich und ein nahezu reale Abbildung über ein Rendering die beste Lösung für technische Prospekte.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
