INSERT INTO `content` VALUES('970', '87', '0', '0', '', 't1__bild@@581##t1__subheadline@@Technische Prospekte##t1__fliesstext@@Eine besondere Form stellen technische Prospekte dar. Sie beinhalten, wie auch technische Kataloge, in der Regel viele technische Zeichnungen, Diagramme und Tabellen. Deren Erstellung, Optimierung und drucktechnische Aufbereitung bieten wir als Werbeagentur für die Kompletterstellung aus einer Hand an.##t1__interner_link_@@177|Technische Prospekte##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
