INSERT INTO `content` VALUES('972', '22', '0', '0', '', 't1__bild@@586##t1__subheadline@@Registerbroschüren##t2__fliesstext@@Registerbroschüren setzen wir als Werbeagentur immer dann ein, wenn eine direkte Übersicht über den Inhalt erforderlich ist. Die Register ermöglichen hier einen schnellen Zugriff auf die gesuchten Inhalte.##t1__interner_link_@@178|Registerbroschuere##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('973', '178', '0', '0', '', 't3__headline@@Registerbroschüren##t3__subheadline@@Registerbroschüren für eine übersichtliche Darstellung unterschiedlicher Produkte oder Dienstleistungen##t3__fliesstext@@Wenn wir als Werbeagentur vor der Aufgabe stehen, Inhalte über Printmedien möglichst strukturiert zu vermitteln, heißt eine Lösung für die Gestaltung: Register-Broschüre. Innerhalb einer Broschüre ermöglichen die Register einen schnellen Zugriff auf die gesuchten Inhalte und werten die Broschüre, wie den Inhalt durch den praktischen Nutzen auf. Registerbroschüre sind besonders interessant für Bereiche mit unterschiedlichen Produkten oder Dienstleistungen und um vorhandene Produktunterschiede besser visualisiert zu können.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
