INSERT INTO `content` VALUES('978', '178', '0', '0', '', 't1__subheadline@@Registerbroschüren für mehr Übersicht##t1__fliesstext@@Während seitlich angebrachte Register bei Ordnern zu besseren Übersicht üblich sind, werden sie bei Broschüren eher selten eingesetzt. Dabei ist die komfortable Verwendung ein großer Pluspunkt für den Nutzer. Unsere Werbeagentur bietet Ihnen individuell gestaltete Registerbroschüren, mit oder ohne Einklappseite. Oder Register, die oben oder seitlich angebracht sind. \r\nDas Format spielt dabei weniger eine Rolle, sollte aber wegen der besseren Handhabung nicht über DIN A4 hinausgehen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('979', '179', '0', '0', '', 't3__headline@@Pharma - Blutdruck##t3__subheadline@@Produkteinführung für eine neue Blutdruckmeßgeräte-Generation##t3__fliesstext@@Zur Markteinführung einer neuen Generation von Blutdruckmeßgeräten konzeptionierte und gestaltete unsere Werbeagentur den vollständigen Auftritt der Produkte und der Informations- und Werbematerialien. Beginnend bei der Produktfotografie und der Bildbearbeitung, zu Verpackungen, Bedienungsanleitungen in mehreren Sprachen, Produktübersichtsbroschüren in Registerform, Veranstaltungsplakate und Informationsmaterialien zu Meßgeräteprüftagen oder dem Blutdruckpaß und die Verkaufsdiplays. Full Service rund um die Produkteinführung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
