INSERT INTO `content` VALUES('987', '80', '0', '0', '', 't1__bild@@595##t1__interner_link_@@179|Pharma Blutdruck##t1__subheadline@@Pharma-Marketing: Produkteinführung und Produktrelaunch##t2__fliesstext@@Im Pharma-Bereich entwickeln und gestalten wir Print- und Online-Medien zur Markteinführung oder für den Produktrelaunch.  In diesem Fall geht es um eine neue Geräteserie für Blutdruck-Meßgeräte, die über die Apotheken verkauft werden. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
