INSERT INTO `content` VALUES('994', '87', '0', '0', '', 't1__bild@@607##t1__subheadline@@Bedienungsanleitung - Gebrauchsanleitung##t1__fliesstext@@Bedienungsanleitungen bzw. Gebrauchsanleitungen benötigen anschauliche Bebilderungen, mehrsprachige Übersetzungen, Fremdsprachensatz und natürlich selbsterklärende Texte und Darstellungen. Auch Bedienungsanleitungen gehören zum Bereich der Prospekte und natürlich bieten wir hier als Agentur die komplette Umsetzung an.\r\n##t1__interner_link_@@180|Bedienungsanleitung Gebrauchsanleitung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('995', '181', '0', '0', '', 't3__headline@@Produktfotografie##t3__subheadline@@Produktfotografie - Wenn man am falschen Ende spart##t3__fliesstext@@Produktfotografie erfordert viel Erfahrung, spezielle Ausrüstung und präzises Arbeiten. Die Größe eines Produktes benötigt eine bestimmte Studiogröße, für Eis ist ein anderes Equipment nötig als für ein Handy und Investitionsgüter lassen sich oft nicht einfach ins Studio verfrachten. \r\nWir beraten Sie gerne zum Thema Produktfotografie, empfehlen Ihnen passende Fotografen, liefern Ihnen die komplette Betreuung und schicken Ihnen ein kostenloses und unverbindliches Angebot zu.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
