INSERT INTO `content` VALUES('1000', '103', '0', '0', '', 't1__bild@@617##t1__subheadline@@Produktfotografie##t1__fliesstext@@Ein professioneller Produktfotograf hat nicht nur ein geschultes Auge für Objekte. Er muss eine Menge Improvisationsfähigkeit und auch ein technisches Verständnis für das Produkt mitbringen. Bei einem Bürostuhl ist es noch \"einfach\", aber es gibt viele unterschiedliche Herausforderungen in der Produktwelt.##t1__interner_link_@@181|Produktfotografie##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
