INSERT INTO `content` VALUES('1011', '180', '0', '0', '', 't1__subheadline@@Bedienungsanleitung - Die Texterstellung##t1__fliesstext@@In der Regel setzten dies dann technische Fachexperten um. Das Ergebnis ist eine mehr oder weniger gelungene technische Dokumentation. Als Werbeagentur sind wir da anderer Meinung. Eine Bedienungsanleitung sollte von denen geschrieben werden, die Ihr Produkt oder Ihre Dienstleistung benutzen sollen. Wie liefern Ihnen professionelle, themenaffine TexterInnen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1012', '180', '0', '0', '', 't1__subheadline@@Gebrauchsanleitung - Die Bilddarstellungen##t1__fliesstext@@Eine Gebrauchsanleitung ohne Bilddarstellung ist keine Gebrauchsanleitung. Der Nutzer identifiziert sich mit der Darstellung und wird auch bestätigt, dass er die richtige Gebrauchsanleitung vor sich hat. \r\nBilder sagen mehr als tausend Wort. Bei Gebrauchsanleitungen, deren Bilder mit den entsprechenden Anweisungen verknüpft sind, werden einfach besser verstanden. Egal, ob sie als professionelle Vektorgrafiken bzw. Infografiken oder als Fotos umgesetzt werden. Als Werbeagentur bieten wir die entsprechende Umsetzung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1013', '180', '0', '0', '', 't1__subheadline@@Bedienungsanleitungen - Übersetzung und Fremdsprachensatz##t1__fliesstext@@Eine verständliche Beschreibung komplexer Produkte und Dienstleistungen ist die Basis. In der Regel werden vor allem Produkte aber nicht nur in einem Land verkauft. Muttersprachliche Übersetzer und der entsprechenden Fremdsprachensatz zu liefern, gehört zu unserm Alltagsgeschäft.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1014', '180', '0', '0', '', 't1__subheadline@@Anleitungen - Beispiele:\r\n##t1__aufzaehlung_dots@@Montageanleitungen\r\nBetriebsanleitungen\r\nBedienungsanleitungen\r\nWartungsanleitungen, \r\nArbeitsanweisungen\r\nBroschüren\r\nDatenblätter\r\nTechnische Schulungsunterlagen \r\nOnline-Hilfen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
