INSERT INTO `content` VALUES('1030', '68', '0', '0', '', 't1__bild@@1022##t1__subheadline@@Gastronomie - Vegetarische Food-Kette##t1__fliesstext@@Vegetarische Nahrungsmittel gibt es auch als Fast- bzw. Fingerfood. Im Zeichen einer zunehmenden Zahl von Vegetariern ein Grund, über entsprechende Verkaufskonzepte nachzudenken.##t1__interner_link_@@226|Gastronomie Food-Kette##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2503', '84', '0', '0', '', 't1__bild@@1284##t1__subheadline@@Verlage: Fachthemen verständlich machen##t1__fliesstext@@Um Fachthemen wie zum Beispiel Gefahrenstoffe verständlich zu machen benötigt es Illustrationen und eine verständliche Gestaltung. Neben der Gestaltung, Bildbearbeitungen und Illustrationen liefern wir als Grafikagentur nicht nur die muttersprachliche Übersetzung und den Fremdsprachensatz sondern auch die entsprechenden Vorlagen für die Produktion nach Verlagsvorgaben für Print- und Onlinemedien.##t1__interner_link_@@258|Verlag Gefahrstoffe##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
