INSERT INTO `content` VALUES('1035', '183', '0', '0', '', 't3__headline@@Freizeit - Utilities##t3__subheadline@@Freizeit - Utilities - Ausstattungsartikel für den Outdoor-Bereich##t3__fliesstext@@Ausstattungsartikel für den Outdoor- und Freizeitbereich sind sehr beliebt. Als Werbeagentur entwickeln und gestalten wir Verpackungen und Displays für diese Artikel.\r\nHier das Beispiel einer entfachen Produktkarte. Das man aus einem kleinen Rechteck mehr machen kann, zeigt dieses Beispiel. Produktkarten müssen heute nicht mehr als billiger Produktträger dastehen. Neue, in diesem Fall transparente, Materialien, kreative Gestaltung und andere Konturen bringen die Produkte ins richtige Licht. Als Werbeagentur fängt die Herausforderung eben gerade da an, wo die Fläch so begrenzt ist wie hier. Entsprechende Kataloge und Verkaufsdisplays bauen dann auf dieser Basisentwicklung auf.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
