INSERT INTO `content` VALUES('1047', '79', '0', '0', '', 't1__bild@@1213##t1__subheadline@@Outdoor  - Freizeit, Camping und Wandern##t1__fliesstext@@Freizeitaktivitäten wie Wandern und Camping haben steigende Umsatzzahlen. Wen wundert es. Bevor man aktiv wird, muss erst einmal das geeignete Equipment besorgt werden. Schuhe, Kleidung, Sportgeräte und vieles mehr erfreuen sich daher einer immer noch steigenden Beliebtheit.##t1__interner_link_@@248|Outdoor Freizeit Camping Wandern##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
