INSERT INTO `content` VALUES('1056', '24', '0', '0', '', 't1__bild@@674##t1__subheadline@@Die Planung von Displays aus Karton, Metall oder Kunststoff##t1__fliesstext@@Nach den ersten Gestaltungsideen werden zur besseren Planungen einfache vektorgrafische Darstellungen oder realitätsnahe 3D-Visualisierungen erstellt. Mit dieser Darstellung ist der Abgleich mit den möglichen Produzenten und die weitere technische Entwicklung deutlich einfacher und erleichtert die Kommunikation zwischen Auftraggeber, Werbeagentur und Hersteller. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
