INSERT INTO `content` VALUES('1058', '184', '0', '0', '', 't3__headline@@Verpackung am POS - Produkt-Karten##t2__subheadline@@Produkt-Karten - Die einfachste Lösung##t2__fliesstext@@Früher waren Produkt-Karten rechteckig und aus kaschierter Pappe. Das man aus einem kleinen Rechteck viel mehr machen kann, hat die weitere Entwicklung bewiesen. Produkt-Karten wirken heute nicht mehr als billiger Produktträger. Neue Materialien, kreative Gestaltung und auch andere Formen auf begrenzten Flächen zeugen von der Kreativität der Designer. Als Werbeagentur fängt die Herausforderung gerade da an, wo das Medium so begrenzt ist, wie bei der Produkt-Karte.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
