INSERT INTO `content` VALUES('1063', '44', '0', '0', '', 't2__bild@@670##t2__subheadline@@Produkt-Karten - Wenig Verpackung, viel Display##t1__fliesstext@@Nicht jedes Produkt läßt sich über Produktkarten verkaufen. Gut geeignet ist die Produkt-Karten für kleine Massenprodukte, die keinen gesonderten Schutz benötigen. Die Befestigung auf Produktkarten erfolgt im Gegensatz zur Blisterverpackung mit elastischen Schnüren oder Schnellbinder.##t2__interner_link_@@184|Verpackung - Produkt-Karten##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1064', '185', '0', '0', '', 't3__headline@@Produkt-Kataloge##t3__subheadline@@##t3__fliesstext@@Die Verwendung von umfangreichen Produkt-Katalogen als primäres und einziges Verkaufsmedium für den Versandhandel geht immer mehr zurück. Online-Shops übernehmen die Gesamtdarstellung des Produktangebotes. Aber, entgegen vieler Prognosen nimmt die Anzahl der gedruckten Kataloge, auch wegen der gesunkenen Druckkosten, wieder sehr stark zu. Diesmal allerdings mit einem anderen Gestaltungs- und Inhaltskonzeptes, mit weniger Seiten und mehreren sehr wichtigen Zusatznutzen. Die zwei wichtigsten Zusatznutzen der heutigen Produkt-Kataloge sind die Kundenbindung und die flexible, inhaltlich konzentrierte Ausrichtung auf Bedürfnisse und Angebote. Verbunden ist dies mit einem deutlich höheren Anspruch an die zielgruppenoptimierte Gestaltung.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
