INSERT INTO `content` VALUES('1071', '87', '0', '0', '', 't1__bild@@657##t1__subheadline@@Produkt-Kataloge##t1__fliesstext@@Trotz Internet erfreuen sich Produkt-Kataloge eine neuen Beliebtheit. Und zwar vor allem im Online-Handel. Unter dem Begriff Produkt- bzw. Angebotskonzentrierung und Kundenbindung findet man die Antwort dafür. Diese neue Art der Produkt-Kataloge sind inhaltlich anders aufgebaut und weniger umfangreich, wie es bei Otto- oder Neckermann der Fall war.##t1__interner_link_@@185|Produkt-Katalog##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '11', '', '', '', '', '0', '0', '', '0');
