INSERT INTO `content` VALUES('1076', '186', '0', '0', '', 't3__headline@@Website für Jugendliche##t3__subheadline@@Die Website-Kommunikation für Soziales Engagement bei Jugendlichen##t3__fliesstext@@Jede Zielgruppe im Web hat seine eigene Ansprache. Dabei geht es nicht nur um besondere Zielgruppenansprachen für z.B. Sport, Mode, Beruf, sondern auch um die jeweilige Altersgruppe. Diese Entwurfsarbeit für eine Website zum Thema \"Soziales Engagement\" bei Jugendlichen zeigt zwei recht unterschiedliche gestalterische Lösungen, die beide multimedial aufgebaut sind, aber von der Gesamtanmutung scheinbar einmal mehr oder weniger Inhalt bieten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
