INSERT INTO `content` VALUES('1085', '187', '0', '0', '', 't3__headline@@Soziale Einrichtungen - Soziale Berufe##t3__subheadline@@Die Ausbildung und Personalgewinnung in Soziale Berufen##t3__fliesstext@@Die Gewinnung von Auszubildenden und Personal in sozialen Bereichen ist ein zentralen Themen unserer Gesellschaft. Das Interesse bei Jugendlichen für diese Berufe zu wecken auch.Wir alle benötigt junge Menschen, die sich für soziale Berufe entscheiden und auch Jugendliche, die wissen, wie wichtig soziales Engagement ist. Als Werbeagentur beraten wir nicht nur Arbeitsvermittler und Personalagenturen, sondern auch kleine und große soziale Einrichtungen, um Ihr Personalproblem zu lösen und eine aktive Öffentlichkeitsarbeit zu betreiben.\r\nJede Zielgruppe im Web hat seine eigene Ansprache. Dabei geht es nicht nur um die Interessenfelder sondern auch um die jeweilige Altersgruppe. Jugendliche spricht man über das Web an. Über sozial Media-Portale oder zeilgruppenrelevante Seiten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
