INSERT INTO `content` VALUES('1093', '62', '0', '0', '', 't1__bild@@681##t1__subheadline@@Soziale Einrichtungen - Soziale Berufe##t1__fliesstext@@Die Gewinnung von Personal und ehrenamtlich tätigen Personen in sozialen Bereichen ist eines der zentralen Themen unserer Gesellschaft. Das Interesse bei Jugendlichen zu wecken und die Möglichkeit für dieses Berufsfeld tätig zu werden auch. Unsere Gesellschaft benötigt junge Menschen, die sich für soziale Berufe entscheiden und Jugendliche, die wissen, wie wichtig und wertvoll soziales Engagement ist. Als Werbeagentur setzen wir unterschiedliche Web- und Printprojekte um.##t1__interner_link_@@187|Soziale Einrichtungen - Soziale Berufe##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
