INSERT INTO `content` VALUES('1108', '189', '0', '0', '', 't3__headline@@Werbung für das Ehrenamt##t3__subheadline@@DRK-Deutsches Rotes Kreuz-Ehrenamt##t3__fliesstext@@Werbung um Ehrenamtlich Mitarbeiter hat in den letzten Jahren stark zugenommen. Wen wundert es? Ehrenamtlich tätige Mitbürger fehlen! Nicht, weil sie wirklich weniger geworden sind, sondern weil die sozialen Aufgaben wachsen und die bisherigen staatlichen Einrichtungen den Anforderungen kaum noch hinterherkommen. Also nimmt Werbung um ehrenamtlich tätige Menschen für unterschiedliche Bereiche zu. Das trifft dann auch das Deutsche Rote Kreuz das traditionell auf ehrenamtlichen Mitarbeitern nicht verzichten kann. Als Werbeagentur betreuten wir das DRK und erstellten ein Fotoshooting mit realen Mitarbeitern und eine Plakatkampagne.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
