INSERT INTO `content` VALUES('1118', '62', '0', '0', '', 't1__bild@@693##t1__subheadline@@DRK - Deutsches Rotes Kreuz - Ehrenamt##t1__fliesstext@@Was passiert, wenn in vielen sozialen Bereichen ehrenamtlich tätige Mitbürger fehlen? Soziale Einrichtungen müssen auf sich aufmerksam machen und entsprechende Werbekampagnen einleiten. Heute ist die Werbung um ehrenamtlich tätige Menschen für unterschiedliche Bereiche so intensiv wie nie. Das trifft dann auch das Deutsche Rote Kreuz oder freiwillige Feuerwehren, die traditionell auf ehrenamtlichen Mitarbeitern aufgebaut ist. Als Werbeagentur unterstützen wir Sie bei Ihrer Öffentlichkeitsarbeit.##t1__interner_link_@@189|DRK-Deutsches Rotes Kreuz-Ehrenamt##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1119', '190', '0', '0', '', 't3__headline@@Plakate für soziale Einrichtungen##t3__subheadline@@Das DRK wirbt für das Ehrenamt über Plakate##t3__fliesstext@@Soziale Einrichtungen benötigen Kommunikation und Werbung für ihre Einrichtung oder die geleistete Arbeit. Kommunikation als eine Form der Öffentlichkeitsarbeit oder konkrete Werbung für Leistungsangebote oder Personal. In diesem Fall wirbt das DRK über Plakate um Personal für die ehrenamtliche Tätigkeit im Unternehmen. Für das Fotoshooting stellten sich ehrenamtlich aktive Mitarbeiter zur Verfügung. Eine ehrenamtliche Leistung für das Ehrenamt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
