INSERT INTO `content` VALUES('1131', '42', '0', '0', '', 't1__bild@@699##t1__subheadline@@Plakate für soziale Einrichtungen - Ehrenamt##t1__fliesstext@@Das DRK (Deutsches Rotes Kreuz) braucht Hilfe. Hört sich komisch an, aber viele Bereiche sind nur mit der Unterstützung von ehrenamtlichen, engagierten Mitarbeitern möglich. Auch die hervorragenden Leistungen des DRK sind regional ohne engagierter Bürger nicht umsetzbar. Bürger für Bürger...mehr als nur eine schöne Aufgabe.##t1__interner_link_@@190|Plakate für soziale Einrichtungen - Ehrenamt##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1132', '191', '0', '0', '', 't3__headline@@Website für Branchen##t3__subheadline@@Websites für Branchen. Visualisiert am Thema: Erneuerbare Energien##t3__fliesstext@@Themenspezifische Websites sind in einigen Bereichen durch Superzeichen und branchenspezifische Farbkompositionen geprägt um dem Betrachter sofort zu vermitteln, wo er sich befindet. Für Themen rund um Erneuerbare Energien eignen sich natürlich Windräder als signifikantes Superzeichen formal sehr gut. Anders als bei einem Elektroauto oder einer Solarzelle kann man ein Windrad sofort erkennen. Die Verwendung eines grünen Farbtones unterstreicht dabei den Gesamteindruck.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
