INSERT INTO `content` VALUES('1142', '19', '0', '0', '', 't1__bild@@704##t1__subheadline@@Die Gestaltung einer Website zum Thema Erneuerbare Energien##t1__fliesstext@@Erneuerbare Energien unterliegen einer rasanten Entwicklung. Die Aufgabe bei der Neugestaltung einer Website ist es, diesem Fortschritt gerecht zu werden.##t1__interner_link_@@191|Website - Erneuerbare Energien##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1144', '192', '0', '0', '', 't3__headline@@Erneuerbare Energien - Die Elektromobilität##t3__subheadline@@Elektromobilität - Ein Thema mit Zukunft und Aufgaben##t3__fliesstext@@Auf dieser Website werden Themen und Projekte rund um die Elektromobilität vorgestellt und angeboten. Neben Elektrofahrzeugen geht es auch um die Gewinnung, Speicherung und Versorgung von Energie. \r\nDa das Thema einer sehr großen Progression unterliegt, galt das Augenmerk unserer Werbeagentur auf der zeitloseren, illustrativen Darstellung des Themas, die gleichzeitig als Strukturierungshilfe eingesetzt wird. Die Website wurde in Deutsch, Englisch, Russisch und Ukrainisch umgesetzt. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1143', '16', '0', '0', '', 't2__subheadline@@Leistungen unserer Werbeagentur für Außenwerbung mit Personenwagen, Transporter, LKW´s oder Nutzfahrzeuge##t1__aufzaehlung_dots@@Werbekonzeptentwicklung für die Neugestaltungen \r\nIntegrationen und Adaptionen in bestehenden Gestaltungsvorgaben (CD)\r\nGestaltung von Einzelfahrzeugen und Flottenbeschriftungen\r\nGestaltung von Vollbeklebungen und Teilbeschriftungen\r\nAufbereitung der Daten für die den Foliendruck oder Folienplot (Konturaufkleber)\r\nDruck und Plot der Folien\r\nBeschriftung bzw. Montage der Aufkleber bzw. Folien im Großraum Rhein-Main\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
