INSERT INTO `content` VALUES('1155', '65', '0', '0', '', 't1__bild@@711##t1__subheadline@@Erneuerbare Energien und Elektromobilität##t1__fliesstext@@Elektromobilität ist ein spannendes Thema, dass im Rahmen der Nutzung von Erneuerbaren Energien und der Emmissionssenkung nach und nach Einzug in Europa hält. Zu diesem Thema und weiteren Projekten wurde hier eine umfassende Website erstellt.##t1__interner_link_@@192|Erneuerbare Energien Elektromobilitaet##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
