INSERT INTO `content` VALUES('1173', '3', '0', '0', '', 't1__bild@@704##t1__interner_link_@@19|Website Internetauftritt##t2__headline@@Website / Internetauftritt##t2__subheadline@@Konzept und Stategie##t2__fliesstext@@Warum man vorher realistisch planen sollte! \"Einfache Websites sind schnell gemacht und ich spar mir die Ladenmiete und die Webagentur\". So oder ähnlich denken noch viele, obwohl das Internet mittlerweile zu dem Marktplatz schlechthin geworden ist. Individuelles Design oder Instantvorlage machen einen erhebliche Unterschied. Spätestens, wenn die vermeindlichen \"einfachen\" Websites nicht funktionieren, wird nachgedacht. Meist zu spät.##t2__subheadline@@Ihr Vorteil:##t2__fliesstext@@Wir sind auch Werbeagentur ... profitieren sie auch im www. davon, dass Ihre Werbung, Nachrichten und Produkte dort erfolgreich landen, wo sie hinsollen. Wir verstehen die Website als eines von vielen Werkzeugen und Möglichkeiten. Daher bieten wir auch nicht nur ein Content Management System oder einen speziellen Webshop oder Provider an. Wir bieten Ihnen das, was Sie gerade brauchen und ein echter Baustein ist, um Erfolg zu haben.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1184', '3', '0', '0', '', 't1__headline@@SEO - OFF-Page-Angebot##t1__subheadline@@SEO OFF##t1__aufzaehlung_dots@@##t1__fliesstext@@Entgegen der On-Page Optimierung bieten wir Ihnen natürlich auch die OFF-Page Optimierung an. Link-Building, Social Media oder Partnerprogramme. Sprechen Sie uns an.\r\n\r\nDie OffPage - Optimierung ist immer dann sinnvoll, wenn Sie Meinungs- und Markenbildung pflegen und steuern wollen. Nicht, wenn Sie als Hersteller von Investitionsgütern Ihr Spezialprodukt anbieten. Für szeneorientierte Markenprodukte im Konsumerbereich ist es ein Must-have.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1185', '3', '0', '0', '', 't1__headline@@SEO - OnPage-Angebote##t1__subheadline@@SEO On - Basic##t1__fliesstext@@Die Basis ON-Page Optimierung, um Ihre Website für Suchmaschinen interessant zu machen. Beratung für die entscheidenden Keywords und Phrasen. Ausrichtung der Content-Texte und Bearbeitung der relevanten Meta-Texte. Kostengünstig und sehr effektiv.##t1__subheadline@@SEO On - Advanced##t1__fliesstext@@Optimierung und Begleitung Ihrer Seite über 4 Monate mit. Ihre Website wird mit den definierten Suchbegriffen und Phrasen und SEO-Texten an Ihrer Konkurrenz abgeglichen und stetig, Seite für Seite, individuell optimiert.##t1__subheadline@@SEO On - Support##t1__fliesstext@@Kunden, die unsere Leistung erkannt haben, wissen...es ist deutlich günstiger als Google Adverts. Und effektiver.\r\nDauerhafter Support Ihrer Website. Mindestlaufzeit 6 Monate. Danach monatlich kündbar.##t1__interner_link_@@20|SEO Suchmaschinenoptimierung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1188', '3', '0', '0', '', 't1__subheadline@@##t1__fliesstext@@Die OffPage - Optimierung ist immer dann sinnvoll, wenn Sie Meinungs- und Markenbildung pflegen und steuern wollen. Nicht, wenn Sie als Hersteller von Investitionsgütern Ihr Spezialprodukt anbieten. Für szeneorientierte Markenprodukte im Konsumerbereich ist es ein Must-have.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
