INSERT INTO `content` VALUES('1190', '3', '0', '0', '', 't1__interner_link_@@40|Content Management System - CMS##t5__bild@@1197##t2__headline@@Content Management System - CMS##t2__subheadline@@CMS - Der Vorteil einer Full Service Webagentur##t2__fliesstext@@Als Full Service Webagentur bieten wir nicht nur \"EIN\" Content Management System. Warum? Aus Erfahrung! Systeme müssen bezahlbar und vor allem bedienbar sein. Wenn es nicht besonderen Sicherheits-Standarts bedarf, bieten wir Ihnen immer kostenlose Content Management Systeme an.##t2__subheadline@@CMS - Und was man wirklich braucht!##t2__fliesstext@@Wir bieten mehrere Content Management Systeme an. Aber! Aus der Praxis, jeder kennt Typo3. Ein umfassendes CMS-Tool, dass wir anbieten. Unsere Erfahrung: Nur wenige Unternehmen brauchen das Spektrum und vor allem, wenige haben das Personal, um es zuverlässig und kontinuierlich zu bedienen und zu pflegen. Joomla (ähnlich), etwas einfacher zu pflegen, aber die Häufigkeit der Sicherheitslücken in den letzen Jahren dazu geführt, dass wir es Unternehmen nicht empfehlen. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1191', '3', '0', '0', '', 't2__headline@@Konzept-fünf als Webagentur##t1__subheadline@@##t1__fliesstext@@Heute ist Konzept-fünf eine Full Service Online-und Webagentur, die sowohl Unternehmensgründer als auch international aufgestellte mittelständische Unternehmen begleitet, mehr als nur Webagentur. Wir behalten den Überblick. Der richtige Webauftritt ist in den meisten Fällen extrem wichtig, aber oft auch nicht der einzige Weg.\r\n##t1__subheadline@@Was macht unsere Webagentur aus?##t1__fliesstext@@Unsere Leistung zielt auf eine dauerhaft erfolgreiche Marktpositionierung unserer Kunden ab, mit einem \"Handwerkszeug\", das flexibel und erweiterbar ist. Das muss auch nicht immer nur Online sein. Diese Kriterien erfüllen die umworbenen 08/15 Baukastensysteme zur reinen Webseitenerstellung nicht.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '10', '', '', '', '', '0', '0', '', '0');
