INSERT INTO `content` VALUES('1196', '89', '0', '0', '', 't1__fliesstext@@Heute ist das ehemalige Werksgelände eine kreative Insel, mit den optimalen Voraussetzungen, um individuelle Werbung, grafische Arbeiten und Konzepte zu gestalten. Diese Insel beheimatet neben Werbern, Grafikern, Programmieren auch Fotografen aus den Bereichen der Produkt- und Peoplefotografie und das Parkside Studio. Ein Mietstudios für Fotosessions, Filmdrehs, Foto- und Film-Castings. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1197', '89', '0', '0', '', 't3__fliesstext@@Der seinerzeit sogenannte \"Wohlfahrtsbau\" wurde von dem Architekten Hans Bernoulli geplant und von 1908 - 1910 gebaut. Das gesamte Erdgeschoss war als Badeanstalt für die Mitarbeiter eingerichtet, im Obergeschoss befanden sich der Konferenzraum, die Küche und der Speisesaal mit fast 360 Sitzplätzen. Hinzu kamen Sozialeinrichtungen in weiteren Anbauten und ein großzügiger Werkspark.\r\n\r\nDas Gelände wurde in der folgenden Zeit von wechselnden Inhaber genutzt, u.a. war auch eine betriebseigene Werksschule in den heutigen Räumen von Konzept fünf untergebracht.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1198', '89', '0', '0', '', 't1__fliesstext@@Zusammengefaßt: historisch, ungewöhnlich, inspirierend, zentral in Deutschland und im Rhein-Main-Gebiet gelegen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1199', '89', '0', '0', '', 't1__subheadline@@Viele Wege zu Konzept fünf##t1__aufzaehlung_dots@@Zu Fuß: 5 Geh-Minuten von der S-Bahnstation Offenbach-Ost\r\nund 8 Geh-Minuten der von der S-Bahnstation Offenbacher Innenstadt\r\n\r\nMit Öffentlichen: 20 Minuten vom Hauptbahnhof FFM\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1200', '194', '0', '0', '', 't3__headline@@Gastronomie - Italienisches Bistro in einer Einkaufsmall\r\n##t3__subheadline@@Gastronomie in einem Food-Court innerhalb einer Einkaufsmall##t3__fliesstext@@Wenn man vor hat, eine Gastronomie in einem Food-Court innerhalb eines Einkaufszentrums zu betreiben, sind drei Dinge klar. Mögliche Kunden sind vorhanden. Die Ladenmiete ist hoch und die Konkurrenz auch. Hier gilt es, mit seinen Produkten und seinen Werbemaßnahmen so attraktiv wie möglich zu sein, um sich gegenüber seinen Nachbarn durchzusetzen. Die Herausforderung dabei ist, dass man nur begrenzte Werbeflächen innerhalb des Food-Courts hat und Werbung auf anderen Flächen innerhalb der Einkaufsmall zusätzliches Geld kosten. \r\nAls Werbeagentur analysieren wir die Situation vor Ort und gestalten und produzieren die Werbemaßnahmen und sorgen innerhalb des Rhein-Main-Gebietes auch für die Montage.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
