INSERT INTO `content` VALUES('1230', '196', '0', '0', '', 't3__headline@@Plakate für die Gastronomie##t3__subheadline@@Innen- und Außenwerbung über Plakate für die Gastronomie ##t3__fliesstext@@In der Gastronomie sind Plakate ein wichtiges Medium, um auf den Gastronomiebetrieb und seine Angebote hinzuweisen. In der klassischen Gastronomie und System-Gastronomie geht es auf den Plakaten meist um besondere temporäre oder saisonale Angebote oder Veranstaltungen. Die gehobene Gastronomie benutzt Plakate eher als Imagepflege und Wegweiser. In beiden Fällen ist der Wiedererkennungswert bzw. die visuelle Verbindung zwischen Plakat und Gastronomieunternehmen wichtig und somit die strikte Umsetzung im Rahmen der vorgegebenen Gestaltungsstilmittel.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
