INSERT INTO `content` VALUES('1251', '198', '0', '0', '', 't3__headline@@Einfache Webauftritte##t3__subheadline@@Jeder will ins Web und wenn es nur ein einfacher Webauftritt ist##t3__fliesstext@@Nicht jedes Unternehmen legt Wert auf einen umfangreichen Webauftritt, kommt aber dennoch nicht umhin, im Web präsent zu sein. Im einfachsten Fall, um wenigstens gefunden zu werden, wenn man das Unternehmen sucht. Der Grund ist einfach: Wer als Unternehmen im Web nicht zu finden ist, gilt als unprofessionell und durchaus auch unseriös. Kann man bei Privatpersonen durchaus nachvollziehen, dass jemand nicht zu finden ist, hat das Unternehmen eine Art von freiwilliger Kommunikationsverpflichtung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
