INSERT INTO `content` VALUES('1262', '199', '0', '0', '', 't3__headline@@Firmendarstellung - Image und Information##t3__subheadline@@Eine Broschüre für Unternehmensgründer - Firmendarstellung und Dienstleistungs- oder Produktdarstellung##t3__fliesstext@@Unternehmensgründer und Kleinunternehmer müssen auf ihr Budget achten. Hier bietet es sich an, innerhalb einer Broschüre das Unternehmen und die Produkte / Dienstleistungen darstellen. Zudem ist die Ausgangslage bei kleineren Unternehmen und Startups oft gleich: es fehlen gute Bilddarstellungen oder Texte. Hier beraten, unterstützen und begleiten wir sie als Werbeagentur, um - im Rahmen des Kostenplans - das bestmögliche Ergebnis für Sie zu realisieren.          \r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
