INSERT INTO `content` VALUES('1281', '201', '0', '0', '', 't3__headline@@Corporate-Design zum Bereich Elektro-Recycling##t3__subheadline@@Corporate-Design Agentur und Plasmatechnik##t3__fliesstext@@Auch hier handelt es sich um eine Neugründung des Unternehmens. Als Agentur begleiteten wir das Unternehmen vom ersten öffentlichen Schritt an. Dabei ging es nicht nur um ein einheitliches Corporate Design, sondern auch um eine verständliche Kommunikation zu einer neuen Technologie im Bereich Elektro-Recycling. Deutschlandweit das ist es das erste Unternehmen, dass mittels Plasmatechnologie elektronischen Schrott aufbereitet. Vorteil: Eine wesentlich höhere Sortenreinheit und deutlich geringere schädliche Emissionen. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
