INSERT INTO `content` VALUES('1318', '204', '0', '0', '', 't3__headline@@Blisterkarten##t3__subheadline@@Blisterkarten - Die einfache Verpackungslösung mit Produktschutz##t3__fliesstext@@Blisterkarten sind Produkt-Karten mit Produktschutz. Blisterkarten bestehen normalerweise aus einer Kombination aus Pappe und Kunststoff und sind in der Regel durchsichtig. Der Kunststoffteil wird dabei über den Karton gezogen. Der Vorteil der Blisterkarte liegt dabei darin, dass man das Produkt sehen kann, obwohl es unter einer schützenden Kunststofffolie liegt. Man findest diese Form der Verpackung vor allem in Baumärkten oder Münzsammlungen zur Verpackung von kleinen Produkten. Als Blister-Karten bezeichnet man aber auch die klassische Verpackung von Tabletten. Hier ist es Keine Karton-Kunststoffkombination, sondern eine Kunststoff-Kunststoff-Kombination, die mittels Heißverblisterung oder Heißverschweißung verbunden wird.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
