INSERT INTO `content` VALUES('1365', '23', '0', '0', '', 't1__bild@@881##t1__subheadline@@Corporate Design ist für Outdoor-, Sport- und Freizeitunternehmen überlebenswichtig##t2__fliesstext@@Unternehmen aus der Outdoor-, Sport- und Freizeitbranche investieren viel Energie und Geld in die Markenentwicklung und dem \"Lifestyle\" - Umfeld. Die Progression ist enorm und der Aufwand dementsprechend, um am Puls der Zeit zu bleiben. Dabei gilt es gleichzeitig, die Marke und die Wiedererkennbarkeit nicht aus dem Auge zu verlieren.##t1__interner_link_@@206|Corporate-Design Outdoor Sport##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1366', '207', '0', '0', '', 't3__headline@@Webauftritte für Nischenmärkte##t3__subheadline@@Webauftritte für Nischenmärkte und besondere Zielgruppen##t3__fliesstext@@Für Nischenmärkte und besondere Zielgruppen gilt es, mit der Gestaltung eines Webauftrittes möglichst optimal der \"Gefühlswelt\" der Zielgruppe zu entsprechen. Das müssen nicht unbedingt konkrete Bilder sein, die Grundstimmung muss stimmen. Ob, wie in diesem Beispiel, Material, oder Typografie, Umfeld und Farben, sie alle tragen dazu bei, einer Erwartungshaltung zu entsprechen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
