INSERT INTO `content` VALUES('1377', '19', '0', '0', '', 't1__bild@@882##t1__interner_link_@@207|Webauftritte Nischenmärkte##t1__subheadline@@Webauftritte für Nischenmärkte##t1__fliesstext@@Das Design von Webauftritten für Nischenmärkte oder Spezialisten unterliegt einer Gestaltungssprache, die für das Unternehmen eigenständig sein muss aber auch die Vorstellungswelt der Zielgruppen trifft. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1378', '208', '0', '0', '', 't3__headline@@Produktkatalog für besondere Nischenmärkte##t3__subheadline@@Katalog-Ausstattung Trekking##t3__fliesstext@@Spezifisch auf die Zielgruppe abgestimmte Produktdarstellungen und Produktumfelder sind heute für Produktkataloge sehr wichtig. Es reicht nicht mehr aus, Produkte als Freisteller abzubilden und einen Preis daneben zu schreiben. Erlebniswelten sind für die Markenentwicklung, der Identifikation mit dem Anbieter und dem Verkauf wichtig. Dies erfordern eine Strategie, die vor allem die Produktdarstellung und die Umfeldgestaltung betrifft. Als Full Service Werbeagentur entwickeln und begleiten wir Ihr Unternehmen und Ihre Produkte. Kreativ und zuverlässig.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
