INSERT INTO `content` VALUES('1385', '87', '0', '0', '', 't1__bild@@888##t1__subheadline@@Produktkatalog für besondere Nischenmärkte##t1__fliesstext@@Manche Unternehmen verkaufen Produkte für Nischenmärkte. Wie in der Markenwelt ist es bei den Produktkatalogen wichtig, Produkt und Produktumfelder optimal auf die Erwartungshaltungen abzustimmen. Als Werbeagentur für Kataloge bieten wir Ihnen Full Service und das nötige innovative Feingefühl für Ihre Zielgruppe.##t1__interner_link_@@208|Produktkatalog für besondere Nischenmärkte##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '13', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1386', '209', '0', '0', '', 't3__headline@@Entwicklung einer individuellen Produkt-Karten-Verpackung##t3__subheadline@@Individuellen Produkt-Karten müssen nicht flach sein##t3__fliesstext@@Als Werbeagentur gestalten wir nicht nur Verpackungen, sondern entwickeln auch neue Verpackungen wie Produkt-Karten. Dieses Beispiel zeigt eine Neuentwicklung einer Verpackungsform, die es so vorher noch nicht gegeben hat. Die Basis ist hier eine einfache, flache Produkt-Karte, die durch Nutung, Faltung und Verspannung zu einer dreidimensionalen Verpackung wird. Besonders, individuell, auffällig und zum Teil das Produkt schützend. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
