INSERT INTO `content` VALUES('1392', '44', '0', '0', '', 't2__bild@@893##t2__subheadline@@Individuelle Produkt-Karten für Metallprodukte##t1__fliesstext@@Gerade Metallprodukte sind ein gutes Beispiel für den Einsatz von Produktkarten am POS. Einfache Herstellung, gute Produktpräsentation. Das man aus Produktkarten auch innovative neue Wege gehen kann, zeigt dieses Beispiel unserer Werbeagentur.##t2__interner_link_@@209|Verpackung Individuelle Produkt-Karte##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1393', '42', '0', '0', '', 't1__bild@@899##t1__subheadline@@Plakate gestalten für das Ballett##t1__fliesstext@@Für unsere Werbeagentur ist es immer wieder eine Freude, wenn wir im Kulturbereich tätig werden können. Die Maßstäbe bzw. Anforderungen sind anders als in der Werbung. Fragen sie uns an, wir wissen, was wir gerne unterstützen wollen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
