INSERT INTO `content` VALUES('1404', '211', '0', '0', '', 't3__headline@@Museumsfotografie-60 Millionen Pixel für Gemälde, Grafiken, Skulpturen und Plastiken##t3__subheadline@@Professionelle Museumsfotografie mit viel Know-how für Gemälde, Grafiken, Skulpturen oder Plastiken##t3__fliesstext@@Hochwertige Fotoaufnahmen vom Gemälde bis zur Rauminstallation.\r\n\r\nWie wir arbeiten:\r\nDamit die Farben auf Anhieb stimmen sind unsere Aufnahme-Systeme kalibriert. Die Farbcharakteristik der Kamera wird ermittelt und der Ist-Zustand der Farben auf den Soll-Zustand abgestimmt. \r\nDer Grauabgleich der Kamera erfolgt mittels einer metameriefreie Graukarte, mit der unter beliebigem Licht der Weißabgleich zuverlässig erstellt werden kann. Die entstandenen Aufnahmen werden auf farbkalibrierten Druckern ausgegeben und unter Normlicht-Bedingungen mit dem Original verglichen und eventuell manuell korrigiert. Jahrelange Arbeit im Farblabor hat die Sensibilität für feinste Farbabweichungen geschärft.\r\n\r\nDieser Vorgang wird wiederholt, bis eine größtmögliche Übereinstimmung zwischen Original und Offsetdruck erreicht ist. Die abgeglichenen Bilddaten mit Digitalproof nach ISO-Norm werden auf CD oder DVD bereitgestellt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
