INSERT INTO `content` VALUES('1422', '42', '0', '0', '', 't1__bild@@916##t1__subheadline@@Plakate für Musikveranstaltungen##t1__fliesstext@@Dieses Plakat ist ist 1997 entstanden. Damals schon von unserer Werbeagentur voll digital erstellt. Setzen sie einfach 2014 ein. Sie würden es wieder verwenden können, obwohl sich die Hip-Hop-Szene deutlich verändert hat.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
