INSERT INTO `content` VALUES('1424', '214', '0', '0', '', 't3__headline@@Flyer für Kita´s zur Gewinnung von Erziehern und Erzieherinnen##t3__subheadline@@Flyer in Sonderformaten##t3__fliesstext@@Sie haben es gemerkt. Der Erzieher steht vor der Erzieherin. In diesem Fall beabsichtigt. Nach den letzen Statistigen sind in den Kindertagesstätten gerade mal 3,84% und im pädagogischen Bereich sogar nur 2,67% Männer beschäftigt. Eine sehr zahrte Pflanze, wenn es um die Erziehung unserer Kinder geht. \r\nGrund genug, hier aktiv kommunikativ tätig zu werden.\r\nAls Werbeagentur erstellen wir Flyer in Sonderformaten wie zum Beispiel mit einem Kreuzfalz oder mit Prägungen und Stanzungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
