INSERT INTO `content` VALUES('1430', '215', '0', '0', '', 't3__headline@@Ausbildung / Weiterbildung##t3__subheadline@@Ausbildung und Weiterbildung - Mittel gegen personelle Engpässe##t3__fliesstext@@Ist das Personal wie bei ErzieherInnen knapp geworden, erinnert man sich leider viel zu spät an die Themen: Ausbildung und Weiterbildung. Durch die Notwendigkeit und politischen Entscheidungen ist der Personalstand so eng geworden, dass wir als Werbeagentur umfassende Kampagnen zu diesem Thema erstellt haben. Im Vordergrund steht die Gewinnung von jungen Menschen, die sich dann für eine Ausbildung in diesem Beruf entscheiden. Kurzfristig sicher nicht die Lösung für den momentanen Notstand. Mittelfristig aber schon.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
