INSERT INTO `content` VALUES('1458', '218', '0', '0', '', 't3__headline@@Packaging für den Pharma-Bereich##t3__subheadline@@Gestaltung von Kartonverpackungen für den Pharma-Bereich##t3__fliesstext@@Kartonverpackungen sind der Klassiker für die Verpackung von Medikamenten im Pharma-Bereich. Die Regale in den Apotheken sind voll davon und die Verpackungen \"konkurrieren\" um die Wahrnehmung über die Theke hinweg. Für nicht verschreibungspflichtige Produkte ist hier die Verpackung ein wichtiger Baustein der Markenentwicklung und -positionierung. Befindet sich die Verpackung im Haushalt und entspricht das Produkt den Vorstellung des Nutzers, soll die Kartonverpackung noch ein weiterer Marketingaufgabe erfüllen. Die Kundenbindung an die Marke. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
