INSERT INTO `content` VALUES('1466', '219', '0', '0', '', 't3__headline@@Anzeigen für den Pharma-Bereich##t3__subheadline@@Konzeption und Gestaltung von Pharma-Anzeigen##t3__fliesstext@@Als Werbeagentur bieten wir für Anzeigen die Konzeption, Gestaltung, Produktionsvorbereitung, Mediaplanung und Schaltung oder einzelne davon Teile an.  Natürlich auch für die Schaltung im Internet mit stehenden oder animierten Online-Bannern. In diesem Fall ist es eine Anzeigenserie für ein Pharma-Produkt für die Gesundheit der Nasenschleimhaut. Die Theme sind Trockenheit der Nase,  allergische Reizungen, Aufbau der beanspruchten Nasenschleimhaut und die Vermeidung von Abhängigkeiten von Nasensprays.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
