INSERT INTO `content` VALUES('1472', '80', '0', '0', '', 't1__bild@@955##t1__subheadline@@Pharma: Anzeigen-Gestaltung##t1__fliesstext@@Sie suchen eine Agentur, die Anzeigen oder Anzeigenserien im Pharmabereich gestaltet, für Print- und Onlinemedien aufbereitet und die Schaltung übernimmt. Sprechen Sie uns an.##t1__interner_link_@@219|Pharma Anzeigen Spray Salbe##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1473', '220', '0', '0', '', 't3__headline@@Pharma - Verpackung - Relaunch##t3__subheadline@@Ausstattung eines Pharma-Produktes - Sprayflasche, Tube, Faltschachtel und Beipackzettel##t3__fliesstext@@Gestaltungskonzepte für Verpackungen aus unterschiedliche Materialien und für unterschiedlichen Produkte sind seit über 20 Jahren ein Schwerpunkt unserer Werbeagentur. Natürlich auch für Verpackungen für den Pharmabereich. Hier sind vor allem Verpackungen aus Kunststoff, Verbundstoffen wie Blisterverpackungen, Aluminuium für Tuben und Karton gefragt. In diesem Fall ein ein Verpackungsrelaunch von Tuben, Sprays und der Faltschachteln als Um- und Verkaufsverpackung. Natürlich ausgestattet mit den erfordrlichen Beipackzetteln.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
