INSERT INTO `content` VALUES('1489', '41', '0', '0', '', 't1__bild@@970##t1__subheadline@@Ordner für die Sammlung von Projekten##t1__interner_link_@@221|Ordner Ringordner Planung Verband##t1__fliesstext@@Ringordner, oft auch fälschlicherweise Leitzordner genannt, dienen in der Regel zur Zusammenführung umfangreicher Materialien. Als Sammelordner für Projekte, Themen und Wissensgebiete oder für die Zusammenstellung von Schulungsunterlagen. Ein Ringordner kann in Form von DVD, Magnetkarten, USB-Sticks und anderen Medien auch digitale Daten beinhalten. Dies ist eine Frage des Zubehörs bzw. der Ausstattung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1490', '222', '0', '0', '', 't3__headline@@Klima und Energieprojekte##t3__subheadline@@Klima- und Energieprojekte - Eine Übersicht für die Region##t3__fliesstext@@Beispiele für Projekte, die sich mit dem Thema Energie und somit auch dem Klima auseinandersetzen gibt es viele. Nur wenn man sie sucht, hat man einiges zu tun. Als Übersicht und Anregung wurde ein Übersichtsordner mit unterschiedlichen regionalen Energieprojekten erstellt, der mit Registern und Pictogrammen zu den einzelnen Themen ausgestattet ist und in praktischer und gebündelter Form viele Klima- und Energieprojekte der Region mit Beispielen, Ansprechpartnern und hilfreichen Daten darstellt. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
