INSERT INTO `content` VALUES('1497', '223', '0', '0', '', 't3__headline@@Umwelt: Green City - Green Commune##t3__subheadline@@Green City - Projekte für eine lebenswerte Stadt##t3__fliesstext@@Als Werbeagentur liefern wir Ihnen mit viel Sachverstand und Know-how Kommunikation und Werbung für Ihre Projekte zum Thema Green City. Dazu gehören Veranstaltungen im öffentlichen Raum, Austellungen, Vorträge, Aktionen und vieles mehr. Fragen Sie uns an, wenn Sie Unterstützung für Ihre Kommunikation über Online- und Printmedien benötigen. Dieses Beispiel zeigt eine Übersicht über \"grüne\" Aktivitäten in der Region. Hierfür wurde ein ergänzbarer Ordner erstellt, der mit Registern und Ikons ausgestattet wurde, um den praktischen Nutzen zu erhöhen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
