INSERT INTO `content` VALUES('2240', '300', '0', '0', '', 't3__headline@@Newsletter - Arbeitsvermittlung##t3__subheadline@@Newsletter Arbeitsvermittlung##t3__fliesstext@@Als Werbeagentur sind wir in den unterschiedlichsten Bereichen zum Thema Arbeits- bzw. Jobvermittlung tätig. Newsletter sind hier für öffentliche Einrichtungen und privatwirtschaftlichen Unternehmen ein starkes Mittel der Kommunikation zwischen den Beteiligten und auch der Vermittlung selbst.\r\nWenn man so will, echte PR-Arbeit, für die wir als Werbeagentur von der Gestaltung bis zur kompletten Redaktionsstellung alles bieten können, was Sie für die Realisierung benötigen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
