INSERT INTO `content` VALUES('1506', '224', '0', '0', '', 't3__headline@@Corporate-Design für eine Fastfood-Kette mit vegetarische Lebensmitteln##t3__subheadline@@Das Corporate-Design für eine Fastfood-Kette unterliegt eigenen Regeln##t3__fliesstext@@Fastfood oder auch Finger-Food und vegetarische Lebensmitteln. Die Lebensmittelwelt ist vielfältiger geworden. Viele asiatische Food-Ketten bieten heute schon ein breites Angebot an vegetarischen Gerichten, die immer mehr Zuspruch finden. Die Statistik spricht von 30-prozentigen Zuwachsraten und einer vorwiegend weiblichen Kundschaft. Entsprechend ist ein Corporate-Design im Food-Bereich nicht mit klassischen, prämierten Corporate-Design-Konzepten zu vergleichen. Die Konzepte für diesen Bereich sind bunt und vor allem stark auf visuelle Reize ausgerichtet.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
