INSERT INTO `content` VALUES('1517', '23', '0', '0', '', 't1__bild@@1003##t1__subheadline@@Corporate-Design für vegetarisches Fast-Food##t1__fliesstext@@Das Corporate-Design für Endverbraucher im Food-Bereich stellt andere Anforderungen an die Konzeption und Umsetzung, wie für Unternehmen, die im b2b-Bereich tätig sind. Vegetarische Lebensmittel liegen eindeutig im Trend und die Verkaufszahlen wachsen jährlich um 30 Prozent, dennoch muss hier das Corporate-Design hier auch Motivationsarbeit leisten.##t1__interner_link_@@224|Corporate-Design Vegetarische Lebensmittel##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
