INSERT INTO `content` VALUES('1543', '227', '0', '0', '', 't3__headline@@Flyer-Serien im Bilderdruck##t3__subheadline@@Flyer-Serien für eine Vortragsreihe mit ganzflächiger Bilderbedruckung##t3__fliesstext@@Flyer-Serien mit ganzflächiger Bilderbedruckung benötigen ein Papier, dass die Druckfarbe nicht \"aufsaugt\". Ungestrichene Papier oder offene Papiere aus Recyclingmaterial sind für den Bilderdruck wenig geeignet. Damit Bilder in hoher Brillanz gedruckt werden können, kommen gestrichene Papiere, auch Bilderdruckpapiere genannt, zum Einsatz. Dies gibt es jetzt auch mit FSC-Zertifizierung in hochweißer Qualität.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
