INSERT INTO `content` VALUES('1552', '26', '0', '0', '', 't2__bild@@1038##t2__subheadline@@Flyer-Serie zum Thema Klimaschutz##t1__fliesstext@@Als Werbeagentur erstellen wir auch Flyer-Serien für Veranstaltungen, Dienstleistungen und Produkte. Dabei ist es vor allem wichtig, eine durchgängige und wiedererkennbare Linie zu entwicklen.##t2__interner_link_@@227|Flyer-Serie Klimaschutz##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1553', '228', '0', '0', '', 't3__headline@@Veranstaltungsankündigung für die Vortragsreihe: Klimawandel##t3__subheadline@@Klimawandel beschäftigt uns alle##t3__fliesstext@@Als Werbeagentur sind wir uns bewusst, wie wichtig es ist, ein Thema auf den Punkt zu kommunizieren. Bei diesem Projekt war das Thema nicht die globale Erwärmung, sondern auch die konkreten Auswirkungen auf die Bürger. Was bewirken bzw. bedeuten Temperatur, Licht und Wasser für den einzelnen Menschen und seine Gesundheit? Formal, wie inhaltlich ein schönes Beispiel, wie wir als Agentur solche Themen regionalbezogen umsetzen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
