INSERT INTO `content` VALUES('1563', '25', '0', '0', '', 't1__bild@@1042##t2__subheadline@@Unsere Werbeagentur und Events und Veranstaltung: Vortragsreihen##t2__fliesstext@@Vorträge werden zu speziellen Themen veranstaltet. Geht es, wie in diesem Fall, um den Klimawandel und Informationen für die Bürger einer Stadt, werden vor allem Medien zur Ankündigung benötigt. Dazu gehören Plakate und Flyer.##t2__interner_link_@@228|Veranstaltung Vortragsreihe Klimawandel##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1564', '229', '0', '0', '', 't3__headline@@Umwelt: Informationsveranstaltungen zum Klimawandel##t3__subheadline@@Informationsveranstaltung: Interesse wecken für das Thema und die Veranstaltung##t3__fliesstext@@Als Werbeagentur erstellen wir Ihnen Ankündigungsmaterialien für Informationsveranstaltungen wie Plakate, Flyer und Anzeigen bzw. Online-Banner oder umfassende Informationsmaterialien zu den jeweiligen Themen wie zum Beispiel den Klimawandel. Natürlich bieten wir Ihnen auch die Konzeption und Gestaltung multimedialer Präsentationen an. In diesem Fall ging es um Ankündigungsmaterialien in Form einer Plakatserie und Informationsflyer zu den einzelnen Schwerpunktthemen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
