INSERT INTO `content` VALUES('1574', '83', '0', '0', '', 't1__bild@@1050##t1__subheadline@@Umwelt - Klimawandel##t2__fliesstext@@Werbeagentur, Informationsveranstaltungen und Klimawandel. Diese Herausforderung nehmen wir als Werbeagentur gerne an und haben sie auch sehr gut gelöst. Als Werbung für die Informationsveranstaltung wurde eine Plakatserie und entsprechenden Informationsflyer gestaltet und produziert.##t1__interner_link_@@229|Umwelt Informationsveranstaltung Klimawandel##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1575', '230', '0', '0', '', 't3__headline@@Plakate-Serie für Veranstaltungen und Events##t3__subheadline@@Zeitnahe Ankündigungen über Plakat-Serien##t3__fliesstext@@Für Freizeitveranstaltung, Informationsveranstaltung oder andere Event, die ein breites Publikum ansprechen sollen, sind Plakate und Plakat-Serien die erste Wahl der Werbung und Kommunikation. In diesem Fall handelt es sich um eine Vortrags- und Informationsreihe mit unterschiedlichen Schwerpunktthemen und Angeboten, die in dieser Plakat-Serie über vektorgrafische Illustrationen gestaltet wurden.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
