INSERT INTO `content` VALUES('1581', '42', '0', '0', '', 't1__bild@@1057##t1__subheadline@@Plakate für Veranstaltungen und Events##t1__fliesstext@@Die stärke von Plakaten lässt sich an temporären Veranstaltungen und Events anschaulich machen. Warum plakatiert ein Circus in der Stadt und nicht im Internet?\r\nGenau. Es ist neben direkten Mailings an seine Kunden die direkte Ankündigung an ein breites Publikum.##t1__interner_link_@@230|Plakate-Serie Poster Natur##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '11', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1582', '231', '0', '0', '', 't3__headline@@Umwelt: Vorträge zum Thema \"Natur erleben\" ##t3__subheadline@@Als Werbeagentur bieten wir die Konzeption und Gestaltung von Vorträgen an.##t3__fliesstext@@Vorträge muss man nicht nur in Räumen abhalten. Man kann sie mit eigenen Erlebnissen verbinden. Wissenswertes in Theorie und Praxis verbunden mit dem Naturerlebnis machen Vorträge lebendig und schaffen ein neues Bewußtsein bei den Besuchern. In diesem Beispiel durch die Vortragsreihe mit einer Plakatserie Anzeigen und Informationsflyern angekündigt. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
