INSERT INTO `content` VALUES('1590', '83', '0', '0', '', 't1__bild@@1069##t1__subheadline@@Werbeagentur und Vorträge zum Thema: Umwelt##t1__fliesstext@@Als Werbeagentur erstellen wir Werbe- und Kommunikationsmittel für Vorträge zu den den unterschiedlichsten Umweltthemen und begleiten Sie auch bei der Organisation.##t1__interner_link_@@231|Umwelt Vorträge##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1591', '232', '0', '0', '', 't3__headline@@Bürgernahe Veranstaltungen und Vorträge##t3__subheadline@@Die eigene Stadt neu erleben oder die neue Stadt kennenlernen##t3__fliesstext@@Manchmal spielen sich Events im kleinen ab. Als Werbeagentur wissen wir, wie wertvolle diese Basisarbeit für Städte und Gemeinden ist. Kommunale Kommunikation und Information tragen dazu bei, sein Umfeld zu erleben, zu verstehen und sich zu identifizieren. Es sind nicht nur die Stadtmagazine, die auf Events aufmerksam machen. Es sind auch die öffentlichen Einrichtungen selbst, die Veranstaltungen inszenieren und kommunizieren. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
