INSERT INTO `content` VALUES('1599', '25', '0', '0', '', 't1__bild@@1078##t2__subheadline@@Events und Veranstaltungen von öffentlichen Einrichtungen wie Städte und Kommunen##t2__fliesstext@@Städte und Gemeinden bieten in der Regel eine Vielzahl von interessanten Angeboten bzw. Veranstaltungen. Leider gehen sie oft im allgemeinen Angebot unter. Als Werbeagentur sorgen wir für einen attraktiven Auftritt und deren Kommunikation über die Medien.##t2__interner_link_@@232|Events Veranstaltungen Vorträge##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1600', '19', '0', '0', '', 't1__bild@@1081##t1__subheadline@@Online-Shop / Web-Shop / Internet-Shop##t1__fliesstext@@Wie starte ich und wie verkaufe ich über das Internet? Wer über das Web verkaufen will, braucht zunächst nicht unbedingt einen eigenen Online-Shop bzw, Web-Shop. Wenn man mit seinem Unternehmen startet, braucht man vor allem ein Konzept und eine Verkaufsstrategie. Sollte der richtige Weg ein eigener Online-Shop sein, bietet unsere Webagentur kleine und große Lösungen an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1601', '22', '0', '0', '', 't1__bild@@1082##t2__subheadline@@Produkt-Broschüren##t2__fliesstext@@Die Produkt-Broschüre ist die kleine Schwester von Produkt-Katalogen. Wird eine überschaubare Produktrange angeboten, ist die Produkt-Broschüre eine adäquate Umsetzungsform, die sich auch ohne Online-Shop auf einer Website integrieren lässt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '14', '', '', '', '', '0', '0', '', '0');
