INSERT INTO `content` VALUES('1605', '233', '0', '0', '', 't3__headline@@Broschüre für öffentliche Einrichtungen und Ministerien##t3__subheadline@@Broschüre für öffentliche Einrichtungen und Ministerien - Information und Bürgernähe##t3__fliesstext@@Der Anteil von öffentlichen Auftraggebern, Landes- und Bundesministerien ist bei uns auffallend groß ist. Das spricht für unsere Agentur. Wir setzen uns mit komplexen Themen auseinander, bearbeiten sie verlässlich und gestalten sie zielgruppenoptimiert. Selbstverständlich ist für uns das Projektmanagement zwischen mehreren Entscheidern, Instanzen oder Kooperationspartnern.\r\nBroschüren für öffentliche Einrichtungen und Ministerien sollen Projekte oder Aktionen verständlich und motivierend unterstützen. Wir sprechen hier bewusst nicht von Werbung, sondern von Öffentlichkeitsarbeit und PR.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
