INSERT INTO `content` VALUES('1609', '22', '0', '0', '', 't1__subheadline@@Was ist eigentlich eine Broschüre?##t1__fliesstext@@Eine Broschüre ist ein Druckwerk ohne besonderem Einband (Umschlag), das buchbinderisch als Broschur (französisch) umgesetzt wird. Eine Broschüre hat in der Regel nicht mehr als 48 Seiten und ist auf aktuelle Themen ausgerichtet. Früher waren es religiöse oder politische Kampfschriften, heute fallen darunter eher  Bedienungsanleitungen oder werbliche Produktinformationen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '15', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1610', '37', '0', '0', '', 't1__bild@@1084##t1__subheadline@@Mobile und faltbare Messetheken##t1__fliesstext@@Auch Theken gibt es in den unterschiedlichsten Systemausführung. Neben der Verwendung bei der Messestand-Gestaltung finden sie häufig eine Verwendung am Point of Sale.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
