INSERT INTO `content` VALUES('1616', '234', '0', '0', '', 't3__headline@@Leporello ##t3__subheadline@@Leporello - Der Flyer mit dem Zick-Zack-Falz##t3__fliesstext@@Der Name Leporello kommt aus der Oper Don Giovanni von Wolfgang Amadeus Mozart. In diesem Stück verwaltet der Diener Leporello Masetto, die Namen und Termin seines Herren, mit seinen Geliebten auf einer Rolle. Da ihm dies nach einiger Zeit zu unhandlich wurde, legte er die Rolle auf die Treppe und faltete es zu einen mehrseitigen „Leporello\". Eine schöne Entstehungsgeschichte zum Thema Leporello. Der Vorteil, einen Flyer so zu falten, liegt buchstäblich auf der Hand. Übersteigt die Seitenzahl des Flyers 4 Seiten, wird er unhandlich und auch schwer zu erfassen. Mit der Leporello-Form hat der Betrachter die Möglichkeit, zwei Seiten zu betrachten, ohne den Leporello komplett auseinander falten zu müssen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
