INSERT INTO `content` VALUES('1621', '26', '0', '0', '', 't2__bild@@1092##t2__subheadline@@Flyer - Der Leporello##t1__fliesstext@@Eine Besonderheit stellt der Leporello dar. Dieser hat einen Zick-Zack-Falz. Der Name Leporello kommt aus der Oper Don Giovanni von Wolfgang Amadeus Mozart.##t2__interner_link_@@234|Flyer-Leporello##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1622', '235', '0', '0', '', 't3__headline@@Informationsplakate für Informationsveranstaltungen##t3__subheadline@@Informationsplakate - Viel Platz für Informationen##t3__fliesstext@@Informationsplakate unterscheiden sich grundsätzlich von klassischen Plakaten. Sie sind in der Regel nicht auf Fernwirkung ausgerichtet. Ausnahmen gibt es natürlich auch. Wer kennt nicht die großflächigen Informationsplakate zur Straßensicherheit an der Autobahn!? Der größere Teil der Informationsplakate wird allerdings bei Veranstaltungen, Ausstellungen oder zur Raumgestaltung eingesetzt. Über Informationsplakate können historische Abläufe ebenso wie wissenschaftliche Ergebnisse über Text, Foto, Illustrationen, Diagramme oder Tabellen dargestellt werden.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
