INSERT INTO `content` VALUES('1629', '42', '0', '0', '', 't1__bild@@1095##t1__subheadline@@Plakate für  Informationsveranstaltungen##t1__fliesstext@@Als Ergebnis eine Projekte, einer wissenschaftlichen Dokumentation oder für eine Ausstellung erstellt und produziert unsere Werbeagentur individuelle Plakate mit allem, was dazu gehört. ##t1__interner_link_@@235|Informationsplakate Informationsveranstaltungen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '15', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1630', '236', '0', '0', '', 't3__headline@@Event Veranstaltung - Informationsveranstaltungen##t3__subheadline@@Informationsveranstaltungen - Vorträge, Präsentationen und Ausstellungen##t3__fliesstext@@Als Werbeagentur liefern wir die Gestaltung und Produktion von digitalen und gedruckten Präsentationen, erstellen  Ausstellungskonzepte und gestalten Informationsplakate und Videos. Unsere Agentur ist Ihr Ansprechpartner, wenn Ihre Informationsveranstaltung ein eigenes Gesicht bekommen sollen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1638', '25', '0', '0', '', 't1__bild@@1100##t2__subheadline@@Informationsveranstaltungen##t1__fliesstext@@Als Werbeagentur liegen uns Informationsveranstaltung besonders am Herzen. Sie verständlich zu kommunizieren und zu visualisieren ist inhaltlich eine Herausforderung, die wir gerne annehmen.##t2__interner_link_@@236|Event Veranstaltung Informationsveranstaltungen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
