INSERT INTO `content` VALUES('1639', '237', '0', '0', '', 't3__headline@@Ausbildung - Ein Thema für Ministerien##t3__subheadline@@Bundes- und Landesministerien und die Bildungsträger##t3__fliesstext@@Konzept fünf ist seit über 2 Jahrzehnten parteiübergreifend Ansprechpartner für Bundes- und Landesministerien und den jeweiligen Trägern, wenn es um die Kommunikation von öffentlichen Themen in den unterschiedlichsten Bereichen geht. Ohne Frage hat sich unsere Werbeagentur gerade bei sozialpolitischen Themen ein recht profundes Know-how erworben und ist ein kompetenter Ansprechpartner von Ministerien und Projektträgern.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
