INSERT INTO `content` VALUES('1653', '61', '0', '0', '', 't1__bild@@1107##t1__subheadline@@Ausbildung - Ein Thema für Ministerien##t2__fliesstext@@Die erfolgreiche Vermittlung von Jugendlichen bzw. Schulabgängern ist ein zentrales, gesellschaftliches Thema. Als Werbeagentur beraten wir öffentliche Einrichtungen und Ministerien bei der Gestaltung und Umsetzung von Kampagnen und Projekten.##t1__interner_link_@@237|Ausbildung Ministerien##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1654', '238', '0', '0', '', 't3__headline@@Jobvermittlung für Berufseinsteiger##t3__subheadline@@Jobvermittlung - Für jugendliche Berufseinsteiger ein sehr wichtiger Schritt##t3__fliesstext@@Von der Schule in das Berufsleben. Jugendliche brauchen dafür Unterstützung und die richtige Beratung. Letztendlich werden Weichen gestellt, die einem ein ganzes Leben lang begleiten, auch wenn man später einen anderen Beruf ausübt. Wenn die Basis stimmt, ist viel gewonnen. Als Werbeagentur mit Verantwortung bilden wir nicht nur aus, sondern betreuen Projekte für Jugendliche mit viel Engagement. Wir wissen um die Verantwortung, wenn es um den Berufseinstieg geht und wissen auch, wie man Wege ebnen kann. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
