INSERT INTO `content` VALUES('1669', '58', '0', '0', '', 't1__bild@@1107##t1__interner_link_@@238|Jobvermittlung Jugend##t1__subheadline@@Jobvermittlung für Berufseinsteiger##t1__fliesstext@@Das Ministerium in Hessen hat OloV ins Leben gerufen, um die Qualität und den Übergang von Jugendlichen von der Schule in den Beruf zu verbessern. Für Berufseinsteiger ist dieses Projekt eine qualitative Verbesserung und eine echte Unterstützung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1670', '239', '0', '0', '', 't3__headline@@Jugend und Ausbildung##t3__subheadline@@Der Übergang von Schule in den Beruf. Ein Thema für Ministerien, Unternehmen und öffentliche Einrichtungen##t3__fliesstext@@Für eine Werbeagentur ist bei uns der Anteil an öffentlichen Auftraggebern wie Landes- oder Bundesministerien oder öffentlichen Einrichtungen sehr hoch. Dies liegt vor allem an den vielen öffentlichen Themen, die unsere Agentur schon bearbeitet hat.\r\nIn diesem Fall war es die Gestaltung, Illustration, Bildbeschaffung, Bildbearbeitung, Reinzeichnung und Druck einer Broschüre in Rahmen der Gestaltungsvorgaben des Ministeriums zum Thema: Qualitätsstandards zur Optimierung der lokalen Vermittlungsarbeit bei der Schaffung und Besetzung von Ausbildungsplätzen in Hessen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
