INSERT INTO `content` VALUES('1824', '253', '0', '0', '', 't3__headline@@Kunst - Malerei ##t3__subheadline@@Zur Vermarktung von Künstlern und der Malerei im Internet##t3__fliesstext@@Für hauptberufliche MalerInnen reicht es heute nicht mehr aus, Ausstellungen zu injizieren oder zu bedienen. Neben Flyern oder Katalogen zu Ausstellungen oder als Selbstdarstellung ist der Internetauftritt ein wichtiges Vermarktungsmedium. Wir kennen den Markt und auch viele Künstler und wir wissen auch, dass mindestens 80% unserer Ansprechpartner weder etwas mit Technik im Internet oder mit Texten zu tun haben wollen. Letzteres ist ein wenig unverständlich, da die Künstler gezwungen werden, ihre Werke bei Vernissage und Finissage zu erklären. Als Agentur bearbeiten wir Ihre Texte, bieten Ihnen bezahlbare Internetauftritte und auch eine selbst verwaltbare Bildergalerie, die leicht zu bedienen ist.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
