INSERT INTO `content` VALUES('1707', '84', '0', '0', '', 't1__bild@@1151##t1__subheadline@@Verlage: Kinderzeitungen##t2__fliesstext@@Wenn sie als Verlag eine Werbeagentur oder vielmehr eine Grafikagentur suchen, die Ihnen Zeitungen oder Medien im Print- und Online-Bereich für Kinder umsetzt, dann fragen Sie uns an. \r\nÜber 20 Jahre Erfahrung als Agentur stehen Ihnen kreativ und zuverlässig zur Verfügung. Kindgerechte Gestaltung, Typografie, Illustrationen, Erarbeitung und Umsetzung von Rätsel oder Spiele, wir setzen es nach Ihren Verlagsvorgaben für Print- und Onlinepublikationen um. ##t1__interner_link_@@240|Verlag Kinderzeitungen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1708', '241', '0', '0', '', 't3__headline@@Gastronomie - Catering und Restaurant##t3__subheadline@@Catering und Restaurant mal etwas persönlicher##t3__fliesstext@@Ein Restaurant mit Catering-Service kann man unterschiedlich bewerben. Meistens lernt man aber die Köpfe dahinter nie kennen. In diesem Fall ist das Konzept anders aufgebaut. Hier stehen die Personen und ihre Leistungen im Vordergrund. Um dies umzusetzen. Dazu gehört zunächst der Entschluß, persönlich für sich zu werben, dann ein entsprechendes Foto-Shooting und ein etwas anderes visuelles Konzept der Unternehmensdarstellung, dass nicht nur in der schwarz-weiß Umsetzung sondern auch in den Texten wiederzufinden ist.\r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
