INSERT INTO `content` VALUES('1764', '247', '0', '0', '', 't3__headline@@Energieberatung##t3__subheadline@@Energieberatung - Ein politisches und private Thema##t3__fliesstext@@Energieberatungen erfreuen sich einem immer größeren Zulauf. Kein Wunder, sondern gewollt und notwendig. Seit der Energiewende geht es bundesweit darum, Energie einzusparen und neue Lösungen und Techniken aufzuzeigen. Energie einzusparen heißt aber auch, Kosten zu reduzieren. Daher ist der Bedarf nach Beratung, bevor man in neue Lösungen investiert, sehr hoch. Diese 5 Broschüren enthalten in schriftlicher Form alle wesentlichen Informationen zu den Schwerpunktthemen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
