INSERT INTO `content` VALUES('1796', '250', '0', '0', '', 't3__headline@@Flyer - Konzepte ##t3__subheadline@@Flyer - Konzepte für aktuelle Themen##t3__fliesstext@@Als Werbeagentur entwickeln wir für Unternehmen und öffentliche Einrichtungen Konzeptvorschläge für die Kommunikation zu unterschiedlichen Themen. In der Regel werden unterschiedliche Varianten ausgearbeitet, um eine spätere Entscheidung leichter zu machen. Oft werden Handmuster erstellt, die dann wiederum einer Reihe von Testpersonen vorgelegt werden, um eine möglichst optimale Ansprache zum Thema zu erzielen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
