INSERT INTO `content` VALUES('1802', '251', '0', '0', '', 't3__headline@@Konzept für eine Plakat-Kampagnen##t3__subheadline@@Ideen und Möglichkeiten für die Visualisierung von Plakat-Kampagnen##t3__fliesstext@@Im Vorfeld einer größer angelegten Werbe-Kampagne ist es sehr hilfreich, sich unterschiedliche Ideen und Varianten visualisieren zu lassen. Als Werbeagentur erstellen wir Basiskonzepte und gestalten erste Grob-Layouts für Plakat-Kampagnen, um die Entscheidungsfindung für Art und Motive zu erleichtern. In der Regel reichen für den Entscheidungsprozess digitale Daten wie z.B.  pdf-Dateien aus. Erscheint es wichtig, die Motive im Vorfeld schon auf Ihre Fernwirkung zu überprüfen, erstellen wir Ihnen gerne erste Posterdrucke in Originalgröße.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
