INSERT INTO `content` VALUES('1810', '16', '0', '0', '', 't2__bild@@1235##t2__subheadline@@Fahrzeugwerbung - Buswerbung##t2__fliesstext@@Die Fahrzeugwerbung über öffentliche Busse erfolgt in der Regel nach Vorgaben der jeweiligen lokalen oder nationalen Anbieter und der Werbefläche, die man für seine Buswerbung belegen bzw. buchen will. Neben der Gestaltung und Produktion kümmern wir uns als Werbeagentur natürlich auch um die Organisation und Administration rund um Ihre Bus- bzw. Fahrzeugwerbung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
