INSERT INTO `content` VALUES('1830', '75', '0', '0', '', 't1__bild@@1252##t1__subheadline@@Kunst - Malerei und Vermarktung##t1__fliesstext@@Für hauptberufliche MalerInnen reicht es nicht mehr aus, Ausstellungen zu injizieren oder zu bedienen. Neben Flyern zu Ausstellungen oder Katalogen ist der Internetauftritt ein zentrales und durchaus nützliches Vermarktungsmedium. Für den, der Erfolg hat, finanziell kein Problem. Wer weniger Erfolg hat, aber ihn haben möchte, ein muss. Und zwar mit Bildgalerie. ##t2__interner_link_@@253|Kunst Malerei##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1831', '254', '0', '0', '', 't3__headline@@Internetseiten für Maler, Bildhauer und Fotografen##t3__subheadline@@Künstler brauchen bezahlbare Internetseiten und eine Bilddatenbank##t3__fliesstext@@Internetseiten für Künstler wie Maler, Bildhauer oder Fotografen brauchen gute und bezahlbare Präsentationen ihrer Werke, eine gut zu pflegende Bilddatenbank und oft eine Webagentur, die im Auftrag die Texte schreibt. Mit einer Instant-Lösung für eine Internetseite ist es da nicht getan. Neben dem künstlerischen Anspruch wird\r\nein Content-Management-System benötigt, dass es auch ermöglicht, eine Bilddatenbank zu pflegen. Wir helfen Ihnen dabei, eine vernünftige Lösung umzusetzen und unterstützen auch bei der Erstellung von Texten oder der Dokumentation Ihrer Arbeiten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
