INSERT INTO `content` VALUES('1841', '255', '0', '0', '', 't3__headline@@Umwelt: Elektro-Recycling##t3__subheadline@@CD für eine Elektro-Recycling Unternehmen##t3__fliesstext@@Es ist selten der Fall, dass eine Werbeagentur schon bei der Planung eines Projektes mit einbezogen wird. Hier war es der Fall. Das Projekt fing nicht nur mit dem Logo an, sondern auch mit der Planung des Gebäudes. Als Full Service Agentur lieferten wir vom Bauschild bis zur Planung der Eröffnungsfeier alles, was das Unternehmen benötigte. Unverkennbar aus einem \"Guß\".##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
