INSERT INTO `content` VALUES('1850', '83', '0', '0', '', 't1__bild@@1261##t1__subheadline@@Umwelt: Elektro-Recycling##t2__fliesstext@@Konzept fünf ist bekannt dafür, sich mit neuen oder komplexen Themen als Agentur auseinander zu setzen und geeignete Lösungen anzubieten. Vor allem dann, wenn das Thema noch nicht die Öffentlichkeit erreicht hat und die Technik nahezu unbekannt ist. Wir bieten als Werbeagentur Werbung und Kommunikation zu Themen, die neu und somit erklärungsbedürftig sind.##t1__interner_link_@@255|Umwelt Elektro-Recycling##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1851', '256', '0', '0', '', 't3__headline@@Umweltdienst Recycling##t3__subheadline@@Full Service Betreuung für ein Recycling-Unternehmen##t3__fliesstext@@Vor der Markteinführung wurde unsere Agentur schon angesprochen, für das Recycling-Unternehmen den Gesamtauftritt zu gestalten und die Marketingmaßnahmen zu entwickeln. Zu unseren Leistungen gehörten: Konzepterstellung, Grafikdesign und Umsetzung eines Corporate Design bestehend aus Unternehmensmarke für Holding, Aktiengesellschaft und GmbH, einer Geschäftsausstattung mit Visitenkarte und Briefpapier, einer Selbstdarstellung als Broschüre, Internetauftritt auf CMS - Basis, Firmenschilder, Bauschild und Fassadengestaltung. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
