INSERT INTO `content` VALUES('1870', '69', '0', '0', '', 't1__bild@@1278##t1__subheadline@@Getränke Bier - Marken und Image##t2__fliesstext@@Die Positionierung vpn neuen Biermarken und die Gestaltung von Etiketten für Bierflaschen ist eine Wissenschaft für sich. Als Werbeagentur kennen wir die Anforderungen und auch die entsprechenden Druckverfahren.##t1__interner_link_@@257|Getränke Marke Bier##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
