INSERT INTO `content` VALUES('1872', '258', '0', '0', '', 't3__headline@@Verlag: Fachpublikationen##t3__subheadline@@Fachthemen verständlich machen##t3__fliesstext@@Fachthemen erfordern eine Auseinandersetzung mit den Inhalten wie zum Beispiel zum Thema Gefahrenstoffe. In diesem Fall sind Illustrationen und eine übersichtliche Gestaltung gefragt. Oft werden auch anschauliche, am Besten selbsterklärende, Diagramme oder Bildbearbeitungen benötigt, die wir Ihnen neben der Gesamtgestaltung als Werbeagentur liefern können. Natürlich nach Ihren Verlagsvorgaben für Print- und Onlinemedien.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
