INSERT INTO `content` VALUES('1878', '84', '0', '0', '', 't1__bild@@1681##t1__subheadline@@Spiele und Rätsel##t1__fliesstext@@Wir entwickeln und gestalten für Ihren Verlag vor allem im Kinderbereich Spiele und Rätsel. Dabei achten wir vor allem auf den pädagogischen Wert und die Verständlichkeit. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1879', '41', '0', '0', '', 't1__bild@@1288##t1__subheadline@@Ordner - Zubehör und Ausstattung - Die Produktion##t2__fliesstext@@Als Werbeagentur wissen wir, dass nicht nur die Gestaltung, sondern auch die Produktion von Ordnern einige Fragen beinhaltet. Welches Format und welche Größe brauche ich? Welche Mechanik ist für mich sinnvoll? Welche Oberflächenbeschichtung passt zu meiner Zielgruppe? Wie bekomme ich bereits vorhandene Materialen in den Ringordner, ohne sie lochen zu müssen?\r\nHier gibt es einige Lösungen für die Konfektionierung die wir Ihnen hier aufzeigen.##t2__interner_link_@@259|Ordner Leitzordner Zubehör - Ausstattung - Produktion##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
