INSERT INTO `content` VALUES('1925', '265', '0', '0', '', 't3__headline@@Entsorgung - Kampagne zur Vermeidung von Restmüll##t3__subheadline@@Tonnenweise sparen - eine Kampagne gegen Restmüll und Kosten##t3__fliesstext@@Entsorgung und Restmüll - Seit der Einführung der Abfalltrennung immer wieder ein Thema für Entsorgungsunternehmen. Möglichst wenig Restmüll ist das Ziel. In dieser Kampagne wurde die Idee der schlanken Tonne umgesetzt. Verbunden mit einer rustikalen Schleife als Symbol für das \"Geschenk\" der Mühen. Weniger Kosten. \r\nUmgesetz wurde das Leitmotiv über klassische Bildmontage. Die Kampagne beinhaltete Flyer, Plakate und Informationsmappen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
