INSERT INTO `content` VALUES('1932', '64', '0', '0', '', 't1__bild@@1323##t1__interner_link_@@265|Entsorgung Umweltdienste Restmüll##t2__subheadline@@Entsorgung -  Kampagne zur Verminderung von Restmüll##t1__fliesstext@@Die schlanke Restmülltonne, eine kommunale Kampagne gegen Restmüll und Kosten##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1933', '42', '0', '0', '', 't1__bild@@1328##t1__subheadline@@Was ist für ein Plakat wichtig?##t1__fliesstext@@Die Frage: Was ist für ein Plakat wichtig? Als Werbeagentur können wir dazu eine klare Antwort geben. Ein Motiv, das ungewöhnlich ist, ein Slogan, der Interesse weckt und dazu wenige Kernaussagen. Dann noch die Möglichkeit, um selbst aktiv zu werden und vor allem...das alles aus der Ferne lesen zu können. In diesem Plakat ist alles da. Und es ist, das wissen wir mit über 25 Jahren Erfahrung, selten möglich. \r\nEs liegt nicht an uns! Das Plakat ist nichts anderes als ein großer, einseitig bedruckter Flyer. Einen Flyer hält man in der Hand, ein Plakat hängt in einiger Entfernung auf einem Träger oder einer Wand. Hier liegt der Unterschied! Beraten kann man lang und viel. Letztendlich soll noch dies und das auf das Plakat und dann kommen noch die 30 Sponsoren mit ihrem Logo. So funktionieren Plakate deutlich schlechter, aber sie werden auch von uns in dieser Form umgesetzt. Trotz Beratung.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1934', '266', '0', '0', '', 't3__headline@@Flyer - Titel##t3__subheadline@@Bildmontage für die Bebilderung von Flyer-Titeln.##t3__fliesstext@@Flyer-Titel können mit vorhandenen oder extra erstellten Fotos, Illustrationen oder rein typografisch gestaltet werden. Während die Bildbearbeitung Bilder optimieren soll, ist die Bildmontage dazu da, nicht vorhandene \"Realitäten\" zu schaffen. Gute Bildmontagen, auf Flyern als Titel eingesetzt, haben einen hohen Aufmerksamkeitswert.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
