INSERT INTO `content` VALUES('1941', '26', '0', '0', '', 't2__bild@@1329##t2__subheadline@@Flyer zum Thema: Restmüll trennen##t1__fliesstext@@Vor der heute anstehenden Pflicht-Biotonne stand die Aufklärung über die Trennung von Wertstoffen wir Kunststoffe oder Papier. Flyer eigenen sich nicht nur für kommunale Themen, die für einen bestimmten Zeitraum für Aufmerksamkeit sorgen, sondern auch für Veranstaltungen oder zeitlich begrenzte Angebote.##t2__interner_link_@@266|Flyer Restmüll trennen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1942', '267', '0', '0', '', 't3__headline@@Fahrzeugbeschriftung für Transporter##t3__subheadline@@Fahrzeugbeschriftung und Transporter - Warum nicht werben, wenn man die Möglichkeit hat##t3__fliesstext@@Ob Unternehmen mit Fuhrpark, öffentliche Einrichtungen oder Einzelhandwerker, jeder der mit einem Transporter unterwegs ist, hat die Möglichkeit, für sich und seine Leistungen zu werben. Dabei sollte man Fahrzeugwerbung nicht unterschätzen. Die Fahrzeuge sind im öffentlichen Raum als Werbefläche permanent präsent ohne Miete für die Fläche zu zahlen und auch immer wieder an anderen Standorten. Durch die relativ großen Fahrzeugbeschriftungen auf Transportern lässt sich hier auch eine optimale Fernwirkung erzielen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
