INSERT INTO `content` VALUES('1949', '16', '0', '0', '', 't2__bild@@1335##t2__subheadline@@Fahrzeugbeschriftungen für Transporter##t2__fliesstext@@Transporter sind des Handwerkers und Dienstleisters liebstes Fortbewegungsmittel. Entsprechend häufig realisieren wir als Werbeagentur Autowerbung für diese Fahrzeuggröße.##t2__interner_link_@@267|Fahrzeugbeschriftung Transporter##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1952', '268', '0', '0', '', 't3__headline@@Werbung über Aufkleber##t3__subheadline@@Für bessere Entsorgung über Aufkleber an Abfallbehältern werben##t3__fliesstext@@Aufkleber kommen im Entsorgungsbereich relativ häufig vor. Für Fahrzeuge, Container, Tonnen und eben auch Abfallbehältern. Meist haben die Aufkleber allerdings eher einen informellen Inhalt und dienen weniger der Werbung oder Kommunikation. In diesem Fall wurde mit unterschiedlichen Sprüchen auf die Nutzung der öffentlichen Abfallbehälter hingewiesen um dem \"wilden\" Straßenmüll entgegen zu wirken.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1951', '43', '0', '0', '', 't1__bild@@1341##t1__subheadline@@Schilder für den öffentlichen Bereich##t1__fliesstext@@Straßenschilder oder Verkehrsschilder bedürfen selten einer Gestaltung, eher einer Umsetzung. Aber es gibt Schilder im öffentlichen Bereich, die konzeptioneller und gestalterische Leistungen benötigen. Spielplatzschilder, Schilder für Fitness-Parcours oder Leitsysteme in öffentlichen Einrichtungen sind besondere und verantwortungsvolle Aufgaben, die wir gerne übernehmen.##t2__umbruch@@', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
