INSERT INTO `content` VALUES('1958', '64', '0', '0', '', 't1__bild@@1344##t1__interner_link_@@268|Entsorgung Abfallbehälter Werbung Aufkleber##t2__subheadline@@Kommunikation über Abfallbehälter und Tonnen##t1__fliesstext@@Für den Bürger ist das Zentrum jeder Entsorgung der entsprechende Sammel- bzw. Abfallbehälter. Warum nicht Tonnen oder Behälter für die eigene Werbung bzw. Öffentlichkeitswerbung nutzen? Eine Idee und einige kostengünstige Aufkleber reichen aus, um entsprechende Botschaften zu vermitteln.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
