INSERT INTO `content` VALUES('1963', '269', '0', '0', '', 't1__bild@@1347##t1__subheadline@@Plakat für eine Produktneuheit##t1__fliesstext@@Das erste Blutdruckmessgerät, dass in unterschiedlichen Sprachen sprechen kann. Mit großer Displayanzeige und einfacher Bedienung. Die Ankündigung dieser Produktinnovation erfolgte über Plakate in Apotheken.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1964', '269', '0', '0', '', 't1__bild@@1346##t1__subheadline@@Plakat für eine Weihnachtsaktion##t1__fliesstext@@Dieses Plakat spricht im Rahmen einer Weihnachtsaktion in Apotheken Zielgruppen an, die für das Thema Blutdruckmessgeräte in Frage kommen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1965', '42', '0', '0', '', 't1__bild@@1348##t1__subheadline@@Plakate für den Apotheken- und Pharma-Bereich##t1__fliesstext@@Plakat für den Apotheken- und Pharma-Bereich unterliegen besonderen Restriktonen. Der Gesetzgeber gibt in diesem Fall, stärker als in anderen Bereichen vor, was erlaubt und nicht erlaubt ist. Als Werbeagentur beschäftigen wir und schon viele Jahre mit diesem Thema und finden auch für Sie die optimale Lösung.##t1__interner_link_@@269|Plakat Apotheken Blutdruckmessgeräte##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('1966', '270', '0', '0', '', 't3__headline@@Verpackungen für medizintechnische Produkte##t3__subheadline@@Medizintechnische Produkte - Besondere Anforderungen an die Verpackung##t3__fliesstext@@Wie auch bei anderen elektronischen Produkten ist die Verpackung von medizinischen Produkten immer damit verbunden, dass das Produkt so gut wie möglich geschützt wird. Dabei spielen die Inlays aus Karton, Schaumstoff oder Styropor, aber auch die Umverpackung aus Karton eine wichtige Rolle. Während der Karton medizintechnische Produkte formstabil sein muss und das Produkt vor Umwelteinflüssen schützt, sind die Inlays vor allem darauf ausgerichtet, Stöße abzufangen und das Gerät vor mechanischen Schäden zu schützen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
