INSERT INTO `content` VALUES('1973', '44', '0', '0', '', 't2__bild@@1362##t2__subheadline@@Verpackungen aus Karton bzw. Kartonagen##t2__fliesstext@@Die besondere und individuelle Verpackung von z.B. elektronischen Produkten ist nicht nur für die Gestaltung, sondern auch für die Umverpackung sondern auch für das Inlay eine Herausforderung. Verpackungen aus Karton bzw. Kartonagen haben sich hier bewährt. Wenn Sie diese Art von Verpackungen suchen, sprechen Sie uns einfach an.##t2__interner_link_@@270|Verpackungen aus Karton bzw. Kartonagen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
