INSERT INTO `content` VALUES('1988', '273', '0', '0', '', 't3__headline@@Food-Ingredients##t3__subheadline@@Food-Ingredients - Von machbar bis notwendig##t3__fliesstext@@Man mag über Food-Ingredients denken wie man will und am liebsten würde sich natürlich jeder am liebsten mit den frischesten und natürlichsten Lebensmitteln versorgen. Ist aber in dieser Form nicht machbar. Backwaren sollten nicht nur so lange halten, bis wir es gekauft haben, Früchte aus exotischen Ländern verfügbar sein und Produkte nicht so viel Kalorien beinhalten, aber dennoch süß sein. Eine gute Massenversorgung ist ohne Ingrediens und gut funktionierender Logistik schlicht und ergreifend nicht möglich. Es fehlt der Bauer nebenan. Als Werbeagentur arbeiten wir übergreifend für Bioanbieter und die Großindustrie. Beide profitieren davon.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
