INSERT INTO `content` VALUES('2011', '69', '0', '0', '', 't1__bild@@1391##t1__subheadline@@Getränke - Ingrediens##t1__fliesstext@@The world of sweetness. Bei einer riesigen Zahl von Getränken, ohne oder mit wenig Zucker, immer eine Frage des Geschmacks. Dem Blending der Ingrediens.##t1__interner_link_@@276|Getränke - Ingrediens##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2012', '277', '0', '0', '', 't3__headline@@Nahrungsmittel Süßstoffe##t3__subheadline@@Natürliche und künstliche Süßstoffe - Der Ersatz für Zucker##t3__fliesstext@@Künstliche Süßstoffe und vermehrt auch natürliche Süßstoffe wie Stevia werden als Zuckerersatz oder Zuckerbeimischung verwendet. Ob als zuckerloses oder zuckerreduzierte Variante. Um den Geschmack von Zucker möglich nah zu kommen, forscht man an den richtigen Blending-Rezepten, der Kombination unterschiedlicher Süßungsarten. Die gezeigten Marketingkonzepte für den BtoB-Bereich beschäftigen sich somit im Schwerpunkt mit dem Thema Geschmack und sind für den europäischen bzw. amerikanischen Markt ausgerichtet.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
