INSERT INTO `content` VALUES('2044', '281', '0', '0', '', 't3__headline@@Lebensmittel - Sicherheit und Qualität##t3__subheadline@@Sind importierte Lebensmittel Sicherheit?##t3__fliesstext@@Sicher kann man auch bei einheimischen Produkten nichts sein, aber ziemlich sicher. Entsprechende Kontrollstandards existieren in vielen westlichen Ländern. Aber eben nur dort. Einheimische Produzenten werden mit qualitativ minderwertigeren Produkten aus dem Ausland konfrontiert, bis es zu einem Lebensmittelskandal kommt und eine ganze Branche in Verruf bringt. Ein gutes Mittel dagegen ist aktive Öffentlichkeitsarbeit im Vorfeld, die über gegebene Sachlagen informiert. Die vorgestellte Kampagne informiert über Qualitätsunterschiede, Sicherheitsstandards und bedenkliche Importe in den amerikanischen Markt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
