INSERT INTO `content` VALUES('2053', '282', '0', '0', '', 't3__headline@@Luftaufnahmen##t3__subheadline@@Luftaufnahmen vom Helikopter oder durch Oktokoper##t3__fliesstext@@Sprechen Sie uns an, wenn Sie Luftaufnahmen von Ihrem Unternehmen, einer Location oder eines Events benötigen. Wir liefern Ihnen die Betreuung der Luftaufnahmen mit Terminplanung, Aufnahmevorgaben, Wetterdiagnose, Sonneneinfallwinkel zur jeweiligen Tageszeit am Aufnahmeort und natürlich auch der entsprechenden Fluggenehmigung für Helikopter oder Oktokoper. Ersteres natürlich mit einem professionellen Fotografen oder Filmer.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
