INSERT INTO `content` VALUES('2078', '286', '0', '0', '', 't3__headline@@Soziale Einrichtungen - Pflege und Betreuung##t3__subheadline@@Vom Logo bis zur Kommunikation##t3__fliesstext@@Die Zahl der privatwirtschaftlichen sozialen Unternehmen nimmt zu. Lücken in der sozialen Versorgung vor allem im Bereich Pflege und Betreuung für Senioren müssen besetzt werden. Als Werbeagentur betreuen wir diese Unternehmen von Beginn an. Profitieren Sie von der Erfahrung unserer Agentur und fragen Sie uns an, bevor Sie Ihre ersten Schritte realisieren. Dadurch vermeiden Sie Fehlinvestitionen und realisieren die Dinge, die für sie wichtig sind. Wie gesagt, fragen Sie uns einfach an.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
