INSERT INTO `content` VALUES('2097', '289', '0', '0', '', 't3__headline@@Pharma - Marken-Relaunch##t3__subheadline@@Konzept für einen Marke-Relaunch##t3__fliesstext@@Konzept fünf erstellt als Werbeagentur Konzepte für einen Marken-Relaunch. Entwickelt merkfähige Attribute, modernisiert die Marke und schafft entsprechende Markenumfelder, die auf die definierten Zielgruppen abgestimmt sind. In diesem Beispiel ein Superzeichen \"X\", in der Anwendung auf Verpackungen und im Einsatz in Anzeigen bei unterschiedlichen Zielgruppen. Hier: Kinder und (trendige) Sportler.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
