INSERT INTO `content` VALUES('2143', '294', '0', '0', '', 't3__headline@@Technische Broschüren##t3__subheadline@@Technische Broschüren - Detaillierte Informationen über die Produkte##t3__fliesstext@@Technische Broschüren sind in der Regel nicht im Wartezimmer zu finden. Sie richten sich an Fachleute und beinhalten alle Informationen, die für die Zielgruppe wichtig sind. Neben der optimalen Produktdarstellung spielen Diagramme, Schema- und Funktionszeichnungen und Tabellen eine wichtige Rolle. \r\nLesbare Tabellen, verständliche technische Zeichnungen und klare Strukturen sind für uns als Werbeagentur selbstverständlich.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
