INSERT INTO `content` VALUES('2151', '22', '0', '0', '', 't1__bild@@1494##t1__subheadline@@Technische Broschüren - Tabellen, Zeichnungen und Corporate Design##t1__interner_link_@@294|Technische Broschüren##t1__fliesstext@@Broschüren für den technischen Bereich sind häufig mit detaillierten Informationen in Form von Diagrammen, Zeichnungen und Fotos ausgestattet. Auch wenn Techniker es gewohnt sind, damit umzugehen, spielen klare Strukturen als Orientierungshilfe bei technischen Broschüren eine wichtige Rolle. Um zusätzlich ein einheitliches Gesamterscheinungsbild zu erzielen, wurden hier alle Komponenten, Aggregate und Anlagen in 3-D Visualisierungen dargestellt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
