INSERT INTO `content` VALUES('2157', '211', '0', '0', '', 't1__subheadline@@Die Technik##t1__fliesstext@@Damit unsere Proofs eine zuverlässliche Vorhersage des Offsetdrucks realisieren, verwenden wir nur die beste Technik. Drucksysteme mit langzeitstabilenTinten von Canon, RIP-Technologie von Efi, Meßtechnik von Xrite und FOGRA -zertifizierte Proof-Papiere.\r\n\r\nDie Aufnahmen werden nach gewünschter Größe mit besonderen verzeichnungsfreien Reproobjektiven mit Vollformatkamera mit 22 Millionen Pixel Auflösung ( DIN A3+ bei 300 dpi) oder mit Mittelformatkamera PhaseOne IQ260 mit 60 Millionen Pixel Auflösung ( DIN A1 bei 300 dpi) fotografiert.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2158', '103', '0', '0', '', 't1__bild@@1509##t1__subheadline@@Perfekte Museumsfotografie##t1__fliesstext@@Perfekte Museumsfotografie mit hochwertigen Fotoaufnahmen von Gemälden, Skulpturen und Rauminstallation. Eine Frage der Erfahrung, der Technik und des Auges des Fotografen.##t1__interner_link_@@211|Museumsfotografie##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2161', '122', '0', '0', '', 't1__headline@@Werbeagentur für Imagebroschüren##t1__fliesstext@@Diese Imagebroschüre bzw. Unternehmensbroschüre wurde nach CD-Vorgaben des Kunden gestaltet und umgesetzt. In diesem Fall lag der Schwerpunkt der Gestaltung auf der Darstellung des Unternehmens, des Personals und den angebotenen Dienstleistungen. Die Imagebroschüre wurde mehrsprachig realisiert.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '8', '', '', '', '', '0', '0', '', '0');
