INSERT INTO `content` VALUES('2166', '123', '0', '0', '', 't1__subheadline@@Immobilienbroschüre bzw. Exposé für einen Lagerhallen-Neubau.##t1__fliesstext@@In diesem Exposé beziehungsweise der Immobilienbroschüre zielte der Schwerpunkt der Kommunikation und Gestaltung auf gewerbliche Interessenten, die moderne Lagerfläche im nahen Umfeld des Flughafens suchten. Die Lagerfläche wurde schneller vermietet, als geplant und vor der Baufertigstellung. Die einfachen 3D-Visualisierungen sind vom Architekturbüro gestellt worden. Wenn Sie realitätsnahe Darstellungen von unserer Werbeagentur wünschen, dann klicken Sie hier: ##t1__interner_link_im_Text@@117|3D-Visualisierungen##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
