INSERT INTO `content` VALUES('2168', '124', '0', '0', '', 't2__subheadline@@Personal-Broschüren##t2__fliesstext@@ÜBERARBEITEN\r\n\r\nDie Personal-Broschüre ist erst einmal ein Stück Papier, eine mediale Print-Umsetzung. Vor allem steht, dass das Unternehmen selbst interessante Angebote macht. Dies liegt nicht nur allein am Geld. Flexibilität, soziale Unterstützung, gelebtes Betriebsklima oder andere interessante Aspekte helfen, Entscheidungen für Ihr Unternehmen zu treffen, neue MitarbeiterInnen zu gewinnen und alte MitarbeiterInnen zu halten.\r\n\r\nHier sind Flexibilität, soziale Unterstützung, gelebtes Betriebsklima oder andere interessante Aspekte helfen, Entscheidungen für Ihr Unternehmen zu treffen, neue MitarbeiterInnen zu gewinnen und alte MitarbeiterInnen zu halten.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
