INSERT INTO `content` VALUES('2174', '294', '0', '0', '', 't2__subheadline@@Technische Broschüren für den Maschinen- und Anlagenbau##t2__fliesstext@@Bei diesem Beispiel wurde ein Relaunch des Unternehmensauftrittes durchgeführt und auch die technischen Produkt-Broschüren entsprechend überarbeitet. Neben einer hochwertigen und einheitlichen Darstellung der Produkte über 3D-Visualisierungen, wurde für Linienzeichnungen und Tabellen ein klares, strukturierendes Gestaltungsraster entwickelt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '9', '', '', '', '', '0', '0', '', '0');
