INSERT INTO `content` VALUES('2179', '233', '0', '0', '', 't1__subheadline@@Full Service unserer Werbeagentur für öffentliche Einrichtungen und Ministerien##t1__aufzaehlung_dots@@Beratung in allen Kommunikations- und Produktionsfragen\r\nKonzeption und Gestaltung\r\nKoordination zwischen den Partnern\r\nFarb-, Typografie und Bildkonzeption\r\nFotoerstellung oder Stock-Bild suche\r\nTexterstellung und Lektorat\r\nSlogan- und Sublineentwicklung\r\nErstellung von Illustrationen und Grafiken\r\nReinzeichnung\r\nBetreuung von Konfektionierung, Produktion und Versendung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
