INSERT INTO `content` VALUES('2183', '162', '0', '0', '', 't1__fliesstext@@Janus-Broschüren erfordern Kenntnisse im Fremdsprachensatz und entsprechende Vorbereitungen für die Produktion. Als Werbeagentur liefern wir Ihnen die komplette gestalterische und technische Umsetzung. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '16', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2184', '199', '0', '0', '', 't1__subheadline@@Firmendarstellung für ein Startup##t1__fliesstext@@Bei diesem Kunden handelt es sich um eine deutsch-chinesische Unternehmensgründung, die Kleinhelikopter in Deutschland herstellen. Zu Beginn gab es wenig geeignetes Bildmaterial von den Produkten, dem betriebseigenen Flughafen, kein Logo und keine Corporate Design Vorgaben.   \r\nAls Werbeagentur kreierten wir das Logo des Unternehmens und realisierten die ersten Werbemittel, wie eine Broschüre. Hierfür entwickelten wir Bilddarstellungen der Produkte und des Flughafengebäudes über 3D Visualisierungen und Bildbearbeitungen. Mehr zum Thema finden Sie auch unter:##t1__interner_link_im_Text@@49|3D Visualisierungen und Rendering##t1__umbruch@@umbruch##t1__subheadline@@Fremdsprachensatz##t1__fliesstext@@Unsere Werbeagentur liefert Ihnen auch den Fremdsprachensatz in nicht romanischen Sprachen. In diesem Fall ist die Broschüre in deutsch und chinesisch umgesetzt worden.##t1__subheadline@@Leistungen unserer Werbeagentur:##t1__aufzaehlung_dots@@Beratung für die Positionierung und Umsetzung\r\nKonzept, Gestaltung, Reinzeichnung\r\nBildrecherche, 3D Visualisierung oder Fotoshooting\r\nTexterstellung und Übersetzung\r\nSatz und Fremdsprachensatz\r\nDruckerstellung und Versand\r\nKurz: Full Service für Ihren Unternehmensauftritt##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2185', '22', '0', '0', '', 't2__subheadline@@Broschüren - Ein wichtiges Mittel der Kommunikation, Werbung und Information##t2__fliesstext@@Auch wenn vor Jahren, als die digitale Welt Einzug hielt, viele den Untergang der Printmedien prophezeiten, wird heute klar: Printmedien sind und bleiben ein wichtiger Teil der Kommunikation und Werbung. Je näher man dem Menschen kommt, werden haptische, bleibende und persönliche Erlebnisse immer wichtiger. Dazu gehört die Broschüre, die in Ihrer vielfältigen Umsetzungsform als \"Handreichung\" fungiert.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '18', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2186', '295', '0', '0', '', 't3__headline@@Entsorgung - Der Abfallkalender##t3__subheadline@@Kommunale und privatwirtschaftliche Abfallkalender##t3__fliesstext@@Immer mehr Unternehmen nutzen den, meist jährlichen, Abfallkalender zur Öffentlichkeitsarbeit. Das ist auch notwendig. Eine gute Entsorgung hängt auch stark davon ab, wie gut die Kunden informiert sind und den Ablauf unterstützen. Fragen zur Mülltrennung, den unterschiedlichen Fraktionen oder Aktivitäten des Unternehmens lassen sich mit dem Abfallkalender in jeden Haushalt transportieren. In diesem Fall sogar in mehreren Sprachen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
