INSERT INTO `content` VALUES('2194', '64', '0', '0', '', 't1__bild@@1535##t1__interner_link_@@295|Entsorung Umweltdienste Abfallkalender##t2__subheadline@@Entsorgung / Umweltdienste: Kommunale und privatwirtschaftliche Abfallkalender##t2__fliesstext@@Der Abfallkalender ist ein Thema für jede Stadt bzw. jeden Kreis. Die unterschiedlichsten Fraktionen, ob Wertstoff oder Restabfall wollen sortiert abgeholt werden und der Bürger muss seinen Teil dazu leisten. Wir erstellen Abfallkalender in unterschiedlichen Sprachen, gestalten verständliche Termintabellen, sorgen für eine ansprechende Gestaltung und nutzen Abfallkalender auch für die Öffentlichkeitsarbeit.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
