INSERT INTO `content` VALUES('2196', '23', '0', '0', '', 't1__subheadline@@Leistungen als Corporate Design Agentur:##t1__aufzaehlung_dots@@Beratung und Strategieentwicklung\r\nKonzeption\r\nDefinition der Corporate-Design Parameter\r\nGestaltung und Umsetzung\r\nErstellung von Corporate Design Manuals bzw. Styleguides\r\nKontinuierliche Pflege\r\nSchulung und Betreuung bei der Einführung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2197', '23', '0', '0', '', 't1__subheadline@@Corporate Design für Kleinunternehmen##t1__fliesstext@@Sie sind Einzelkämpfer beziehungsweise haben ein kleines Unternehmen, das auf den Markt will? Sie brauchen eine Beratung? Wir erstellen die Idee, die Sie für Ihren Markt benötigen und achten bei weiteren Umsetzungen darauf, dass Ihr Auftritt und Ihre Werbung immer eine Einheit darstellt. Schritt für Schritt. Satz für Satz. Grafik für Grafik. Das ist für Kleinunternehmen und Unternehmensgründer wichtig.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '11', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2379', '23', '0', '0', '', 't1__subheadline@@Corporate Design für mittelständische Unternehmen##t1__fliesstext@@Für die Entwicklung bzw. Konzeption sind wir für den Mittelstand als Berater der optimalen Partner, wenn es um die Neugestaltung und Überarbeitung / Relaunch Ihres CD`s geht. Mit einem festen Stamm an professionellen Mitarbeitern gewährleisten wir die Umsetzung von umfangreiche Aufgaben und bleiben bezahlbar.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2380', '23', '0', '0', '', 't1__subheadline@@Corporate Design für Großunternehmen##t1__fliesstext@@Für Großunternehmen sind wir Ansprechpartner für eine durchdachte Designstrategie, deren Umsetzung, für die  Pflege und Fortführung des CI´s für Print- und Onlinemedien, Erstellung neuer Verpackungslinien und der Markenbildung (Branding).##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '13', '', '', '', '', '0', '0', '', '0');
