INSERT INTO `content` VALUES('2202', '297', '0', '0', '', 't3__headline@@Markenentwicklung im Extremsport-Bereich##t3__subheadline@@Von der Make zum Markenumfeld##t3__fliesstext@@Als Werbeagentur gestalten wir nicht nur innovative Verpackungen, sondern entwickeln Marken und realisieren das gesamte Produktumfeld für Online- und Printmedien. Dieses Beispiel zeigt die Markenentwicklung, eine Neuentwicklung der Verpackungen und die Umsetzungen für Kataloge und Internetseiten. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
