INSERT INTO `content` VALUES('2210', '79', '0', '0', '', 't1__bild@@1540##t1__subheadline@@Markenentwicklung für den Extremsport-Bereich##t1__fliesstext@@Extremsportarten finden in der Regel Outdoor statt und zeichnen sich durch teilweise besonderes und spezielles Equipment aus. Für Ausstattungsgegenstände aus Titan wurde eine Marke und das entsprechende Werbeumfeld von unserer Werbeagentur entwickelt.##t1__interner_link_@@297|Outdoor Freizeit Sport Equipment Extremsportn##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2211', '77', '0', '0', '', 't1__bild@@1547##t1__subheadline@@Maschinenbau  - Anlagenbau: 3D Visualisierung / Rendering##t2__fliesstext@@Für den Maschinenbau und Anlagenbau sind fotorealistische Darstellungen ihrer Produkte wichtig. Was aber, wenn das Produkt noch nicht existiert oder bereits so verbaut ist, dass man es nicht mehr fotografieren kann? Oder Sie Ihr Produkt darstellen wollen, aber keine relevanten technischen Details preisgeben wollen?\r\nWir erstellen Ihnen 3D-Visualisierungen, die Sie von einem Foto kaum unterscheiden können, aber nach Ihren Vorgaben.##t1__interner_link_@@116|Maschinenbau Anlagenbau 3D Visualisierung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
