INSERT INTO `content` VALUES('2222', '65', '0', '0', '', 't1__bild@@1552##t1__subheadline@@Full Service als Werbeagentur für Erneuerbare Energien##t1__fliesstext@@Für eine Personalvermittlung, die sich auf die Vermittlung von Fachpersonal zum Thema Erneuerbare Energien spezialisiert hat, wurde der gesamte Unternehmensauftritt entwickelt.##t1__interner_link_@@298|Werbeagentur Erneuerbare Energien##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2224', '299', '0', '0', '', 't3__headline@@XXL-Banner / Großbanner für die Außenwerbung##t3__subheadline@@Großbanner in der Außenwerbung - Endlich mal richtig groß rauskommen.##t3__fliesstext@@Für die Gestaltung eines Großbanners ist eine Vorstellungskraft über die Fernwirkung notwendig und die Erfahrung, welche Materialien für die jeweiligen Flächen geeignet sind. Während klassische Banner wegen der Abwaschbarkeit und Brillanz meist aus PVC-Folien produziert werden, bestehen XXL-Banner oft aus einem Textil- oder Kunststoffgewebe (Mesh), da diese Flächen wegen der hohen Windlast möglichst durchlässig sein sollten. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
