INSERT INTO `content` VALUES('2233', '40', '0', '0', '', 't1__bild@@1565##t1__subheadline@@Contao (früher Typo Light)##t1__fliesstext@@Durch rechtliche Auseinandersetzungen mit Typo 3 musste sich Typo light in Contao umbenennen. Seit einigen Jahren nutzen wir dieses deutsche Open-Source-System für die Bearbeitung und Pflege von redaktionellen Inhalten.  Der modulare Aufbau des Systems ist immens und auch hier kümmern sich viele Programmierer um die Weiterentwicklung und somit wächst das CMS mit den Bedürfnissen. Besonderer Vorteil ist, dass es vollständig CSS-gestützt arbeitet, wodurch keine systembedingten gestalterische Grenzen gesetzt werden. Dies ist für die Alleinstellung von Websites immer wichtiger, um sich von Mitanbietern abzugrenzen. Contao ist zudem auch vollständig barrierefrei, wodurch sich die Bedienbarkeit einer Website an Bedürfnisse von Behinderten anpassen lässt. Dieses CMS hat aus diesem Grund für uns ein \"Sternchen\" verdient. Die Bedienung ist verständlich und ... alles geht!  ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2230', '126', '0', '0', '', 't1__bild@@1563##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
