INSERT INTO `content` VALUES('2234', '40', '0', '0', '', 't1__bild@@1569##t1__subheadline@@Typo 3##t1__fliesstext@@Typo 3 - Jeder will den Marktführer, weiß aber nicht, was damit auf ihn zukommt.\r\nVor allem in Zentraleuropa also auch in Deutschland ein sehr beliebtes Content-Management-System. Mit Typo 3 lassen sich dynamische Webseiten erstellen. Typo 3 ist ein freies PHP-gestützte Open Source Programm und es ist wirklich viel machbar. Allerdings.... \r\n\r\nUm Typo 3 einzurichten benötigt man Spezialisten die sich mit dem Programm gut auskennen und TypoScript (eine eigene, Typo 3 spezifische Sprache) beherrschen. Es ist viel Arbeit und Zeit zu investieren. Typo 3 ist mächtig, lässt sich mittels Extentions deutlich erweitern und die meisten Entwickler \"schielen\" auf dieses System und erweitern dann eigene Systeme auf dessen Basis. Zu recht verlangen Typo 3 Programmierer in der Regel 25% mehr als andere Programmierer. Mit Typo 3 lassen sich nicht nur Shop-Systeme, Foren und Newsletter einrichten, sondern vieles mehr. Für 85% unserer Kunden ist allerdings Typo 3 als Content Management System mit \"Kanonen auf Spatzen geschossen\"\r\n\r\nWas spricht dagegen?\r\n\r\nWenn Sie das Geld investieren wollen, aus technischer Sicht grundsätzlich nichts! Viele bezahlen den Preis, im Glauben, in ein System zu investieren, was für die Ewigkeit geschaffen und kleineren Content Management Systemen überlegen ist. Doch eine Internetseite ist kein Buch mit festgelegten Seiten, Bildern und Texten. Zukunftsorientierte Erweiterungsfähigkeit ist wichtig, aktuelle Bedienbarkeit des Systems allerdings auch. Haben Sie viele und häufig wechselnde Zugriffsrechte, dann ist Typo 3 recht gut. Die Einlernzeit ist allerdings bei Typo 3 hoch und somit auch kostspielig und die Anforderungen entsprechend komplex.\r\n\r\nAnmerkung: Kein Medium bewegt sich schneller als das Internet. Neben der kontinuierlichen Erweiterung einer Website bewegt sich auch die Entwicklung von CMS weiter. Ihre Daten sind in Datenbanken gespeichert, die mit überschaubarem Aufwand... manchmal noch mit großem Aufwand in andere Systeme transportieren lassen. Verloren sind sie nicht! Damit Sie Typo3 nutzen können, müssen Sie in jedem Fall einen PHP-fähigen Server, wie Apache HTTP Server, PHP sowie MySQL installiert haben. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2235', '40', '0', '0', '', 't1__bild@@1568##t1__subheadline@@Morpheus##t1__fliesstext@@Morpheus wurde in Kooperation mit unserer Agentur im Bezug auf die Bedienerfreundlichkeit optimiert. Auch dieses CMS ist Open Source, aber wenig bekannt. Dennoch verwenden 45% unserer Kunden Morpheus. Wir empfehlen es allen Unternehmen, die wenig Zeit für die Pflege (Kleinunternehmen) oder ständig wechselndes Personal haben, die die Website pflegen sollen und neu angelernt werden müssen. \r\nBesonderes Alleinstellungsmerkmal (USP): Selten gehen die Einführungsschulungen über eine Stunde hinaus und der \"Videorecordereffekt\" (Wie war das noch mal?...nach ein paar Wochen) bleibt aus. Morpheus ist nicht mit \"Kanonen auf Spatzen geschossen\" sondern sehr zieloptimiert. \r\nAls Agentur war uns aber nicht nur die Bedienerfreundlichkeit wichtig, sondern auch die Möglichkeit, mit Morpheus eine direkte Umsetzungsmöglichkeit für die Suchmaschinenoptimierung / SEO zu haben. Wir selbst arbeiten mit diesem System...sehr erfolgreich! Auch als OnPage - Spezialisten. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2236', '40', '0', '0', '', 't1__bild@@1566##t1__subheadline@@Drupal##t1__fliesstext@@Drupal ist das wahrscheinlich zweitgrößte CMS System. In Deutschland aber deutlich weniger populär als Typo 3 oder Joomla. Dieses CMS wird für Multi-User Plattformen häufig verwendet, da es dafür recht gut ausgerichtet ist. Wie bei WordPress existiert hier eine große Entwicklerschar die ständig für Erweiterungen sorgen. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2238', '40', '0', '0', '', 't1__bild@@1567##t1__subheadline@@Joomla##t1__fliesstext@@Mit dem sehr bekannten Open-Source-Programm Joomla - früher Mambo - können Sie wesentlich einfacher als bei Typo 3 Webseiten, Online-Shops und viele andere Internet-Angebote erstellen bzw. erstellen lassen. Und auch hier wieder das ...aber....\r\n\r\nWir selbst haben mit Mambo angefangen. In den letzen Jahren gab es aber erhebliche Probleme mit der Sicherheit. Dies mag sich in Zukunft lösen, momentan empfehlen wir es unseren Kunden nicht. Wichtig: Ohne MySQL, PHP und Apache-Server geht es nichts. Einmal eingerichtet funktioniert Joomla ohne Probleme.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2237', '40', '0', '0', '', 't1__bild@@1570##t1__subheadline@@WordPress##t1__fliesstext@@Das Gegenstück zu Typo 3. Wordpress ist sehr bekannt und, was wenige wissen, auch ein CMS System. Allerdings startete WordPress als Blog Script, wandelte sich aber in Laufe der Zeit zu einem echten CMS System. Mit einer großen Entwicklerschar, die das CMS System vorrantreibt. Anders als alle anderen Content Management Systeme gibt es viele vorgefertigte Module die man sich auch ohne Programmierkenntnisse einrichten kann. Natürlich gibt es auch das ...aber...\r\n\r\nBis jetzt ist es einfach, weil es viele vorgefertigte Möglichkeiten gibt, die man anwenden kann. Aber vorgefertigte Auswahlmöglichkeiten sind nichts für Unternehmensinteressen. Dies wird aber mit jeder Entwicklertätigkeit sich ändern und somit auch immer komplexer.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
