INSERT INTO `content` VALUES('2246', '39', '0', '0', '', 't1__bild@@1574##t1__interner_link_@@300|Newsletter - Arbeitsvermittlung##t1__subheadline@@Newsletter für öffentliche Projekte##t1__fliesstext@@Newsletter für öffentliche Projekte wie zum Beispiel für den Bereich Arbeitsvermittlung sollen vor allem die Öffentlichkeit über den Stand des Projektes informieren. Versendet als Online-Newsletter, als Auslage in Druckversion oder als pdf-Download über eine Website.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
