INSERT INTO `content` VALUES('2250', '302', '0', '0', '', 't3__headline@@Arbeitsvermittlung - Chance 50##t3__subheadline@@Die Arbeitsvermittlung von über 50-Jährigen - Einige Jahre und ein kompletter Wandel##t3__fliesstext@@Die Bundesregierung hat vor einigen Jahren das Projekt \"Chance 50\" gestartet, weil es immer problematischer wurde, ältere Arbeitssuchend zu vermitteln. Nun spricht man von Arbeitskräftemangel, Verlust der Kompetenzen und von einer Erhöhung des Renteneinstiegsalters. Als Werbeagentur begleiteten wir dieses Programm unter externer Evaluierung durch das Fraunhofer-Institut, ausgerechnet mit dem Standort in Offenbach und Umland, einer der Brennpunkte oder Problempunkte im Bundesgebiet. Jeder Part dieses Arbeitsvermittlungsprojekte wurde bewertet. Unsere Werbeagentur bekam für die Arbeit Bestnoten. Wir sind stolz darauf.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
