INSERT INTO `content` VALUES('2260', '58', '0', '0', '', 't1__bild@@1576##t1__interner_link_@@302|Arbeitsvermittlung Jobvermittlung Über 50##t1__subheadline@@Arbeitsvermittlung für Menschen über 50##t1__fliesstext@@Chance 50 ist ein Projekt der Bundesregierung, dass schon seit einigen Jahren läuft. Dieses Projekt wurde extern von Fraunhofer Institut evaluiert und unsere Werbeagentur hat für die komplette Projektbetreuung- und -umsetzung Bestnoten bekommen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2261', '39', '0', '0', '', 't1__bild@@1583##t1__subheadline@@Mitarbeiter-Newsletter oder -zeitung##t1__fliesstext@@Newsletter für Mitarbeiter finden Ihren Einsatz bei größeren Unternehmen und Einrichtungen. Betriebsinterne Nachrichten werden auf diesem Wege an das Personal weitergegeben. Mitarbeiter-Newsletter dienen zur besseren internen Kommunikation, höherer Identifikation und fördern das allgemeine Verständnis für Projekte und Maßnahmen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2262', '303', '0', '0', '', 't3__headline@@Besondere Hinweisschilder##t3__subheadline@@Besondere Hinweisschilder für Sehenswürdigkeiten, Wochenmärkte oder Veranstaltungen##t3__fliesstext@@Sich, in kürzeren Zeitanständen, wiederholende Veranstaltungen, interessante Sehenswürdigkeiten für Touristen oder Wochenmärkte sind wichtige Events für Bürger und eine Einnahmequellen für Städte und Kommunen. Entgegen temporärer Veranstaltungen, die mit Plakaten und Bannern beworben werden, übernehmen hier fest stationierte und gestaltete Schilder die Information über das Ereignis. Im einfachen Fall als Leitsystem, um den entsprechenden Ort zu finden, oder die entsprechenden Termine anzukündigen. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
