INSERT INTO `content` VALUES('2266', '43', '0', '0', '', 't1__bild@@1591##t2__umbruch@@umbruch##t1__subheadline@@Besondere Hinweisschilder##t1__fliesstext@@Veranstaltungen, Touristik-Leitsysteme, Märkte oder besondere Hinweisschilder für lokale Sehenswürdigkeiten benötigen ganzheitliche Konzepte und Gestaltungslösungen. Natürlich sind wir als Werbeagentur auch für Produktion und Montage Ihr Ansprechpartner.##t2__interner_link_@@303|Schilder Aussenwerbung Wochenmarkt##t2__umbruch@@umbruch##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2267', '304', '0', '0', '', 't3__headline@@Fahrzeugbeschriftung bei Nutzfahrzeugen##t3__subheadline@@Ob Laster, Kran oder Entsorgungsfahrzeug - Fahrzeugbeschriftung auf Nutzfahrzeugen lohnt sich##t3__fliesstext@@Fahrzeugbeschriftungen auf Nutzfahrzeuge können für das Unternehmen oder die Leistungen werben. In diesem Fall wurde die Fahrzeugflotte dazu genutzt, das vielseitige Angebot des Unternehmens einer breiten, lokalen Öffentlichkeit zu kommunizieren. Jedoch lassen sich Nutzfahrzeuge oft mit direkt beschriften. Es fehlt an homogenen Flächen. Aus diesem Grund werden hier Trägersysteme entwickelt, die auf das jeweilige Fahrzeug abgestimmt sind.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
