INSERT INTO `content` VALUES('2277', '37', '0', '0', '', 't1__bild@@1599##t1__subheadline@@Messestand-Gestaltung: \r\nRoll-up und Fahnen##t1__fliesstext@@Roll-up`s und Fahnen sind wohl die günstigste und mobilste Art der Messestand-Gestaltung. Kleine Packmaße, günstiger Preis und eine beliebige Erweiterbarkeit sprechen für Roll-up`s und Fahnen. Roll-up`s gibt es in unterschiedlichen Breiten und Höhen und sind selbststehend. Fahnen haben bei der Gestaltung eines Messestandes den Vorteil, dass man sie auch (sofern es Befestigungsmöglichkeiten gibt) über den Stand hängen kann. Dies erhöht die Fernwirkung und hilft im Messetrubel bei der Orientierung. Beide Produkte können mehrfach eingesetzt werden.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
