INSERT INTO `content` VALUES('2278', '37', '0', '0', '', 't1__bild@@1600##t1__subheadline@@Mobile, faltbare Messewände##t1__fliesstext@@Mobile, faltbare Messewände gibt es in unterschiedlichen Größen und Systemausführungen. In Verbindung mit Roll-up´s und faltbaren Theken sind sie die einfache Form, einen mobilen Messestand zu realisieren. Mit wenigen Handgriffen aufbaubar und in Trolleys oder Taschen transportierbar.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2279', '305', '0', '0', '', 't3__headline@@Hessische Landjugend - Ausstattung für Veranstaltungen##t3__subheadline@@Mobile, flexible Informationsträger für die Hessische Landjugend##t3__fliesstext@@Die Hessische Landjugend brauchte für ihre unterschiedlichen Veranstaltungen eine möglichst flexible und preisgünstiges Ausstattungssystem. Es wurde über leichte, gut zu transportierende Roll-ups, Faltwände und Counter gelöst. Dabei sind Counter und Faltwand mit themenübergreifenden Motiven und Slogans ausgestattet, um sie universell einsetzen zu können, während die Roll-ups mit themenspezifischen Motiven wie zum Beispiel Volkstanz, Bildung, Junglandwirte und Jugendpolitik ausgestaltet sind.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
