INSERT INTO `content` VALUES('2287', '72', '0', '0', '', 't1__bild@@1601##t2__subheadline@@Veranstaltungsausstattung für die Hessische Landjugend##t2__fliesstext@@Die Hessische Landjugend benötigte für ihre unterschiedlichen Veranstaltungen eine möglichst flexible Ausstattung. Es wurde über günstige und mobile Roll-ups, Faltwände und Counter gelöst.##t2__interner_link_@@305|Jugend Hessische Landjugend##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
