INSERT INTO `content` VALUES('2301', '306', '0', '0', '', 't3__headline@@Immobilien Vermarktung Exposé Denkmalschutz##t3__subheadline@@Immobilien Vermarktung Exposé Denkmalschutz##t3__fliesstext@@Das Exposé ist das zentrale Kommunikationsmittel für die Vermarktung einer Immobilie. Gut strukturierte Inhalte und eine individuelle wie professionell Gestaltung ist Grundvoraussetzung, damit die Vermarktung eine Erfolg wird.\r\nEin gutes Immobilienexposé ist eine Symbiose aus ansprechenden Design, klarer und verständlicher Faktenvermittlung und emotionaler Ansprache. Das Exposé ist bei vielen Immobilienprojekten oft lange Zeit das einzige, an dem sich der Kunde halten kann. Das ihn neugierig macht oder ihm Sicherheit gibt. Entsprechend sollte die Umsetzung sein, ohne einen völlig überzogenen Eindruck zu hinterlassen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
