INSERT INTO `content` VALUES('2309', '70', '0', '0', '', 't1__bild@@1616##t1__subheadline@@Das Exposé für die Vermarktung##t1__interner_link_@@306|Immobilien Vermarktung Exposé Denkmalschutz##t1__fliesstext@@Die Vermarktung einer Immobilie, ob Neubau oder Altbau mit Denkmalschutz benötigt immer ein Exposé. Wir liefern Ihnen die Gestaltung und Umsetzung aller Bestandteile, die Sie benötigen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2310', '307', '0', '0', '', 't3__headline@@Veranstaltungskalender für das Jugendzentrum / JuZ##t3__subheadline@@Der  Jugendarbeit eine Übersicht verschaffen##t3__fliesstext@@Für die unterschiedlichen Veranstaltungsangebote des  Jugendzentrum / JuZ gestalteten wir eine praktische Registerbroschüre mit den aktuellen Angeboten des JuZ.\r\nDie Register erlauben dabei einen schnellen Zugriff auf das jeweils interessante Thema. Die Registerbroschüre wurde so gestaltet, dass im aufgeklappten Zustand die kompletten gegenüberliegenden Seiten für einen Veranstaltungshinweis genutzt werden können.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
