INSERT INTO `content` VALUES('2319', '72', '0', '0', '', 't1__bild@@1622##t2__subheadline@@Jugendarbeit im Jugendhaus / Jugendzentrum##t2__fliesstext@@Im Jugendhaus gibt es einige interessante Angebote für Jugendliche. Unsere Aufgabe war es, einen jugendgerechten Übersichtsplan über alle Angebote zu erstellen.##t2__interner_link_@@307|Jugend Jugendhaus Jugendarbeit##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2321', '108', '0', '0', '', 't2__subheadline@@Die zielgruppengerechte Ansprache##t2__fliesstext@@Nicht jeder versteht, was Sie kommunizieren wollen! Was denkt ein Unternehmer, eine Agentur, was ein Einkäufer? Wie sprechen Schüler und wie Menschen in der zweiten Lebenshälfte?##t2__subheadline@@Die Kernaussage##t2__fliesstext@@Gerne bietet man im Werbetext alles und verliert alles! Was genau wird angeboten? Vieles, aber welches Argument fesselt und regt zum Weiterlesen an? Dies hat für einen professionellen Werbetexter zentrale Bedeutung.##t2__subheadline@@Die Konzeption##t2__fliesstext@@Nicht immer müssen alle Details auf den Weg gebracht werden. Wie wird also eine gute Informationsstruktur aufgebaut, damit das Wichtigste zuerst gesagt wird, das Wesentliche dazwischen und was fällt dann unter das \"Kleingedruckte\" oder ganz weg?##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2320', '108', '0', '0', '', 't2__subheadline@@Das Hinterfragen##t2__fliesstext@@Das Wissen um Eigenbild und Fremdbild vermeidet Fehlinvestitionen. Häufig führt Nähe zur \"Betriebsblindheit\" und dann zu Unstimmigkeiten in den Aussagen. Wer kann das mit genügend Abstand hinterfragen und auf Schwächen hinweisen?##t2__subheadline@@Die Recherche##t2__fliesstext@@Die Konkurrenz schläft nicht. Ein professioneller Texter auch nicht! Wie sagen es eigentlich die anderen? Beim Werbetext geht aber nicht um das Kopieren, als um die Identifizierung von Stärken und Alleinstellungsmerkmalen.##t2__subheadline@@Die Passgenauigkeit##t2__fliesstext@@Texte für Werbung, wie für Anzeigen oder für die Suchmaschinenoptimierung. Bestimmt nicht auch das ausgewählte Medium die Menge an Informationen? Natürlich und dafür bedarf es das Händchen des Werbetexters, um für den vorhandenen Raum den optimalen Werbetext zu entwickeln.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2323', '108', '0', '0', '', 't1__bild@@1629##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2324', '108', '0', '0', '', 't2__subheadline@@Werbetext hat Ziele!##t2__fliesstext@@Natürlich geht es immer um die Vermarktung eines Produktes oder einer Leistung. Aber muss es dann auch immer wieder attraktiv, formschön, leistungsstark, brandneu ... sein? Sind die gängigen Standardformulierungen und Klischeebilder bekannt, dann können sie gekonnt umschifft werden.\r\n##t1__fliesstext@@So, wir können Texten.\r\nSprechen Sie unsere Agentur für Ihren Werbetext an!##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2322', '108', '0', '0', '', 't2__bild@@1631##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2333', '125', '0', '0', '', 't1__subheadline@@Werbeagentur-Beispiel: Accessories##t1__fliesstext@@Dieses speziell für unseren Auftraggeber entwickelte Display aus Metall gibt es in drei Ausführungen: als Thekendisplay - Einsteigerversion mit der geringsten Befüllmenge, als Thekenrondell mit einer deutlich höheren Stückzahl-Ausstattung und als bewegliches Boden-Standdiplay mit Rollen. Wie man anhand des Beispiels gut sehen kann, lässt sich das Display mit den entsprechenden Seiten- und Kopfeinschüben schnell verwandeln. Es entsteht ein völlig anderer Markentransfer mit ein und demselben Display.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2334', '283', '0', '0', '', 't1__subheadline@@Werbeagentur-Beispiel: Disney und Parfüm##t1__fliesstext@@Disney und Parfüm? Dieses Parfüm wird ausschließlich in Asien als Merchandising-Produkt vertrieben. Wie Playboy oder andere bekannte Marken werden unter den entsprechenden Labels auch Parfüm und Pflegeprodukte positioniert. Die Basis des Displays ist aus Recyclinggründen reine Kartonage ohne Gold- oder Silberaufträge. Das Steckdisplay für die Rückseite wird auch als Hängedisplay verwendet.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2335', '26', '781', '0', '', '', '1', '1', '', '', '', '', '1', '0', '0', '0', '0', '1', '11', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2336', '142', '0', '0', '', 't3__headline@@Flyer mit Zeckenkarte.##t3__subheadline@@Flyer mit Zusatznutzen. Die Zeckenkarte.##t3__fliesstext@@Vor allem für Eltern ist es wichtig, ihre Kinder in den entsprechenden Jahreszeiten, je nach Schwerpunktgebieten, nach Zecken zu untersuchen. Findet man tatsächlich Zecken, ist immer wieder die Frage, wie entferne ich sie sachgerecht. Diesem Flyer wurde eine Zeckenkarte aus Kunststoff beigefügt, die eine einfache und sachgerechte Entfernung der Zecken ermöglicht. Als Werbeagentur statten wir Flyer immer wieder mit zusätzlichen Produkten aus. Produktproben, praktische Hilfen oder Service-Karten. Das Produkt sollte nur flach genug sein, dass eine problemlose Konfektionierung möglich ist.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2338', '149', '0', '0', '', 't1__subheadline@@Flyer für Didaktik und Aufklärung##t1__fliesstext@@Flyer für Didaktik und Aufklärung. Beispiels: Verkehrserziehung. Es ist nicht selbstverständlich, dass eine Werbeagentur auch in diesem Bereich tätig ist. Wir schon immer!\r\nLife-Stile, Marken und Produkte haben auch bei Kindern Einzug gehalten und die Kommunikation über eigentlich wichtige Dinge tritt dagegen oft in den Hintergrund. Wir sind als Werbeagentur Ansprechpartner für Städte, Kommunen und öffentliche Einrichtungen und jedem, die Basisarbeit leisten will.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2339', '160', '0', '0', '', 't1__subheadline@@Mit \"The gold of ....einen neuen, innovativen  Weg beschreiten##t1__fliesstext@@Als Werbeagentur hätten wir hier im Flyer Packungen, Fertigungsverfahren oder glückliche Konsumer zeigen können. Wie die Mitanbieter auch. Uns schwebte ein neuer Weg vor. Warum nicht die Soßen, Fonds und Demi-Glases selbst sprechen bzw, schreiben lassen. Alle Visualisierungen sind mit den entsprechenden Produkten geschrieben und katapultieren sich dadurch aus der Masse.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2340', '214', '0', '0', '', 't1__subheadline@@Flyer für Erzieher und gegen den Notstand##t1__fliesstext@@Der hier vorgestellte Flyer hat eine Kreuzfaltung, die relativ selten ist. Er richtet sich an Schüler, die noch nicht wissen, welchen beruflichen Weg sie einmal einschlagen wollen. Es ist ein bewusst machendes Angebot, um Jugendliche auf diesen Weg aufmerksam zu machen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2341', '214', '0', '0', '', 't1__subheadline@@Kreuzfalz##t1__fliesstext@@Beim Kreuzfalz wird der Druckbogen mehrfach im rechten Winkel gefalzt. Dieses Verfahren findet nicht nur bei Flyern sondern auch bei der Herstellung von Broschüren oder Zeitschriften ihre Anwendung. Dabei ist es wichtig, dass die Laufrichtung des Papiers mit dem letzten Falz parallel läuft.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2345', '44', '0', '0', '', 't2__bild@@1641##t2__subheadline@@Versandverpackungen##t1__fliesstext@@Apple hat es vorgemacht. Versandverpackungen können auch Produktverpackung sein und einen Zusatznutzen haben. Bedruckte, individuelle Versandverpackungen, ein starkes und zu wenig beachtetes Marketing-Instrument für die Markenbildung über Verpackungen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2346', '227', '0', '0', '', 't1__subheadline@@Flyer für Vorträge##t1__fliesstext@@Flyer und Plakate gehören zur Standardausstattung einer jeden Veranstaltung. In diesem Beispiel ist es eine Vortragsreihe zum Thema: Klimawandel.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2347', '234', '0', '0', '', 't1__subheadline@@Leporello##t1__fliesstext@@Mehrseitige Flyer mit hohem Informationsgehalt werden in der Regel mit einem Zick-Zack-Falz ausgestattet, die man deswegen auch Leporello nennt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2349', '234', '0', '0', '', 't1__subheadline@@Der Leporello am Beispiel eines Informationsflyers##t1__fliesstext@@Dieser Flyer besteht aus 6 Seiten und wäre im voll ausgefaltetem Zustand recht unhandlich. Durch den Leporellofalz wird daraus ein handliches Kommunikationsmittel.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2350', '250', '0', '0', '', 't2__subheadline@@Der Einsatz von Testimonials##t2__fliesstext@@Wenn es, wie in diesem Fall, um das Thema Strom sparen geht, kann man mit Testimonials arbeiten. In der Regel werden dazu geeignete Bilder bei den Bildagenturen ausgewählt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2351', '266', '0', '0', '', 't2__subheadline@@Bildmontage aus zwei Bildern##t2__fliesstext@@Bei dieser Bildmontage für den Titel eines Flyers wurden zwei Bilder so miteinander kombiniert, dass ihre Übergänge kaum noch wahrnehmbar sind. Es handelt sich dabei um die Kombination eines Studio-Fotos (Schleife) mit der Aufnahme einer echten Abfalltonne. Die Aufnahme der Tonne wurde zusätzlich bereinigt und verfremdet. Der Bildaufbau und die Qualität des vorhandenen Fotomaterials sind dabei für das Endergebnis von entscheidender Bedeutung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2352', '284', '0', '0', '', 't1__subheadline@@Der klassische Flyer##t1__fliesstext@@Der klassische Flyer besteht eigentlich nicht aus 3 Seiten mit Wickelfalz, sondern ist ein einzelnes Blatt, dass ein- oder zweiseitig bedruckt ist. Allerdings verwendet man in der Umgangssprache das Wort Flyer sehr häufig für Faltblätter.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2353', '29', '0', '0', '', 't1__subheadline@@Werbeagentur Logo-Entwicklung##t1__fliesstext@@Als Werbeagentur entwickeln wir Logos für Unternehmensgründungen oder aktualisieren Ihr, in die Jahre gekommenes, Logo mit Feingefühl und Sachverstand.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '15', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2355', '34', '0', '0', '', 't2__subheadline@@Markenarten##t2__aufzaehlung_dots@@Firmenmarke\r\nProduktmarke\r\nLinienmarke für Produktvarianten\r\nSortimentsmarke für die Umfelddifferenzierung, \r\nHerstellermarke zur Akzeptanzsteigerung von Produkten\r\nHandelsmarke / Labelmarke ebenfalls zur Akzeptanzsteigerung von Produkten\r\nLuxusmarke für hochwertige Produkte\r\nKonzernzeichen / Unternehmensmarke als übergeordnete Marke (brand) verschiedenster Unterbereiche\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '12', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2356', '37', '0', '0', '', 't1__bild@@1644##t1__subheadline@@Messestand-Gestaltung über 3D-Visualisierungen##t1__fliesstext@@Messestände und deren Gestaltung erfolgt heute oft über ##t1__interner_link_im_Text@@49|3D-Visualisierungen##t1__fliesstext@@. Hier bieten wir als Werbeagentur ein breites Spektrum von Umsetzungsmöglichkeiten. Von einfachen Vektorzeichnungen bis zu realitätsnahen Renderings.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '9', '', '', '', '', '0', '0', '', '0');
