INSERT INTO `content` VALUES('2363', '39', '0', '0', '', 't1__bild@@152##t1__subheadline@@Online-Newsletter##t1__fliesstext@@Online-Newsletter sind sehr beliebt, da man sich Druck- und Portokosten sparen kann. Un sie sind das erfolgreichste Werbemedium im Internet. Die Redaktion und Gestaltung von Online-Newsletter ist hier der aufwendigste Teil. Online-Newsletter sind in Ihrer Reichweite allerdings auch deutlich beschränkter als ihre Printversionen. Rechtlich dürfen sie in Deutschland nur mit Einwilligung des Empfängers versendet werden. \r\nDie Versendung Ihre Online-Newsletter sollte hier mit einem Produkt erfolgen, das für den deutschen Markt entwickelt und optimiert wurde und den rechtliche Anforderungen entspricht.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
