INSERT INTO `content` VALUES('2365', '128', '0', '0', '', 't2__subheadline@@Werbeagentur und Gewerbeimmobilien##t2__fliesstext@@Als Full Service Werbeagentur unterstützen wir Sie bei der Vermarktung und Bestandssicherung Ihrer Gewerbeimmobilie. Vom Büro- und Verwaltungshochhaus, Einkaufs- und Shopping-Malls oder Gewerbeparkts. Mehr zum Thema: ##t2__interner_link_im_Text@@70|Immobilien und Vermarktung##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2366', '163', '0', '0', '', 't2__subheadline@@Werbeagentur-Leistungen##t2__fliesstext@@Neben der Konzeption, Gestaltung und Produktion bieten wir für wissenschaftliche Publikationen vor allem auch die Übersetzung, den Fremdsprachensatz und den Vertrieb an. Auf Wunsch stellen wir Ihnen unsere Redaktion zur Verfügung. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2367', '300', '0', '0', '', 't2__subheadline@@Werbeagentur-Leistungen: Gestaltung und Redaktion##t2__aufzaehlung_dots@@Konzeptentwicklung\r\nGestaltung, Satz, Fremdsprachensatz, Reinzeichnung\r\nFoto und Illustrationserstellung und -bearbeitung\r\nTexterstellung und Übersetzung\r\nLektorat \r\nProduktion\r\nLagerung und Versand##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2368', '41', '0', '0', '', 't1__subheadline@@Werbeagentur - Leistungen:##t1__aufzaehlung_dots@@Beratung bei der Ordnerauswahl oder individuellen Neuerstellungen\r\nBeratung bei Sonderanfertigungen wie z.B. Schuber, besondere Materialien oder Druckverfahren\r\nGestaltung, Satz und Reinzeichnung der Ordnerseiten (Außenseiten, Innenseiten und Rücken)\r\nVorbereitung, Betreuung und Abklärung der Produktion\r\nBetreuung der Konfektionierung\r\nVerpackung, Lagerung und Versand\r\n\r\n\r\n\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2370', '42', '781', '0', '', '', '1', '1', '', '', '', '', '1', '0', '0', '0', '0', '1', '14', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2371', '1', '0', '0', '', 't1__bild@@1612##t2__headline@@Webagentur##t1__subheadline@@Gestaltung und Umsetzung Ihrer Website bzw. Internetauftritts##t1__fliesstext@@Konzept fünf ist auch als professionelle Webagentur Ihr Ansprechpartner. Websites, Web-Shops, SEO und deren Anbindungen oder Integrationen an Social Media-Plattformen? Sprechen Sie uns an. \r\nDer Vorteil unserer Webagentur: Wir bieten Umsetzungen nicht nur in einem Content Management Systemen an. Wir wissen, welches System für Sie wirklich geeignet ist und beraten Sie. Ebenso liefern wir Ihnen Sonderprogrammierungen oder SAP-Anbindungen. Welche Aufgabe haben Sie?##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2372', '136', '0', '0', '', 't3__headline@@Mappen-Prospekte##t3__subheadline@@Der Prospekt mit Zusatznutzen##t3__fliesstext@@Mappenprospekte sind aus dickerem Papier oder besitzen zumindest einen festeren Umschlag. Dies ist nötig, um stabile Einstecklaschen für weitere Blätter oder Karten herzustellen oder DVDs zu fixieren. Neben dem Umschlag beinhaltet der Mappen-Prospekt zusätzliche Innenseiten, wie beim klassischen Prospekt. Ab 8 Seiten sollten die Innenseiten des Mappen-Prospekts aus dünnerem Material bestehen, da trotz Nutung die Seiten nicht mehr bündig schließen. Als Werbeagentur bieten wir Ihnen ein breites Spektrum an Umsetzungsmöglichkeiten. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
