INSERT INTO `content` VALUES('2383', '86', '0', '0', '', 't1__bild@@1646##t1__subheadline@@Banner im Indoor-Bereich##t1__fliesstext@@Auch wenn Banner im Indoor-Bereich vor allem als Roll-up oder faltbaren Messewände eingesetzt werden, sind es die gleichen Herstellungsverfahren und Materialien wie für den Außenbereich. Als Materialien kommen vor allem PVC-Folien, Mesh und Textilien zum Einsatz.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2384', '86', '0', '0', '', 't1__bild@@1648##t1__subheadline@@Bauzaun-Verkleidung / Bauzaun-Banner##t1__fliesstext@@Baustellen sind eventuell interessant, schön sind sie in der Regel nicht. Hier werden Bauzaun-Banner zu Verkleidung von Bauzäunen und Fassaden eingesetzt.\r\n##t2__bild@@1647##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2385', '86', '0', '0', '', 't1__subheadline@@Einsatzbereiche von Banner in der Außenwerbung##t1__fliesstext@@Großbanner / XXL-Banner##t1__aufzaehlung_dots@@Großbanner bzw. XXL-Banner werden in der Außenwerbung vor allem für die Immobilienvermarktung, die Ankündigung von Veranstaltungen und für die Werbung von Markenprodukten eingesetzt.\r\nXXL-Banner dienen auch zur Fassadenverkleidung bei Restaurierungen von Gebäuden, um das Endergebnis anzukündigen oder eine unansehnliche Baustelle zu verkleiden.\r\nGroßbanner finden auch Verwendung in der Verkleidung von Bauzäunen. Themenbezogen oder mit freien Motiven.##t1__umbruch@@umbruch##t1__fliesstext@@Klassische Banner\r\n\r\nKlassische Banner werden vor allem als kurzeitiges Werbemittel bei temporären Veranstaltungen oder Anlässen eingesetzt. Schwerpunktbereiche sind hier:##t1__aufzaehlung_dots@@Sportveranstaltungen\r\nKunstausstellungen\r\nJubiläen\r\nRegionale Events\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2386', '88', '0', '0', '', 't1__bild@@1653##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2387', '88', '0', '0', '', 't1__subheadline@@Über den Inhaber##t1__fliesstext@@Nicht üblich, sondern ungewöhnlich. Wolfgang Schwenglers vielseitiges Wissen und Können ist der Grund dafür, dass Konzept fünf mittlerweile seit 25 Jahren kompetenter Ansprechpartner für Unternehmensgründer, mittelständische Unternehmen und internationale Konzerne ist.\r\n\r\nNach abgeschlossener Lehre als Maschinenschlosser und Ausbildung zum Krankenpfleger entdeckte Wolfgang Schwengler seine kreative Seite und wandte sich der Fotografie zu. Mit zwei anderen Fotografen engagierte er sich erfolgreich für die Anerkennung der Fotografie als Bildende Kunst und wurde schließlich auch in den Berufsverband bildender Künstler aufgenommen.\r\n\r\nDiese Richtung verfolgte Wolfgang Schwengler konsequent weiter. Das Abitur holte er auf dem Zweiten Bildungsweg nach und bewarb sich für ein Design-Studium an der Hochschule für Gestaltung in Offenbach. Für ihn sprach die Anerkennung der besonderen künstlerischen Begabung. Und noch während des Studiums gründete er zusammen mit vier Kommilitonen die Designagentur Konzept fünf. Nach dem Abschluss als bester Designer Hessens war die Erweiterung zur Full Service Werbeagentur der nächste logische Schritt. Und der Erfolg gibt ihm Recht.\r\n\r\nDen privaten Wolfgang Schwengler beschreiben Freunde und Mitarbeiter so:\r\nEr ist konziliant, integer, pragmatisch (in gewisser Weise manchmal auch unkonventionell) und verfügt über hohe soziale Empathie. \r\nAnsonsten ist er neugierig auf alles Neue (besonders in der Küche), liebt das Wasser und die Natur, was für einen ehemaligen Wettkampftaucher sicher nichts Ungewöhnliches ist. Und er reist für sein Leben gern in abenteuerliche und abgelegene Gegenden dieser Erde. \r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2388', '88', '0', '0', '', 't1__subheadline@@Über die Agentur##t1__fliesstext@@Konzept fünf wurde 1988 als Designagentur von 5 Studenten (daher die \"fünf\") gegründet. Anfänglich auf die Gestaltung von Produkten ausgerichtet und mit einigen nationalen wie internationalen Designpreisen ausgezeichnet, erweiterte sich das Spektrum des Tätigkeitsfeldes schnell. Produkte brauchen natürlich auch Verpackungen und sollen erfolgreich verkauft werden. \r\nAuch das Branchenportfolio wurde immer breiter. Waren die Schwerpunktbranchen zunächst Automotiv, Maschinenbau und Medizintechnik, kamen schnell Bereiche wie Pharma, Chemie, Food und Immobilien hinzu.\r\n1997 erweiterte Konzept fünf ihr Leistungsspektrum mit der Produktion von digitalen Medien. Das erste Computerspiel für Chesterfield oder die erste 3D-Präsentation der ersten digitalen Kamera für Leica waren nicht nur Meilensteine, sondern auch eine Herausforderung, die schon bei den Rechnerleistungen begann. Mit der Kommerzialisierung des Internets 1999 starten auch Konzept fünf damit, Internetseiten im Auftrag von Kunden zu gestalten und zu programmieren. \r\nNach über 25 Jahren wird klar, warum Konzept fünf nicht nur eine leistungsfähige Full Service Agentur ist, sondern ohne Probleme auch als Webagentur, Grafikagentur oder Kreativagentur angesprochen werden kann.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2389', '88', '0', '0', '', 't2__subheadline@@Konzept fünf und Firmengründungen##t2__fliesstext@@Konzept fünf ist stolz darauf, bis heute weit über 150 Unternehmensgründer erfolgreich in die jeweiligen Märkte mit Rat und Tat begleitet zu haben. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '7', '', '', '', '', '0', '0', '', '0');
