INSERT INTO `content` VALUES('2397', '310', '0', '0', '', 't3__headline@@Kunst-Kataloge##t3__subheadline@@Kunst-Katalog für Künstler und Galerien##t3__fliesstext@@Kunst-Katalog sind eine Darstellung von Werken und dem KünstlerInnen. Für einen Katalog benötigt man dazu die Bestandteile: Gestaltung, Text und Bild. In der Regel soll die Gestaltung zwar wertig, aber nicht in Konkurrenz zu den Werken stehen, sondern sie präsentieren. Texte sollten treffend sein und nicht exaltiert und die Fotos dem Original entsprechen. Wir bieten Ihnen als Werbeagentur eine Gestaltung, die Ihre Werke präsentiert und auch Erlebniswelten schafft, Texte die Ihrer Intuition entsprechen und professionelle Fotoerstellungen von Fotografen, die auch für Museen Bilder fotografieren und dokumentieren (und zwar so perfekt, wie es heute möglich ist). ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
