INSERT INTO `content` VALUES('2405', '75', '0', '0', '', 't1__bild@@1661##t1__subheadline@@Kunst-Katalog##t1__fliesstext@@Bildende Künstler, ob Maler oder Bildhauer, aber auch die Galerien brauchen irgendwann für Ausstellungen, als Übersicht Ihrer Werke oder als Selbstdarstellung einen Kunst-Katalog. In der Regel bedient man sich nicht einer professionellen Werbeagentur...aus kostengründen. Unsere Agentur besteht vorwiegend aus diplomierten Designern, die der Kunst sehr nahe stehen und auch professionelle Texterstellungen oder Objektfotografien anbieten. Fragen Sie uns doch einfach mal an.##t2__interner_link_@@310|Kunst-Katalog##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '5', '', '', '', '', '0', '0', '', '0');
