INSERT INTO `content` VALUES('2418', '304', '0', '0', '', 't1__subheadline@@Fahrzeugbeschriftungen auf Nutzfahrzeugen eines Entsorgungsunternehmen##t1__fliesstext@@Im Rahmen eines einheitlichen Erscheinungsbildes wurden zunächst nur noch weiße Fahrzeuge angeschafft. Im weiteren Schritt wurden alle Nutzfahrzeuge mit unterschiedlichen Schwerpunktthemen ausgestattet.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '15', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2419', '20', '0', '0', '', 't1__subheadline@@Suchmaschinenoptimierung 1 - Basic##t5__fliesstext@@Basisoptimierung der Website\r\n\r\nLeistungen:##t1__aufzaehlung_dots@@Festlegung von möglichen Suchbegriffen Keywords (Einzelbegriffen) und Phrasen (Wortkombination) bestehend aus 2 Schwerpunktsuchwörtern und 8 Nebensuchwörtern und den daraus sich ergebenden Phrasen. \r\nIst-Analyse mit den definierten Suchbegriffen (Tabellenform)\r\nBasisoptimierung von Seitentitel, Hauptüberschrift, Seitenbeschreibungen und Metatags (Seitenanzahl >40 /<50.\r\nEinfache Textüberarbeitung der bestehender Texte nach SEO relevanten Vorgaben \r\nAuswertung der Aktivitäten in Tabellenform.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2420', '20', '0', '0', '', 't1__subheadline@@Suchmaschinenoptimierung 2 - Advanced##t5__fliesstext@@Betreuung der Website über 4 Monate\r\n\r\nLeistungen:\r\n##t1__aufzaehlung_dots@@Erweiterung der Suchbegriffe bzw. -phrasen (Anzahl: 20) \r\nMonatliche Analyse der Auswertung (Google Ranking)\r\nAbgleich mit den aktuellen Top 10\r\nWeitere Optimierung ausgewählter Seiten\r\nTexterstellung und Einpflegung nach \r\nSEO-Anforderungen\r\nMonatliche Auswertung (Tabellenform)##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2421', '20', '0', '0', '', 't1__subheadline@@Suchmaschinenoptimierung 3 - Support##t5__fliesstext@@Kontinuierliche Betreuung der Website.\r\nMindestlaufzeit 3 Monate.\r\nAutomatische Verlängerung um einen Monat. Jederzeit kündbar.\r\n\r\nLeistungen:\r\n##t1__aufzaehlung_dots@@Monatliche Analyse der Auswertung (Google Ranking)\r\nAbgleich mit den aktuellen Top 10\r\nWeitere Optimierung ausgewählter Seiten\r\nTexterstellung und Einpflegung nach SEO-Anforderungen\r\nMonatliche Auswertung (Tabellenform)\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
