INSERT INTO `content` VALUES('2437', '296', '0', '0', '', 't1__subheadline@@Dokumentation über die 360 Grad Fotografie##t1__fliesstext@@Ausstellungen in Galerien und Museen sind temporär und vergänglich, Immobilien, ob historisch oder als Neubau nicht immer begehbar oder im aktuellen Zustand erlebbar. Hier dokumentiert die 360 Grad Fotografie das Ereignis und macht es auch Jahre später erlebbar.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2439', '296', '0', '0', '', 't1__subheadline@@Die 360 Grad Fotografie als Entscheidungshilfe##t1__fliesstext@@Der Tourismus- und Freizeitbereich ist in fast jedem Land ein entscheidender Wirtschaftsfaktor. Wenn sich Touristen für eine Region, ein Hotel, eine Gastronomie oder Wellness- oder Freizeitanlage interessieren, suchen sie nach möglichst aufschlussreichen Informationen im Internet. Die 360 Grad Fotografie bietet hier dem Betrachter, entgegen eines Filmes, die Möglichkeit, dass zu betrachten, was ihn interessiert. Näher oder weiter, den Blick nach oben oder unten, ein Detail heranzoomen, mit 360 Grad Fotografie alles möglich.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2438', '296', '0', '0', '', 't1__subheadline@@360 Grad Fotografie als internationale Verkaufshilfe##t1__fliesstext@@Ihre Immobilie oder Objekt ist oder kann gerade für ausländische Zielgruppen wie Investoren interessant sein und es trennen sie tausende von Kilometern. Erleichtern Sie Ihren Interessenten den ersten Entscheidungsschritt und bieten Sie auf professionelle Art einen optimalen Einblick in Ihr Angebot.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
