INSERT INTO `content` VALUES('2450', '99', '0', '0', '', 't5__subheadline@@Der gemietete Internet-Shop##t5__aufzaehlung_dots@@Nachteil ist, dass man jeden Monat, in der Regel erträglichen Betrag, zahlen muss. Großer Vorteil ist, gerade bei Klein- und mittelständischen Unternehmen, die geringeren Einrichtungskosten und Integrationen in die eigene Website. Die Aktualisierungen der Software an die neuesten Webanforderungen sind kostenlos und man kann bei vielen Anbietern Pakete nutzen, die man gerade benötigt und auch „optimal“ zu Ihrer Aufgabe passen.##t5__umbruch@@umbruch##t5__subheadline@@Der Open Source Web-Shop##t5__aufzaehlung_dots@@Open Source Web-Shops kosten erst einmal nichts und können viel. Hier verhält es sich wie bei den CMS-Systemen. Der Kostenfaktor verbirgt sich hier in der Programmierung auf die individuellen Anforderungen. Wer nur über das Internet vertreibt und mehr als 400 Produkte hat, kommt an diesen Open Source Lösungen nicht vorbei.##t5__umbruch@@umbruch##t5__subheadline@@Der Online-Shop als Eigenentwicklung##t5__aufzaehlung_dots@@Fast jedes Unternehmen mit erfolgreichen und meist großen Online-Shops stellt irgendwann fest, dass der Anteil an fertigen Lösungen nicht optimal genug an die entstandenen Bedürfnisse heranreichen. Der Anteil an individuell programmierten Lösungen steigt, bis man sich zu der Investition entschließt, eine individuelle Eigenentwicklung realisieren zu lassen. \r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
