INSERT INTO `content` VALUES('2454', '99', '0', '0', '', 't1__subheadline@@4: Die Bilder - Was ist das wichtigste am Online-Shop##t1__fliesstext@@Man kennt Sie nicht und man sucht ein Produkt! Vor dem Preis steht die Produktabbildung. Sie können einen tollen Preis anbieten, haben Sie aber kein Foto, dass dem Interessenten das Produkt, was er sucht, visuell bestätigt. Er / Sie wird er es nicht bestellen. Als Webagentur hier unsere Erfahrung im Umgang mit den Produktabbildungen. Sehen wir mal davon ab, dass die Abbildung illegal geklaut wurde (ein schlechter Start für jede Unternehmung) oder vom Hersteller gestellt werden. \r\nNicht nur Online-Shop Gründer kommen schnell auf eine Idee: Ich spare mir die Kosten und mach es selbst. Ich kauf mir die neuste Kamera und dann habe ich tolle Bilder in Nullkommanix. Erste Erkenntnis, geht doch, habe aber ziemlich lange dafür gebraucht und die eigentliche Arbeit ist liegengeblieben. Ist ja schon ziemlich viel Arbeit. Zweite Erkenntnis: Warum sehen die Bilder der Konkurrenz trotzdem besser aus? Dritte Erkenntnis (nach mehrstündiger oder -tägiger Recherche): Ich brauche auch noch eine Blitz- oder Lichtanlage oder ein Lichtzelt. Vierte Erkenntnis: Warum sehen die Bilder der Konkurrenz trotz neuer Lichtanlage immer noch besser aus? Nun, dass können wir Ihnen sagen, ohne Ihnen auf die Füße zu treten. Es liegt nicht am Equipment, sondern am Können. \r\nPhotographers makes light work.\r\nAls Webagentur bieten wir Ihnen nicht nur professionelle Produktfotografie, sondern auch persönliche, individuelle Schulungen an Ihren Produkten, mit Ihrem Equipment vor Ort oder bei uns.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '8', '', '', '', '', '0', '0', '', '0');
