INSERT INTO `content` VALUES('2453', '99', '0', '0', '', 't1__subheadline@@3: SEO oder untergehen##t1__fliesstext@@Einen Web-Shop online zu haben ist eine Sache. Nicht gefunden zu werden aber so, als wenn Sie sich mit Ihren Angeboten im Urwald verstecken. Dazu brauchen Sie auch keinen Online-Shop. SEO bzw. Suchmaschinenoptimierung wird von der Wichtigkeit und von den Kosten viel zu oft unterschätzt. Hier gibt es zwar Anbieter die Ihnen für ein paar 100 EUR die besten Plätze bei Google und Co. versprechen, aber sie sind unseriös und können Ihrem Unternehmen sogar schaden. Lassen Sie sich lieber Beraten und von einer seriösen Agentur betreuen. Regelmäßig zu betreuen! Bei einem Online-Shop mit einer mittleren Größe kommen Sie nicht daran vorbei. Undes rechnet sich. Richtige Produktbeschreibungen zu verfassen, können Sie lernen, wenn Sie die Zeit dafür haben, den Rest sollten sie Profis überlassen, wenn Sie potentielle Käufer in Ihren Web-Shop leiten wollen und nicht die Absicht haben unterzugehen.\r\n##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2451', '99', '0', '0', '', 't1__subheadline@@2. Online-Shops und Warenwirtschaft##t1__fliesstext@@Je nach Größe steigt das Bedürfnis nach Optimierung der Ablaufprozesse im Unternehmen. Plötzlich geht es um die Integration von Lagerhaltungen oder der Buchhaltung bzw. anderer wahrenwirtschaftlicher Aufgabenstellungen. Jetzt kommt es darauf an, die richtigen Schnittstellen zu haben oder nicht. Ein guter Online-Shop hat sie in der Regel.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2452', '99', '0', '0', '', 't1__subheadline@@5: Zahlungsarten für Internet-Shops##t1__fliesstext@@Gehen Sie auf E-Bay und kaufen Sie sich ein Produkt über 400 EUR. Wählen sie einen Anbieter mit Pay-Pal oder ohne. Wer schon mal schlechte Erfahrungen gemacht hat, weiß wovon wir sprechen. Waren- und Geldfluss sollten reibungslos laufen.\r\nDaher ist die Zahlungsart optimiert auf Ihre Zielgruppe wichtig. Sie haben einen Lieferservice für Pizza, Burger und Co? Zahlung bei Lieferung. Sie brauchen, zumindest für den Start, keine Online-Zahlungssysteme! \r\nIhre Produkte kosten wenig und Ihre Zielgruppe hat kein großes Einkommen? Dann können Sie auf Kreditkarten erst einmal verzichten. Sie haben teure Produkte und entsprechende Kunden? Sie kommen um ein breites Spektrum an Zahlungsmöglichkeiten und vor allem Kreditkarten nicht umhin. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2455', '99', '0', '0', '', 't1__subheadline@@6: Web-Shop und alles läuft. Weit gefehlt.##t1__fliesstext@@Wer stellt neue Produkte und Angebote ein? Wer kümmert sich um all die Dinge, die angepasst, verändert oder erneuert werden müssen. Große Unternehmen haben dafür eigene Abteilungen mit Spezialisten. Je kleiner das Unternehmen, je problematischer wird es. Bei Kleinunternehmen ist es dann der Chef der sich darum kümmert, bis er merkt, dass er seinen Kernaufgaben nicht mehr nachkommen kann. Web-Shop-Pflege gehört allerdings zum täglichen Geschäft. Dazu sollte man, bei all der vielen und tollen Web-Shop Systeme aber auch in der Lage sein, mittels HTML und CSS Veränderungen vornehmen zu können.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '10', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2456', '99', '0', '0', '', 't1__subheadline@@7: Internet-Shop steht - Aber dann? - Der Kundenservice ##t1__fliesstext@@Woran haben Sie, wenn Sie über Internet-Shops bestellt haben, entschieden, welcher gut und welcher schlecht waren?\r\nUnd konnten Sie sich den Namen merken? Der Name ist eine Frage des Corporate Designs und auch des Werbeaufkommens. Der Rest liegt aber in Ihrem Handeln. Teil eins: Das Produkt muss stimmen. Teil zwei: Es sollte so schnell wie möglich beim Käufer sein. Das ist Pflicht! Nicht einfach nur kann! Bald gibt es über Amazon Same-Day-Delivery (Morgens bestellen, abends ausgeliefert). Sie wissen, warum sie es machen, der Kunde ist so begeistert, dass er nur noch über dieses Unternehmen bestellt. \r\nKulanzverhalten, ein einfaches Retourenprozess, eine Telefonnummer die auch mit einem Ansprechpartner besetzt ist und ab und zu, ohne zu nervig zu sein, eine nützliches Angebot über E-Mail oder Newsletter. All das trägt zu Ihrem Erfolg bei.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '5', '1', '11', '', '', '', '', '0', '0', '', '0');
