INSERT INTO `content` VALUES('2493', '105', '0', '0', '', 't1__bild@@1675##t1__subheadline@@Webdesign für Konsumer-Produkte##t1__fliesstext@@Webdesign für Konsumer-Produkte ist vor allem durch die Produkt- und Umfeldpräsentaton geprägt. Als Webagentur bieten wir Ihnen ein individuelles Webdesign für klassische Internetauftritte, PR-Portale und Web-Shops. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2494', '105', '0', '0', '', 't1__bild@@1674##t1__subheadline@@Webdesign: Sportvereine oder Extremsport##t1__fliesstext@@Als Webagentur liefern wir das Webdesign und deren Umsetzung für Sportvereine, Markenhersteller oder Extremsportbereiche. Neben dem Webdesign bieten wir auch branchenspzifische Programmierlösungen oder die Online-Redaktion an. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2495', '105', '0', '0', '', 't1__bild@@1677##t1__subheadline@@Webdesign für Existenzgründer##t1__fliesstext@@Als Existenzgründer oder Start-up ist die Internetpräsenz sehr wichtig. Dabei sollte einem klar sein, dass die pure Präsenz über Billiglösungen keine Alternative ist. Sie wollen mit Ihrem Unternehmen Geld verdienen, um Ihre Existenz zu sichern. Warum sparen sie dann an den Schuhen, wenn Sie Maraton laufen wollen? Profitieren Sie von unserer Webagentur und lassen sich beraten. Wir finden Lösungen, die Webdesign für Existenzgründer bezahlbar und in der \'Regel zu einer langfristigen Partnerschaft führt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2496', '105', '0', '0', '', 't1__bild@@1676##t1__subheadline@@Webdesign für Umwelt und erneuerbare Energien##t1__fliesstext@@Wir gestalten Webauftritte zum Thema Umwelt und erneuerbare Energien, die oft eine illustrative Gestaltung benötigen. Grund ist die progressive Entwicklung, die für die Basisgestaltung eine permanente Anpassung erfordern würde, währen Inhalte durch ein Content-Management-System auf aktuellem Stand gebracht werden können. Ferner tragen Illustrationen im Webdesign zum Verständnis von komplexen Abläufen oder Zusammenhängen bei.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '8', '', '', '', '', '0', '0', '', '0');
