INSERT INTO `content` VALUES('2506', '4', '0', '0', '', 't1__fliesstext@@Damit wir wissen was Sie brauchen, ist es wichtig, dass Sie uns ein paar Informationen mit auf den Weg geben.\r\n\r\nBenötigen Sie eine kompetente Beratung, eine kreative Gestaltung, eine professionelle Produktion?\r\nFür welches Vorhaben, Medium und wann soll Ihr Projekt realisiert werden?\r\n\r\nWir beraten Sie gerne und/oder erstellen Ihnen ein kostenloses und unverbindliches Angebot.\r\n\r\nIhre Kontaktdaten behandeln wir selbstverständlich streng vertraulich.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '3', '', '', '', '', '0', '0', '', '0');
