INSERT INTO `content` VALUES('2511', '188', '0', '0', '', 't3__headline@@Jugend und die Online-Medien##t3__subheadline@@Wer Jugendliche erreichen will, sollte Papier erst später verwenden##t3__fliesstext@@Für Unternehmen, öffentlichen Einrichtungen und Ministerien ist Konzept-fünf kreativer Gestalter im Bereich Jugend tätig. Die jeweiligen Unternehmen bzw. Einrichtungen benötigen hier das Wissen einer spezialisierten Agentur, um mit der jeweiligen Altersgruppe zu kommunizieren und entsprechende Werbekampagnen zu entwickeln. Dies geschieht heute über das Internet und deren Kommunikationskanälen. In diesem Bereich ist die Präsenz des Unternehmens oder der Produkte im Internet extrem wichtig. Neben der Suchmaschinenoptimierung (SEO) der eigenen Website bieten wir Ihnen auch die redaktionelle Betreuung von Online-Medien an. ##', '1', '1', '', '', '', '', '1', '0', '0', '0', '3', '1', '1', '', '', '', '', '0', '0', '', '0');
