INSERT INTO `content` VALUES('2514', '101', '0', '0', '', 't1__subheadline@@Zu wenig Personal für Ihre aktuellen Werbe- und Kommunikationsprojekte?##t1__fliesstext@@Koordinationen von Übersetzung durch ein Übersetzungbüro, fachspezifische Texte durch externe Texter, Illustratoren, Fotografen, Programmierer, Cathering-Unternehmen, Event-Anbieter, Anzeigenverlage, Online-Partnerpflege oder Druckereien. Wir behalten nicht nur den Überblick für Sie, sondern kümmern uns um den geeigneten und bezahlbaren professionellen externen Partner, Briefen ihn und führen vor Abgabe eine Qualitätskontrolle durch. Ein wichtiger Servicebaustein für Ihr Ziel und einen Weg ohne Umwege, wenn Ihnen nicht das passende Personal für die Administration zur Verfügung steht. Sprechen Sie uns einfach an und profitieren Sie von über 25 Jahren Erfahrung.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '3', '', '', '', '', '0', '0', '', '0');
