INSERT INTO `content` VALUES('2521', '103', '0', '0', '', 't1__bild@@1683##t1__subheadline@@Peoplefotografie - On Location oder im Studio##t1__fliesstext@@Es gibt Bildagenturen zum Thema Peoplefotografie für die Bebilderung von Online- und Printmedien. Aber man wird schnell feststellen, dass wirklich gute Bilder dann doch einige hundert Euro kosten und sie dennoch andere kaufen und verwenden können. Wenn Sie individuelle Fotos von eigenen Models oder Ihren Mitarbeitern benötigen, hat sich das Thema Bildagentur auch schnell erledigt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '4', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2522', '103', '0', '0', '', 't1__bild@@1684##t1__headline@@Die 360 Grad Fotografie##t1__subheadline@@Medium für Raum und Ausstellungspräsentationen##t1__fliesstext@@Zur 360 Grad Fotografie finden Sie unter \"Digitale Medien\" detaillierte Beispiele.##t1__interner_link_@@296|360 Grad Fotografie##', '1', '1', '', '', '', '', '1', '0', '0', '0', '2', '1', '9', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2525', '181', '0', '0', '', 't1__subheadline@@Warum selber machen keine gute Idee ist:##t1__fliesstext@@Woran merkt man, ob eine Aufnahme gut oder schlecht ist? Daran, ob sich ein Produkt verkauft oder liegen bleibt! Lohnt es, in die Aufnahme eines Produkts 25€ und oft mehr zu investieren, wenn man es nur für 4,99€ verkauft und bestenfalls eine Marge von 100% daran hat? Die ersten zehn Verkäufe gehen also an den Fotografen.\r\nMerken wird man es spätestens dann, wenn dadurch, dass man an der Produktfotografie gespart hat, nicht mal zu den 10 Verkäufen kommt.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '6', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2526', '181', '0', '0', '', 't1__subheadline@@Produktfotografie und das Internet##t1__fliesstext@@Das einzige, womit sich als ein Anbieter von seinen Konkurrenten unterscheiden kann, ist der Preis, eine gute Beschreibung und die Produktabbildung. Von daher sollte man den Wert einer guten Produktaufnahme nicht unterschätzen.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '7', '', '', '', '', '0', '0', '', '0');
INSERT INTO `content` VALUES('2527', '107', '0', '0', '', 't1__subheadline@@Was macht eigentlich ein Grafikdesigner?##t1__fliesstext@@Die Tätigkeitsfelder eines Grafikers sind sehr vielfältig und beginnen bei der Beratung und Konzeption, über Entwurfsgestaltung, Satz, Typografie, Illustration, Bildbearbeitung, alles zusammen auch Grafikdesign genannt, bis zur Druckvorstufe. Zudem steht ein Grafiker im engen Kontakt mit den Druckereien, Programmierern oder Werbemittelherstellern, um eine erfolgreiche Projektabwicklung zu gewährleisten.\r\nEin professioneller Grafiker, Grafikdesigner oder Webdesigner liefert in der Regel nicht nur die nach Briefing definierte Gestaltung, sondern auch die druckfähige bzw. webfähigen Vorlagen, auch Reinzeichnung genannt, für die Umsetzung bzw. Produktion.##', '1', '1', '', '', '', '', '1', '0', '0', '0', '1', '1', '5', '', '', '', '', '0', '0', '', '0');
